(489,	'KOVALIK',	'Director/editor/entrepreneur. Kovalik recently won an Emmy Award for his directing work for the Detroit Pistons’ 2015-2016 TV Campaign. The Campaign also received top honors winning the 2016 NBA Marketing Award as selected by the other teams.  \r\n\r\nBorn in the former Czechoslovakia and raised in Toronto, Kovalik studied film at NYU and eventually settled in Los Angeles.  In 1997 he opened up an editing company that became Beast Editorial.  Under Kovalik’s management Beast grew into one of the largest commercial editorial companies in the USA with offices in LA, New York, San Francisco, Austin, Chicago, Detroit and Atlanta.   \r\n\r\nSince selling his interest in Beast to Deluxe Media, he’s focused primarily on content creation and documentary work. He has traveled around the world shooting and creating viral campaigns for Western Union, Princess Cruises, INTEL and the UN.\r\n\r\nAlong with his commercial clients, Kovalik has been active in the music video industry having worked with Pink, Shakira, REM, David Guetta, and The Black Eyed Peas among others. He has been collaborating with Linkin Park since 2007 and has had a hand in every music video they have created since. Kovalik has also worked extensively with musician/entrepreneur will.i.am for the past 8 years. In total, his videos have had more than 3 billion views.\r\n\r\nKovalik has worked on numerous feature length films including projects for Oprah Winfrey and Michael Mann.\r\n\r\nAmong other projects Kovalik is currently shooting a documentary focusing on Domestic Violence with the producers of the Academy Award nominated Cartel Land. \r\n\r\nKovalik has won numerous Clios, MTV Music Video Awards, Cannes Lions and an Emmy.\r\n',	'Igor',	'Kovalik',	'1487188775.jpg',	1024,	662,	256,	166,	512,	331,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'0',	'0',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'0',	0,	'',	'1487203173.jpg',	524,	294,	256,	144,	0,	0),
