INSERT INTO `tbl_posts` (`post_id`, `chapter_id`, `channel_id`, `type`, `date`, `aspect_ratio`, `title`, `description`, `featured`, `subscription_id`, `audio_url`, `video_url`, `youtube_url`, `touchcast_url`, `xml_url`, `second_video`, `link_url`, `link_thumb`, `thumb_width`, `thumb_height`, `thumb_url`, `hdthumb_width`, `hdthumb_height`, `hdthumb_url`, `retina_width`, `retina_height`, `retina_url`, `nonretina_width`, `nonretina_height`, `nonretina_url`, `sd_width`, `sd_height`, `sd_url`, `music_url`, `song`, `author`, `album`, `itunes_link`, `encoding_id`, `encoding_id_hd`, `short_url`, `story`, `poix`, `poiy`, `post_status`, `featured_post`, `post_edit`, `post_hash`) VALUES
(192,	473,	3,	'image',	'1400216400',	NULL,	'SUBSCRIBE to David Guetta\'s VAST Channel and be the first to see the 90-minute TouchCast presentation of this concert in it\'s entirety.',	'',	'1',	'com.vast.davidguetta',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'108.375',	'1400229819.jpg',	'512',	'216.75',	'1400229819.jpg',	'4096',	'1734',	'1400229819.jpg',	'2048',	'867',	'1400229819.jpg',	'1024',	'433.5',	'1400229819.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoV94A',	'What can you say about this ubiquitous DJ that hasn\'t already been said? His popularity is through the roof. When you measure him with a Geiger meter, his radiation by hateration levels are off the charts. He just might be the one the prophecies foretold. Recently, the French savant received his 50 millionth Facebook like, and to celebrate, he released this 12-minute video in honor of his fans, and modern apartheid. Guetta went to the Dead Sea in Israel to play a show, and the results were not only legendary, but epic as well! Keep doing your thing kids. We see you.',	'0.5',	'0.43',	'1',	'0',	'1',	'e75c96271047249d8812da9eefe4936e0a5ff2c7'),
(193,	467,	3,	'image',	'1400216520',	NULL,	'HEADPHONES ARE MY INSTRUMENT',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'192.25',	'1400229933.jpg',	'512',	'384.5',	'1400229933.jpg',	'4096',	'3076',	'1400229933.jpg',	'2048',	'1538',	'1400229933.jpg',	'1024',	'769',	'1400229933.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoW84y',	'They\'re as important to me as the guitar is to Keith Richards, or the microphone is to a singer. My day starts with me waking up and putting on my headphones - and that\'s because they\'ll be lying on my bed from when they fell off as I went to sleep. If I\'m on tour, I\'m in a new city nearly every day, so I\'m travelling or working, and they never leave my head! Strength is important in headphones because using them to DJ with is not like being in the studio - I need to put them on and take them off a thousand times, and I\'m moving around a lot. As a DJ and producer, I need headphones that are made from a musician\'s point of view, rather than an engineer\'s. To get a bit technical, when the headphones are made they will be tuned to decide how much bass and treble they give out. Most companies will do this using a visualisation, but Beats does it by ear, which means when I listen back to something I\'ve recorded it sounds much more like it did in the studio. This also means the artists I\'ve been working with on my latest album - Snoop Dogg, Usher, Will.i.am - can do the same without us all going back to the mixing desk. This is the only way I can produce music on the road with my laptop and my headphones, and know what it will actually sound like. It means I can make a record in my hotel room in the afternoon and play it in the club later that night.',	'0.49',	'0.48',	'1',	'0',	'0',	'81d5576e328dca327f67bab461efcdc6c43aa5a9'),
