(200,	467,	3,	'image',	'1400217240',	NULL,	'I have the best fans in the World.?I love you #NationGuetta.',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'348.59574468085',	'1400231693.jpg',	'512',	'697.1914893617',	'1400231693.jpg',	'3008',	'4096',	'1400231693.jpg',	'2048',	'2788.7659574468',	'1400231693.jpg',	'1024',	'1394.3829787234',	'1400231693.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoV9RT',	'This wallpaper was submitted by Se Du from Bienne, Switzerland. I am blessed to have over 50,000,000 amazing fans and I love to see how they are inspired by my work. Every month I will feature a different piece of fan art in this section that has inspired me. ',	'0.49',	'0.14',	'1',	'0',	'0',	'0b06f66e8a0b446d41d7ea4849e20a3da109b5e2'),
(201,	472,	3,	'image',	'1400217300',	NULL,	'POP LIFE IS MY THIRD STUDIO ALBUM ',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1400232441.jpg',	'512',	'512',	'1400232441.jpg',	'2048',	'2048',	'1400232441.jpg',	'2048',	'2048',	'1400232441.jpg',	'1024',	'1024',	'1400232441.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoV9Bp',	'It was released in 2007 and produced with Joachim Garraud. My longtime collaborator Chris Willis is the main vocalist; guest vocals are provided by JD Davis, Tara MacDonald, Juliet Richardson and Thailand. The first single to be released from Pop Life was \'Love Is Gone\', which became a Top 10 hit on the UK Singles Chart, peaking at #9. The remix by Fred Rister (Frédéric Riesterer) and Joachim Garraud received plays in dance clubs across the world. The second single was \'Baby When The Light\', which featured vocals by Cozi and addition production by Steve Angello. Subsequent singles include \'Delirious\', featuring Tara MacDonald on vocals, \'Tomorrow Can Wait\' and \'Everytime We Touch\'. The album has sold over 530,000 copies worldwide and 18,000 copies in the United States.',	'0.33',	'0.2',	'1',	'0',	'0',	'eff30873048b8608fd891544df3617350333aa58'),
