(208,	471,	3,	'image',	'1400220660',	NULL,	'GUETTA BLASTER',	'\r\n',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1400241037.jpg',	'512',	'512',	'1400241037.jpg',	'2048',	'2048',	'1400241037.jpg',	'2048',	'2048',	'1400241037.jpg',	'1024',	'1024',	'1400241037.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoV1BX',	'Guetta Blaster is my third studio album. It was released on June 7, 2004 by Perfecto Records, Gum Prod.',	'0.49',	'0.35',	'1',	'0',	'0',	'ea9cb21a95ef4f06440159be3a33f382fbad217c'),
