(215,	470,	3,	'image',	'1400221080',	NULL,	'NOTHING BUT THE BEAT IS MY FIFTH STUDIO ALBUM',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'159.875',	'1400243482.jpg',	'512',	'319.75',	'1400243482.jpg',	'4096',	'2558',	'1400243482.jpg',	'2048',	'1279',	'1400243482.jpg',	'1024',	'639.5',	'1400243482.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoUMa5',	'It was released on August 26, 2011. Released as a double album, the first disc features collaborations with artists from the R&B, hip hop and pop worlds such as Lil Wayne, Taio Cruz, Nicki Minaj, Ludacris, Snoop Dogg, Afrojack, Chris Brown, Flo Rida, Usher, Jennifer Hudson, Dev, Timbaland, Jessie J and Sia Furler. Also making appearances are Will.i.am, Akon and Ne-Yo, all three of whom previously collaborated with Guetta on his fourth album, One Love. In comparison, the second disc features purely instrumental tracks. The album is also Guetta\'s first album that does not feature long-time collaborator Chris Willis on vocals. Critical reviews of the album were mixed. The album has thus far spawned four singles which attained success on the US Hot 100 - \'Where Them Girls At\', \'Without You\', \'Turn Me On\' and \'Titanium\' - becoming his third, fourth, fifth and sixth top 20 singles, respectively. On November 30, 2011, the album received a nomination for Grammy Award for Best Dance/Electronica Album at the 54th Grammy Awards. As of October 2012, the album has sold 407,000 copies in the US, and has received platinum certification by the IFPI for sales exceeding 1,000,000 copies throughout Europe. On March 26, 2012, the electronic album was released as a standalone package, via the iTunes Store. This version was previously released through Beatport.',	'0.67',	'0.17',	'1',	'0',	'0',	'426674446302a4576a7be00d6339ed4b574da8bc'),
