(219,	62,	3,	'image',	'1400221320',	NULL,	'2.0 WAS AN UPDATE TO MY FIFTH STUDIO ALBUM. ',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1400244164.jpg',	'512',	'512',	'1400244164.jpg',	'2048',	'2048',	'1400244164.jpg',	'2048',	'2048',	'1400244164.jpg',	'1024',	'1024',	'1400244164.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVpAz',	'Released on September 7, 2012, it includes six new tracks including lead single \'She Wolf (Falling to Pieces)\', which features Sia, who previously collaborated with Guetta on \'Titanium\'. The remixes of this single were released exclusively through Beatport on August 7, 2012. Several tracks from the original album have been removed from the re-release, however all the singles have been retained. A final edition of the album dubbed Nothing but the Beat Ultimate, was released on 10 December 2012 featuring the original album plus all of the new songs from the 2.0 edition - though contained the full-length edits of \'Sunshine\', \'Lunar\' and \'Metropolis\', as opposed to the shorter edits on 2.0 - and a sixteen-second shorter version of \'Where Them Girls At\'.',	'0.47',	'0.11',	'1',	'0',	'0',	'c7a648260715743a6eed9c6aa50632d365632a7e'),
