(223,	62,	3,	'video',	'1400221680',	NULL,	'MY NOTHINGBUTTHEBEAT2.0 INTERVIEW',	'',	'0',	NULL,	'',	'1400492896.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'davidguetta1403006239.jpg',	'512',	'288',	'davidguetta1403006239.jpg',	'',	'',	'',	'',	'',	'',	'640',	'360',	'davidguetta1403006239.jpg',	'',	'',	'',	NULL,	NULL,	'25629003',	'',	'http://j.mp/1UoVyEb',	'This interview shares my in-depth feelings of my double album, Nothing But The Beat 2.0. I explain how I feel about my identity as a DJ, how the artists I work with truly inspire me and the things I fell in love with through the process. I really hope you love it, this record means a lot to me because it was an exciting transition to a much more electronic sound.',	'0.41',	'0.39',	'1',	'0',	'0',	'fa25863229470a09eab841382435bb27d0c491d9'),
(225,	468,	3,	'music',	'1422307225',	NULL,	'SHOT ME DOWN',	'',	'1',	NULL,	'',	'',	'',	'',	'',	'1400246502.mp4',	NULL,	NULL,	'256',	'192.25',	'test1231400271593.jpg',	'512',	'384.5',	'test1231400271593.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'769',	'test1231400271593.jpg',	'1400246255.mp3',	'Shot me down',	'David Guetta',	NULL,	NULL,	'',	'',	'http://j.mp/1UoVpk5',	'Featuring vocals from Skylar Grey \'Shot Me Down\' was released on 3 February 2014 as a digital download. The song has peaked at number six on the French Singles Chart, while also peaking within the top ten of the charts in Belgium, the United Kingdom, the Republic of Ireland, Denmark and Hungary and the top twenty of the charts in Germany, Spain and Italy.The original version of the song was released by Cher in 1966 and was famously covered by Nancy Sinatra in the same year.',	'0.43',	'0.29',	'1',	'0',	'0',	'43eea05c6d319b9e2268e9d5365d50fd7842789d'),
(226,	468,	3,	'music',	'1400221920',	NULL,	'PLAY HARD',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'test1231400271935.jpg',	'512',	'512',	'test1231400271935.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'1024',	'test1231400271935.jpg',	'1400246556.mp3',	'Play Hard',	'David Guetta feat. Ne-Yo & Akon',	NULL,	NULL,	'',	'',	'http://j.mp/1UoVa8p',	'Featuring vocals from Ne-Yo and Akon, from the re-release of Guetta\'s fifth studio album, \'Nothing But The Beat\'. All three artists co-wrote the song with Frédéric Riesterer and Giorgio Tuinfort, both of whom produced the song with Guetta. The song samples the 1999 Eurodance song \'Better Off Alone\' by Alice DeeJay. \'Play Hard\' peaked at number six on the UK Singles Chart, thus becoming his fourteenth top 10 hit in the UK as a lead artist. It also charted within the top 40 of the charts in several other countries.',	'0.47',	'0.11',	'1',	'0',	'0',	'211ad691cef73df23c43a16e33b6694fc7b097c2'),
(227,	468,	3,	'music',	'1400221980',	NULL,	'SHE WOLF',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'davidguetta1408458319.jpg',	'512',	'512',	'davidguetta1408458319.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'1024',	'davidguetta1408458319.jpg',	'1400246684.mp3',	'She Wolf',	'David Guetta',	NULL,	NULL,	'',	'',	'http://j.mp/1UoVwfx',	'Featuring vocals from Australian recording artist Sia. It was released as the lead single from the re-release of Nothing But the Beat, Nothing But the Beat 2.0, and tallies as the album\'s seventh single overall. It was released via digital download on August 21, 2012.',	'0.48',	'0.1',	'1',	'0',	'0',	'0028f42dc8d514664e94a2bbdeed8386326e6fb6'),
(228,	62,	3,	'video',	'1397111640',	NULL,	'SHE WOLF',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'146.23655913978',	'davidguetta1418933027.png',	'512',	'292.47311827957',	'davidguetta1418933027.png',	'',	'',	'',	'',	'',	'',	'1024',	'584.94623655914',	'davidguetta1418933027.png',	'',	'',	'',	NULL,	NULL,	'25629004',	'',	'http://j.mp/1UoV9RV',	'',	'0.51',	'0.49',	'1',	'0',	'0',	'd16ff9e05c9f4c78f2d056cb48f15fb916665e19'),
(229,	469,	3,	'image',	'1400222100',	NULL,	'ONE LOVE IS MY FOURTH STUDIO ALBUM',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'171.125',	'1400246897.jpg',	'512',	'342.25',	'1400246897.jpg',	'4096',	'2738',	'1400246897.jpg',	'2048',	'1369',	'1400246897.jpg',	'1024',	'684.5',	'1400246897.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoV80h',	'It was first released in the United Kingdom on 24 August 2009 through Virgin Records. Guetta\'s first major international release, the album received generally favourable reviews from music critics, and was a commercial success, selling over 3 million copies globally. It spawned a total of six worldwide hit singles throughout 2009 and 2010, most notably \'When Love Takes Over\' featuring American recording artist Kelly Rowland, \'Sexy Bitch\' featuring Senegalese-American R&B singer Akon, and \'Who\'s That Chick\' featuring Barbadian recording artist Rihanna. Since the album\'s initial release it has since been reissued several times to include previously unreleased tracks and other bonus material. The album received a nomination for the 52nd Grammy Awards in the category Best Electronics/ Dance Album. The album\'s lead single, \'When Love Takes Over\' was nominated in the categories Best Dance Recording and Best Remixed Recording/ Non-Classical, and won the latter.',	'0.49',	'0.35',	'1',	'0',	'0',	'780120feb27628eeca2c831b3a91bbc8af971686'),
