(237,	474,	3,	'image',	'1425144772',	NULL,	'DAVID GUETTA CHOOSES \'#LOVE\' FOR \'THE WORLD NEEDS MORE...\' CAMPAIGN',	'',	'0',	'com.vast.davidguetta',	'',	'',	'',	'',	'',	'1400248615.mp4',	NULL,	NULL,	'256',	'256',	'869811426550890img.jpg',	'512',	'512',	'869811426550890img.jpg',	'512',	'512',	'869811426550890img.jpg',	'512',	'512',	'869811426550890img.jpg',	'512',	'512',	'869811426550890img.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1UoUUq3',	'French producer talks to MTV News about working with the U.N. to use social media for the greater good. By Elizabeth Lancaster for MTV News. David Guetta is best known for being a veteran of dance music and a hit-making machine, and now, the French producer is adding \'philanthropist\' to his resume. Alongside the United Nations, Guetta has launched \'The World Needs More...,\' a philanthropic and humanitarian campaign that aids victims of conflict and natural disasters, all powered by social media. When MTV News caught up with Guetta, he told us the recent typhoon in the Philippines inspired him to use his massive social media following for good. \'I really need everybody to tweet!\' he told us when we caught up with him at the United Nations Headquarters Friday night (November 22nd). Guetta has endorsed the word #love, which means that every time someone uses the hashtags #theworldneedsmore #love, he donates $1. (Other businesses have endorsed words like \'dreams\', \'hope\' and \'dialogue\'.) For Guetta, choosing this word was obvious. \'I\'m all about love, my songs, what I\'m trying to achieve when I\'m performing onstage, is that feeling like we are one\', he said. \'That\'s my goal when I perform, why aren\'t we feeling like one as a planet? That\'s love\'. In honor of his new project, the DJ/producer paired with indie singer Mikky Ekko for the campaign\'s title song, \'One Voice\', Mikky Ekko stood out to Guetta when he first heard his collaboration with Rihanna on \'Stay\', --- \'Oh my god, this is really next level\', he remembers thinking -- and knew he would be the perfect person for the track. The video for the track premiered on the side of the United Nations building in New York City. \'My hope is that every one of my videos does 100 million views, if we can get 100 million people watching the videos, sharing and tweeting, that would be a lot of money\'.',	'0.5',	' 0.5',	'1',	'0',	'1',	'0a0c254721e09b31e5fdf9786f7195139e63cd18'),
(238,	474,	3,	'image',	'1400222760',	NULL,	'MY FIRST TRIP TO THE UNITED NATIONS',	'',	'0',	'',	'',	'',	'',	'',	'',	'1400248782.mp4',	NULL,	NULL,	'256',	'192.25',	'1400248654.jpg',	'512',	'384.5',	'1400248654.jpg',	'4096',	'3076',	'1400248654.jpg',	'2048',	'1538',	'1400248654.jpg',	'1024',	'769',	'1400248654.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVSmh',	'By Kia Makarechi for Huffington.? Right now I\'m looking forward to this project, The World Needs More. I think it\'s the biggest thing that I\'ve ever done and I\'m trying to focus on it. Today I was in the UN and I met with the Secretary General and we recorded a message about the Philippines and for the campaign. This makes me think and step back a little bit from what I\'m usually doing, which is just running, running, running. It\'s just nice to do something a little different and more important than only taking care of my own person and my own music. Even though my music is, of course, making a lot of people happy. But this is bigger.',	'0.54',	'0.38',	'1',	'0',	'1',	'7d606d653b98091be319680ccbeeb106756e1e8a'),
(239,	474,	3,	'image',	'1400222760',	NULL,	'DAVID GUETTA PROJECTING NEW VIDEO ON UN HQ',	'By Andrew Hampp for BILLBOARD.? For his first single in two years, David Guetta has teamed with the United Nations to project his new music video on the UN headquarters building in New York City today (Nov. 22), World Humanitarian Day, at 7:30 p.m. EST. The event will be broadcast on Livestream  and via Guetta\'s Facebook page. The song, \'One Voice\', features vocals from Mikky Ekko (Rihanna\'s \'Stay\') and the video will premiere online around the same time as the UN broadcast. The Guetta event is part of the \'#TheWorldNeedsMore\' campaign, a collaborative effort between the UN Office for Coordination of Humanitarian Affairs, the UN Foundation, the UN Development Programme, the International Council of Voluntary Agencies and advertising agency Leo Burnett New York. As part of the campaign, global companies and brands have sponsored a word that will unlock $1 for aid to relief efforts from Typhoon Haiyan in the Philippines every time it\'s shared on social media. Guetta has sponsored the word \'#Love\'. Though \'One Voice\' was written before the UN tapped him to be part of the campaign, Guetta says the video will feature footage inspired directly by the organization. \'It\'s a combination of images from my tours with amazing images of real people around the world and the work that the UN is doing\', he says. \'Many of my music videos have gotten over 100 million views, so the idea that people could look at this video and exchange it, share it, then more people can tweet. I wish I could, but I can\'t always do things myself. I\'m just trying to work with people who are doing an amazing job by trying to use the emotions that I can give my music and how many people I\'m touching with it\'. Guetta is also beginning work on his follow-up to 2011\'s \'Nothing But The Beat\', an album that will be distributed through Big Beat/Atlantic in 2014, following Warner Music\'s acquisition of Guetta\'s label Parlophone earlier this year from EMI. Guetta spoke with Billboard last week during a press day for the UN campaign, and said he was going to begin writing a new song the following day. \'My day here at the UN is so inspiring, it\'s gonna change a lot what I want to say\', he says. \'It\'s really amazing to me\'.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'192.25',	'1400248876.jpg',	'512',	'384.5',	'1400248876.jpg',	'4096',	'3076',	'1400248876.jpg',	'2048',	'1538',	'1400248876.jpg',	'1024',	'769',	'1400248876.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVpR5',	'By Andrew Hampp for BILLBOARD.? For his first single in two years, David Guetta has teamed with the United Nations to project his new music video on the UN headquarters building in New York City today (Nov. 22), World Humanitarian Day, at 7:30 p.m. EST. The event will be broadcast on Livestream  and via Guetta\'s Facebook page. The song, \'One Voice\', features vocals from Mikky Ekko (Rihanna\'s \'Stay\') and the video will premiere online around the same time as the UN broadcast. The Guetta event is part of the \'#TheWorldNeedsMore\' campaign, a collaborative effort between the UN Office for Coordination of Humanitarian Affairs, the UN Foundation, the UN Development Programme, the International Council of Voluntary Agencies and advertising agency Leo Burnett New York. As part of the campaign, global companies and brands have sponsored a word that will unlock $1 for aid to relief efforts from Typhoon Haiyan in the Philippines every time it\'s shared on social media. Guetta has sponsored the word \'#Love\'. Though \'One Voice\' was written before the UN tapped him to be part of the campaign, Guetta says the video will feature footage inspired directly by the organization. \'It\'s a combination of images from my tours with amazing images of real people around the world and the work that the UN is doing\', he says. \'Many of my music videos have gotten over 100 million views, so the idea that people could look at this video and exchange it, share it, then more people can tweet. I wish I could, but I can\'t always do things myself. I\'m just trying to work with people who are doing an amazing job by trying to use the emotions that I can give my music and how many people I\'m touching with it\'. Guetta is also beginning work on his follow-up to 2011\'s \'Nothing But The Beat\', an album that will be distributed through Big Beat/Atlantic in 2014, following Warner Music\'s acquisition of Guetta\'s label Parlophone earlier this year from EMI. Guetta spoke with Billboard last week during a press day for the UN campaign, and said he was going to begin writing a new song the following day. \'My day here at the UN is so inspiring, it\'s gonna change a lot what I want to say\', he says. \'It\'s really amazing to me\'.',	'0.51',	'0.51',	'1',	'0',	'1',	'fcd7e408f8be8199bdf06dbd7c08ab75991a183b'),
(240,	474,	3,	'image',	'1400222880',	NULL,	'THE WORLD\'S LARGEST TWITTER BOARD',	'',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'192.25',	'1400249082.jpg',	'512',	'384.5',	'1400249082.jpg',	'4096',	'3076',	'1400249082.jpg',	'2048',	'1538',	'1400249082.jpg',	'1024',	'769',	'1400249082.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVrIJ',	'By Sowmya Krishnamurthy for ROLLING STONE MAGAZINE. David Guetta is turning to Twitter for a good cause. The international DJ/producer has partnered with the United Nations for \'The World Needs More...\' campaign to help raise money for humanitarian needs around the world. Guetta and other global brands have sponsored words meaningful to them; each time that word is tweeted, $1 is unlocked for aid efforts. With album titles like Just a Little More Love and One Love under his belt, it\'s no surprise that Guetta has sponsored the word \'#Love.\' \'There\'s been a lot of my songs about love and that\'s the kind of person that I am,\' he told Rolling Stone. \'It\'s the biggest energy in the world. Universal love. Have a little bit of compassion and love for each other. Some people might find it cheesy, I don\'t think that it is.\' \'The World Needs More...\' campaign was launched in support of World Humanitarian Day. In order to participate, fans simply need to tweet #TheWorldNeedsMore along with #Love. Other affiliated brands with sponsored words include: Barclays Bank (#Inclusion), Western Union (#Education), Gucci (#Strength), Crescent Enterprises (#Entrepreneurs), KT (#Dreams), Intel (#Empowerment) and GlaxoSmithKline (#Healthcare). \'What they\'re doing is so much bigger than what I\'m doing,\' Guetta said. \'I discovered that yes, there\'s a political side to what [the U.N.] is doing, but there\'s a way bigger side, and this is what I didn\'t know, is to be close to people, to give food to people. The humanitarian work that they\'re doing is incredible and really close to real people. I hope I can show this to the people that are following me and following my music.\' Guetta has also created a new track for the campaign called \'One Voice\' with Mikky Ekko. The visual for the song will be projected onto the façade of the United Nations Secretariat Building today - the first promotion of its kind - during a launch event hosted by United Nations Secretary-General Ban Ki-moon. \'He was excited. We had a little dance together,\' Guetta said, laughing about the first time Ki-moon saw the video. \'We had fun. It was very inspiring.\'',	'0.35',	'0.36',	'1',	'0',	'1',	'639ad069a03094d95251fd2ce53bdcfeeb4e6c62'),
(241,	474,	3,	'video',	'1399013400',	NULL,	'PPAS student choir performs #OneVoice at UN',	'',	'1',	'com.vast.davidguetta',	'',	'1400249239.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'davidguetta1403006990.jpg',	'512',	'288',	'davidguetta1403006990.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'576',	'davidguetta1403006990.jpg',	'',	'',	'',	NULL,	NULL,	'25629012',	'',	'http://j.mp/1UoVyUH',	'How great is the Professional Performing Arts School\'s acapella choir performance of #OneVoice at the #UN? Can you believe they learned the song, from scratch, two hours before the performance. Here\'s an exclusive look at how their day transpired. Alicia Keys\' and the rest of the PPAS Alumni should be proud. I was. What a great way to end the evening. WOW!!!!',	'0.46',	'0.55',	'1',	'0',	'1',	'677370fb5118135e1fd9e1b0888af46931a38d68'),
(263,	69,	21,	'image',	'1401176257',	NULL,	'',	'Rihanna was born in a parish in Barbados called St. Michael. She lived the life of a normal island girl going to Combermere, a top sixth form school. Rihanna won numerous beauty pageants and performed Mariah Carey \'Hero\' in a school talent show. Her life changed forever when one of her friends introduced her to Evan Rodgers, a producer from New York who was in Barbados for a vacation with his wife, who is a native. Rodgers arranged for her to go to New York to meet Jay-Z, CEO of Def Jam Records. He heard her sing and knew she was going to be incredibly successful. She was 16 when she was signed to Def Jam. Since then, she\'s amassed phenomenal success.',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'358.54341736695',	'1401184209.jpg',	'512',	'717.08683473389',	'1401184209.jpg',	'714',	'1000',	'1401184209.jpg',	'714',	'1000',	'1401184209.jpg',	'714',	'1000',	'1401184209.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0axKc',	'',	'0.42',	'0.19',	'1',	'0',	'0',	'1d9f78939a45579cbf9b9a307d67ba6faff2f238'),
