(274,	72,	21,	'music',	'1401176420',	NULL,	'Right Now',	'Unapologetic is the seventh studio album by Barbadian recording artist Rihanna, released on November 19, 2012, by Def Jam Recordings and SRP Records. It was recorded between June and November 2012, during promotion of her sixth studio album, Talk That Talk (2011). As executive producer, Rihanna enlisted previous collaborators The-Dream, David Guetta, Chase & Status, and StarGate to work alongside new collaborators such as Parker Ighile, Mike WiLL Made-It and Labrinth. ',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1401189998.jpeg',	'512',	'512',	'1401189998.jpeg',	'',	'',	'',	'',	'',	'',	'960',	'960',	'1401189998.jpeg',	'1401189860.mp3',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09F8A',	'',	'0.48',	'0.3',	'1',	'0',	'0',	'249a70e43fd3ebe5d70c057f37acfc8c2b14cce3'),
