(280,	74,	22,	'music',	'1401176619',	NULL,	'Roar',	'\'Roar\' is a song written by Katy Perry, Bonnie McKee, Dr. Luke, and Max Martin. The song serves as the lead single from Perry\'s third mainstream studio album, Prism. \'Roar\' was released on August 10, 2013. The song topped the US Billboard Hot 100, marking Perry\'s 8th number 1 song on the chart. It was registered onto Perry\'s BMI on August 31, 2013. A music video for \'Roar\' was released on September 5, 2013.',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'142.22222222222',	'katy_perry1401192142.jpg',	'512',	'284.44444444444',	'katy_perry1401192142.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'568.88888888889',	'katy_perry1401192142.jpg',	'katy_perry1401191973.mp3',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVDaX',	'',	'0.67',	'0.39',	'1',	'0',	'0',	'9d456e510aba0f198ea12264aec8005108146d1f'),
