(391,	93,	29,	'image',	'1402226280',	NULL,	'',	'',	'0',	NULL,	'amazon1402401792.mp3',	'',	'',	'',	'',	'amazon1402401789.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'amazon1402401718.jpg',	'512',	'766.50292397661',	'amazon1402401718.jpg',	'1368',	'2048',	'amazon1402401718.jpg',	'1368',	'2048',	'amazon1402401718.jpg',	'1024',	'1533.0058479532',	'amazon1402401718.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVJiP',	'',	'0.58',	'0.33',	'1',	'0',	'0',	'973bb7703fb0c80a40e9dc4b0f2fa4bd12e601d8'),
(392,	93,	29,	'image',	'1402227660',	NULL,	'Manu as Acai',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'171.125',	'amazon1402401809.jpg',	'512',	'342.25',	'amazon1402401809.jpg',	'2048',	'1369',	'amazon1402401809.jpg',	'2048',	'1369',	'amazon1402401809.jpg',	'1024',	'684.5',	'amazon1402401809.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1UoVc0e',	'Manu Manu Manu',	'0.71',	'0.48',	'1',	'0',	'0',	'94fe05e99d0d309132329a1d34911bfb347e9275'),
(403,	31,	2,	'image',	'1402358400',	NULL,	'Tyra Banks for Sports Illustrated - A breakthrough moment for both of us',	'',	'0',	NULL,	'russell_james1402911691.wav',	'',	'',	'',	'',	'russell_james1403008647.mp4',	NULL,	NULL,	'256',	'322.56',	'russell_james1402911586.jpg',	'512',	'645.12',	'russell_james1402911586.jpg',	'900',	'1134',	'russell_james1402911586.jpg',	'900',	'1134',	'russell_james1402911586.jpg',	'900',	'1134',	'russell_james1402911586.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0agag',	'This photograph of Tyra Banks I shot on an island called Harbor Island in the Bahamas, and it has so much significance to me personally. It plays such a big part of one very vital stage of my career. I was in New York in the year 1996 and I was asked to shoot a then fairly well known model, Tyra Banks. And off I went to Harbor Island for the Sports Illustrated Swimwear Edition, something that\'s revered in the United States and I\'d say around the world as being the \'crème de la crème\' of the swimwear world, and Tyra was already a big deal. But when we were told that she\'d got the cover, it really was significant because it was the first time an African American model was on the cover of Sports Illustrated Swimwear Edition. And it was also one of the biggest circulated covers ever to this day in their history, and it got me started in the world of swimwear. So there\'s a lot of layers to this particular photograph for me.',	'0.53',	'0.17',	'1',	'0',	'0',	'51c053c6af490949557c8d1cdf43e4a2966a9208'),
(404,	31,	2,	'image',	'1402358460',	NULL,	'Alessandra Ambrósio’s first Victoria’s Secret Swim shoot – simply spectacular!',	'',	'0',	NULL,	'russell_james1402911768.wav',	'',	'',	'',	'',	'russell_james1403008647.mp4',	NULL,	NULL,	'256',	'170.66666666667',	'russell_james1402911715.jpg',	'512',	'341.33333333333',	'russell_james1402911715.jpg',	'1200',	'800',	'russell_james1402911715.jpg',	'1200',	'800',	'russell_james1402911715.jpg',	'1024',	'682.66666666667',	'russell_james1402911715.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0aP3X',	'In 2012 I went to the Island Grand Bahama with Alessandra Ambrósio, one of my very favorite models to shoot. And Alessandra had just had a baby. I mean this was literally her first job back after having her beautiful little girl. I can\'t imagine how intimidating it must be to a woman to be coming out of recent childbirth and to come back your first job and it\'s a photo shoot in your swimwear. So it\'s quite remarkable by itself in that, but the photo shoot itself was very special. It was the first time that Victoria\'s Secret had done advertising for swimwear. So there was a lot of pressure on me also to come back with something that was swimwear, which I shoot a lot of for their catalogs and for other companies. But this was advertising, something I wanted to live in the magazine, to stand out from other swimwear. And Alessandra just I thought just rocked it out. She got her knees down and she leaned way back and created this beautiful shape. And it just felt so serene, so beautiful. I\'ve got to say we chose the perfect beach, a beach called Golds Beach, and it was just water planing out around us, creating this reflective surface - a photograph that I love.',	'0.26',	'0.52',	'1',	'0',	'0',	'28109b1e5c71073cc23829187215122e830c9f3d'),
(405,	31,	2,	'image',	'1402362000',	NULL,	'Thinking outside the box - getting creative with glass',	'',	'0',	NULL,	'russell_james1402912319.wav',	'',	'',	'',	'',	'russell_james1403008589.mp4',	NULL,	NULL,	'256',	'170.24',	'russell_james1402912164.jpg',	'512',	'340.48',	'russell_james1402912164.jpg',	'1200',	'798',	'russell_james1402912164.jpg',	'1200',	'798',	'russell_james1402912164.jpg',	'1024',	'680.96',	'russell_james1402912164.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0a3nB',	'This photograph I created with a great friend / creative director called Larry Lobaugh. And we were just experimenting with sand glass, which is really just broken bottles that over time have deteriorated away. So I had a wonderful model with us, and I asked if we could try something quite creative with the sandglass. So we literally laid her down, and Larry and I and Inga the stylist, we set about making a swimsuit out of the sand glass. And this is the shot that resulted.',	'0.39',	'0.44',	'1',	'0',	'0',	'b44ce64969838c43debbbfe7885e23e186d44c35'),
(406,	31,	2,	'image',	'1402362120',	NULL,	'Gisele Bündchen, pure goddess',	'',	'0',	NULL,	'russell_james1402912399.wav',	'',	'',	'',	'',	'russell_james1403008588.mp4',	NULL,	NULL,	'256',	'197.76',	'russell_james1402912357.jpg',	'512',	'395.52',	'russell_james1402912357.jpg',	'1600',	'1236',	'russell_james1402912357.jpg',	'1600',	'1236',	'russell_james1402912357.jpg',	'1024',	'791.04',	'russell_james1402912357.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0a9M1',	'As a photographer, I guess there are certain people that if you shoot them you feel like you have \" made it\", and Gisele is definitely one of the models in that category. I mean she\'s such an extraordinary model to photograph, and such a privilege as a photographer. So I was very lucky to be photographing Gisele when she was new and arrived on the scene, and for many many years of her career (still ongoing to this day, which is quite a testimony to her incredible beauty). I took this particular picture in the British Virgin Isles, and it was part of a beauty campaign, and I think the picture speaks for itself. The British Virgin Isles are made up of beautiful rockscapes, perfect white sand, blue water - and Gisele is, I\'ve got to say, sometimes she\'s just like a goddess-like creature. It\'s just very strange, and it was so simple to shoot with her - I just simply laid her against this rock, took the photograph, and I think it was about ten frames.',	'0.83',	'0.22',	'1',	'0',	'0',	'338747ec7a7aad7db0a9f34e7ace4ec0c71a4b98'),
(407,	31,	2,	'image',	'1402362300',	NULL,	'“Still life” in Sardinia',	'',	'0',	NULL,	'russell_james1402912621.wav',	'',	'',	'',	'',	'russell_james1403008544.mp4',	NULL,	NULL,	'256',	'170.32533333333',	'russell_james1402912567.jpg',	'512',	'340.65066666667',	'russell_james1402912567.jpg',	'1500',	'998',	'russell_james1402912567.jpg',	'1500',	'998',	'russell_james1402912567.jpg',	'1024',	'681.30133333333',	'russell_james1402912567.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U09ni6',	'I did a book called \"Sardinia\" in 2004, and \"Sardinia\" was really a study of swimwear. And one of the shots that I did was of these two beautiful young ladies and I wanted to figure out a way of - how do I do a double shot that says swimwear, without having two girls cornily walking down the beach together? And so it was just by a swimming pool, and I had two terrific models. I treated this more like a \"still life\" - that\'s probably the best description I could give it - I just set everything up perfectly, the body forms with the bikinis sort of overlapping, and then shot it very very tight. And I love this kind of graphic photography.',	'0.53',	'0.4',	'1',	'0',	'0',	'43e35020d151e40a78430107c23a8dc18e07d9dd'),
(408,	31,	2,	'image',	'1402362360',	NULL,	'A midnight swim with Eva Herzigová',	'',	'1',	NULL,	'russell_james1402912695.wav',	'',	'',	'',	'',	'russell_james1403008515.mp4',	NULL,	NULL,	'256',	'325.76',	'russell_james1402912649.jpg',	'512',	'651.52',	'russell_james1402912649.jpg',	'1600',	'2036',	'russell_james1402912649.jpg',	'1600',	'2036',	'russell_james1402912649.jpg',	'1024',	'1303.04',	'russell_james1402912649.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U09EBt',	'In the year 1998, I went to the Maldivian Islands. The Maldives - they are exactly what you think they are, they\'re just these special islands. I believe the highest point above sea level is three feet, and I think that the island chain consists about 200 islands, and every one of them just looks like those magical kind of Gilligan Island type islands - beautiful white islands with crops of trees. So being in the Maldives was very special. I chose to shoot stories on Eva in the day and night. But I also went out at night and shot Eva and actually, in this particular shot, it was about to pour rain. In fact it did. I remember one of the assistants and I getting a nice electric shock after it started to rain and we got caught with a cable trailing into the ocean. So I wasn\'t too smart with that one. But the shot was worth it - Eva looks amazing, and we just caught a beautiful time of the day.',	'0.56',	'0.22',	'1',	'0',	'0',	'2965e75e9ac1b383832be11a068ba7cbc1af6e45'),
(409,	31,	2,	'image',	'1402362420',	NULL,	'A deceptively simple looking underwater shoot with Aurélie Claudel',	'',	'1',	NULL,	'russell_james1402912770.wav',	'',	'',	'',	'',	'russell_james1403008488.mp4',	NULL,	NULL,	'256',	'170.56',	'russell_james1402912721.jpg',	'512',	'341.12',	'russell_james1402912721.jpg',	'1600',	'1066',	'russell_james1402912721.jpg',	'1600',	'1066',	'russell_james1402912721.jpg',	'1024',	'682.24',	'russell_james1402912721.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U09DNR',	'I love shooting underwater, I don\'t think that\'s any secret or mystery, and so when I do any swim shoot that I\'ve got a little bit of latitude, I always bring a camera with an underwater housing to see if I can sneak a shot in. And on this shoot for Marie Claire magazine I did sneak one in. I took the model, Aurélie, out on a boat and I got in the water and I went down below the surface with my camera, and I just asked her to make some dives through the water. It sounds so simple, but it is really hard to dive and have everything stay together, and the suit stay on, and you look cool and graceful and elegant. So she just nailed it. I was not set up for underwater shooting, meaning I didn\'t have tanks, I didn\'t have support divers - I just literally had a mask, I was going underwater and holding my breath, and said I\'m going to have a few frames at this. Aurélie just absolutely nailed it. I loved the form in the picture, the precise shape of her body, and the effect of the bubbles all around her.',	'0.76',	'0.52',	'1',	'0',	'0',	'fc1e3585b7144b292a4f1bfe9c537ce126525c6e'),
(410,	31,	2,	'image',	'1402362480',	NULL,	'“Golden girl” Aurélie Claudel',	'',	'1',	NULL,	'russell_james1402912831.wav',	'',	'',	'',	'',	'russell_james1403008467.mp4',	NULL,	NULL,	'256',	'317.86666666667',	'russell_james1402912794.jpg',	'512',	'635.73333333333',	'russell_james1402912794.jpg',	'1200',	'1490',	'russell_james1402912794.jpg',	'1200',	'1490',	'russell_james1402912794.jpg',	'1024',	'1271.4666666667',	'russell_james1402912794.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0adeA',	'Aurélie Claudel is a beautiful model who I photographed very often, mostly in the years I would say 2000 to 2005. And I took her to Grand Bahama Island, a beach that is just so spectacular. The island itself, while it\'s a Bahamian island, its different in that it\'s very large, there\'s a lot of commercial activity. But there are a couple of absolute gems of beaches on that island. And we went out to this spectacular beach, called Golds Beach, and I shot her there on a perfect sunset. I used a strobe, so the effect that I have is the strobe hitting the skin, and you can see the sun holding on around her and it\'s a nice effect. And it was for Marie Claire magazine and I believe Marie Claire were very happy with the story.',	'0.53',	'0.23',	'1',	'0',	'0',	'0ff80d1634176fdf47109bdeeb50da7408f70f0a'),
(411,	31,	2,	'image',	'1402362600',	NULL,	'Having some fun in the Mexican sun with Gisele Bündchen',	'',	'1',	NULL,	'russell_james1402912929.wav',	'',	'',	'',	'',	'russell_james1403008446.mp4',	NULL,	NULL,	'256',	'325.75280898876',	'russell_james1402912853.jpg',	'512',	'651.50561797753',	'russell_james1402912853.jpg',	'1068',	'1359',	'russell_james1402912853.jpg',	'1068',	'1359',	'russell_james1402912853.jpg',	'1024',	'1303.0112359551',	'russell_james1402912853.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0av5d',	'This photograph of Gisele I took in Mexico at an insanely beautiful beach. The waves were just rolling and pounding in, and it was that kind of swell where it wasn\'t wild breaking swell, but it was just big rollers and you could tell they were coming from way out deep and you just didn\'t want to get caught up in one. And the sun set absolutely perfectly - just in this orange ball. And it was Gisele, and I just took a moment with a wide lens, and let Gisele run free on the beach. So even though I had one of the most recognizable models in the world, it wasn\'t about recognizing her, it was about trying to make a beautiful photograph, and we had a lot of fun making this picture.',	'0.6',	'0.25',	'1',	'0',	'0',	'092fcfeed1153c68f0166bf14be1cc1cafa267b5'),
(412,	31,	2,	'image',	'1402362660',	NULL,	'A relaxed and intimate portrait of Angela Lindvall',	'',	'1',	NULL,	'russell_james1402912994.wav',	'',	'',	'',	'',	'russell_james1403008422.mp4',	NULL,	NULL,	'256',	'143.05091863517',	'russell_james1402912963.jpg',	'512',	'286.10183727034',	'russell_james1402912963.jpg',	'3810',	'2129',	'russell_james1402912963.jpg',	'2048',	'1144.4073490814',	'russell_james1402912963.jpg',	'1024',	'572.20367454068',	'russell_james1402912963.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0agqM',	'Angela Lindvall is one of the great beauties of our time, and I was on a trip with Angela to St Tropez in the south of France. And we were at a club that - I\'m trying to say the French name \"Cinquante Cinq\" - very well known, \"Club 55\" - which is a beautiful restaurant that\'s on a beach, and it has the most spectacular beach out front. And yeah, the picture just speaks for itself. I just let Angela sit on the ground and literally relax. When I felt like she was not present to the camera I just took photographs. And this is the kind of photograph that I call a sort of intimate portrait, of somebody without having to distract them to say \"Hey, look into my camera\".',	'0.5',	'0.43',	'1',	'0',	'0',	'd6a59247ed607c91a6f939b7529d35d7f6f9d174'),
(413,	30,	2,	'image',	'1402365600',	NULL,	'Erin Heatherton for Victoria’s Secret’s “Very Sexy” campaign',	'',	'0',	NULL,	'russell_james1402913115.wav',	'',	'',	'',	'',	'russell_james1403008357.mp4',	NULL,	NULL,	'256',	'384.096024006',	'russell_james1402913074.jpg',	'512',	'768.192048012',	'russell_james1402913074.jpg',	'1333',	'2000',	'russell_james1402913074.jpg',	'1333',	'2000',	'russell_james1402913074.jpg',	'1024',	'1536.384096024',	'russell_james1402913074.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0aRc5',	'There is a sub-brand of Victoria\'s Secret called \"Very Sexy\" ironically, and it really is what it is - it\'s probably one of the bookends of the Victoria\'s Secret brand - it\'s their sexiest, most provocative part, of the their range. And we\'re always, of course, experimenting how do we keep that substance of that particular sub-brand and then take it to the next level. And in this campaign, Erin was one of the people that really helped to drive it forward. Quite simply just looking straight at the camera was all it needed.',	'0.52',	'0.19',	'1',	'0',	'0',	'952f2f849cc794f15eb4adb882dc69dbb1f086c8'),
(414,	30,	2,	'image',	'1402365660',	NULL,	'Candice Swanpoel is simply scorching in Victoria’s Secret’s “Very Sexy” campaign',	'',	'0',	NULL,	'russell_james1402913185.wav',	'',	'',	'',	'',	'russell_james1403008334.mp4',	NULL,	NULL,	'256',	'208.32',	'russell_james1402913142.jpg',	'512',	'416.64',	'russell_james1402913142.jpg',	'800',	'651',	'russell_james1402913142.jpg',	'800',	'651',	'russell_james1402913142.jpg',	'800',	'651',	'russell_james1402913142.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0a5vJ',	'Candice Swanepoel is one of the most gorgeous models to have ever hit the scene - just extraordinary - and she was a part of the \"Very Sexy\" campaign 2012. And in this particular series, this was one shot of Candice that just said it all. She was just like \"boom\", straight to camera, I had nothing to do except push the shutter.',	'0.38',	'0.26',	'1',	'0',	'0',	'cd766a10abe3b0f866f9584e21444826f3259975'),
(415,	30,	2,	'image',	'1402365720',	NULL,	'The trifecta: Alessandra Ambrósio, Candice Swanepoel & Erin Heatherton',	'',	'0',	NULL,	'russell_james1402916897.wav',	'',	'',	'',	'',	'russell_james1403008308.mp4',	NULL,	NULL,	'256',	'196.8',	'russell_james1402916820.jpg',	'512',	'393.6',	'russell_james1402916820.jpg',	'800',	'615',	'russell_james1402916820.jpg',	'800',	'615',	'russell_james1402916820.jpg',	'800',	'615',	'russell_james1402916820.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0aPkt',	'Double shots are hard to do, and triple shots are REALLY hard to do, because you\'ve got three people, and you want to find something that looks cool for everybody and make sure that everybody is tuned in at the same time. So working with three professionals like Alessandra, Candice and Erin - what a treat - and they delivered on this triple in such a way that I just wanted to share it with you through exposure.',	'0.46',	'0.38',	'1',	'0',	'0',	'3985a1ffdb92371dcb0bfe4e5125be8e6216272a'),
(417,	30,	2,	'image',	'1402365780',	NULL,	'One of my most iconic lingerie shots',	'',	'0',	NULL,	'russell_james1402918042.wav',	'',	'',	'',	'',	'russell_james1403008281.mp4',	NULL,	NULL,	'256',	'183',	'russell_james1402917996.jpg',	'512',	'366',	'russell_james1402917996.jpg',	'2048',	'1464',	'russell_james1402917996.jpg',	'2048',	'1464',	'russell_james1402917996.jpg',	'1024',	'732',	'russell_james1402917996.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U0aA8S',	'This advertising shot for Victoria\'s Secret is until this day one of the most iconic lingerie shots I think in the world - I\'m requested it more than any other photograph that I can think of, and I see it republished over and over again. And when people are showing me examples of my own work saying \"I remember when you did this\", this is one of the images that always comes up.',	'0.74',	'0.17',	'1',	'0',	'0',	'a427880d40efebbddab5b2925b8731434e8243bd'),
(418,	30,	2,	'image',	'1402365840',	NULL,	'Gisele Bündchen, looking absolutely timeless',	'',	'0',	NULL,	'russell_james1402918134.wav',	'',	'',	'',	'',	'russell_james1403008244.mp4',	NULL,	NULL,	'256',	'191.125',	'russell_james1402918083.jpg',	'512',	'382.25',	'russell_james1402918083.jpg',	'2048',	'1529',	'russell_james1402918083.jpg',	'2048',	'1529',	'russell_james1402918083.jpg',	'1024',	'764.5',	'russell_james1402918083.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U09lH0',	'This shot of Gisele leaning over a bedhead, is also a very iconic shot that has been one of the, I\'d say, one of the images that has become one of the timeless bank of images that is Victoria\'s Secret.',	'0.16',	'0.07',	'1',	'0',	'0',	'74677cb789f6b542a7a9ac4fc0e4ae9563066241'),
