(421,	30,	2,	'image',	'1402366080',	NULL,	'Noot Seear in Cuba for Marie Claire magazine',	'',	'0',	NULL,	'russell_james1402918493.wav',	'',	'',	'',	'',	'russell_james1402918493.mp4',	NULL,	NULL,	'256',	'332.67005076142',	'russell_james1402918353.jpg',	'512',	'665.34010152284',	'russell_james1402918353.jpg',	'1576',	'2048',	'russell_james1402918353.jpg',	'1576',	'2048',	'russell_james1402918353.jpg',	'1024',	'1330.6802030457',	'russell_james1402918353.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09k5H',	'Noot is one of the models that I worked with very often. Noot is from Canada, and Noot and I traveled to Cuba and shot our lingerie story that was for a magazine, Marie Claire magazine. And there was just a soul to the place of Cuba, and we were able to capture it, I feel, in the form of our lingerie shoot.',	'0.4',	'0.13',	'1',	'0',	'0',	'4b065cda29ac9636bb3a850bbab6ddeb3fae504c'),
(422,	30,	2,	'image',	'1402366140',	NULL,	'Shooting Laetitia Costa for Victoria’s Secret',	'',	'0',	NULL,	'russell_james1402918602.wav',	'',	'',	'',	'',	'russell_james1402918601.mp4',	NULL,	NULL,	'256',	'283.70562770563',	'russell_james1402918536.jpg',	'512',	'567.41125541126',	'russell_james1402918536.jpg',	'1848',	'2048',	'russell_james1402918536.jpg',	'1848',	'2048',	'russell_james1402918536.jpg',	'1024',	'1134.8225108225',	'russell_james1402918536.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Alg',	'Laetitia Costa brought this other dimension to Victoria\'s Secret - she is so voluptuous, and so beautiful in a very special way, and very very French. And it was such a pleasure to photograph her, and this was one image that I just wanted to share of an advertising campaign that I shot with Laetitia.',	'0.73',	'0.57',	'1',	'0',	'0',	'53664113c3a934014ef269834f3238b1443082d0'),
(423,	30,	2,	'image',	'1402366200',	NULL,	'Karolina Kurkova for Victoria’s Secret',	'',	'0',	NULL,	'russell_james1402918741.wav',	'',	'',	'',	'',	'russell_james1402918740.mp4',	NULL,	NULL,	'256',	'236.625',	'russell_james1402918634.jpg',	'512',	'473.25',	'russell_james1402918634.jpg',	'2048',	'1893',	'russell_james1402918634.jpg',	'2048',	'1893',	'russell_james1402918634.jpg',	'1024',	'946.5',	'russell_james1402918634.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09ASk',	'Karolina Kurkova, one of the strongest ever fashion models, joined Victoria\'s Secret some years ago, and this was one of the first big break out campaigns that I shot with Karolina. And she really brought a new dimension to this world of lingerie, because she is just so cool and so fashionable, and yet lingerie just sat on her so perfectly - and just a wonderful person to work with.',	'0.49',	'0.29',	'1',	'0',	'0',	'01904a4ab641a2ac28342015707b815651d2d07e'),
(424,	30,	2,	'image',	'1402366380',	NULL,	'One of my most popular photos of Adriana Lima',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'russell_james1402919782.mp4',	NULL,	NULL,	'256',	'322.83743842365',	'russell_james1402919492.jpg',	'512',	'645.67487684729',	'russell_james1402919492.jpg',	'1624',	'2048',	'russell_james1402919492.jpg',	'1624',	'2048',	'russell_james1402919492.jpg',	'1024',	'1291.3497536946',	'russell_james1402919492.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Dxr',	'One of the best lingerie models, one of the best models of our time, is undoubtedly Adriana Lima. I would suspect that I\'ve probably photographed Adriana as much or if not more as anybody else in the world. And I would be very happy if my entire career was just photographing Adriana Lima. This photograph of Adriana, wearing just the red underpants, is very famous. I don\'t know why - some images just catch on - but it\'s one of the images that people ask me to see over and over and over again.',	'0.61',	'0.14',	'1',	'0',	'0',	'e0589045ebd6494903d9d47e6126aa821314df9b'),
(425,	30,	2,	'image',	'1402366440',	NULL,	'Shooting Gisele Bündchen for Victoria’s Secret',	'',	'0',	NULL,	'russell_james1402919910.wav',	'',	'',	'',	'',	'russell_james1402919909.mp4',	NULL,	NULL,	'256',	'187.75',	'russell_james1402919815.jpg',	'512',	'375.5',	'russell_james1402919815.jpg',	'2048',	'1502',	'russell_james1402919815.jpg',	'2048',	'1502',	'russell_james1402919815.jpg',	'1024',	'751',	'russell_james1402919815.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Cts',	'Gisele Bündchen was one of the first, I\'d say \"supermodels\", for a very long time to make a big blast on the scene. The scene had kind of gone quiet. When Gisele signed with Victoria\'s Secret, I had the great pleasure of shooting her in some of the first campaigns, and all throughout her time with Victoria\'s Secret. This campaign was one of the first campaigns that I shot with her.',	'0.22',	'0.23',	'1',	'0',	'0',	'927a4a06cdcdab6d520ff731118b0bbf9a1fe216'),
