(427,	30,	2,	'image',	'1402366740',	NULL,	'Lily Aldridge, such a playful looking bride',	'',	'1',	NULL,	'russell_james1402920411.m4a',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'376.64367816092',	'russell_james1402920307.jpg',	'512',	'753.28735632184',	'russell_james1402920307.jpg',	'1392',	'2048',	'russell_james1402920307.jpg',	'1392',	'2048',	'russell_james1402920307.jpg',	'1024',	'1506.5747126437',	'russell_james1402920307.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0atKs',	'This close up shot of Lily Aldridge, where you see the veil around her face, I love it so much because she\'s just got such a great personality, and you can really see that playful personality coming out in this shot, and its one of the series of the bridal lingerie collection for Victoria\'s Secret.',	'0.43',	'0.35',	'1',	'0',	'0',	'0266cbee930a4be07e4680b3be5de4c48ede2e1e'),
(428,	30,	2,	'image',	'1402366800',	NULL,	'Lily Aldridge’s fun and irreverent side',	'',	'1',	NULL,	'russell_james1402920516.wav',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.625',	'russell_james1402920442.jpg',	'512',	'341.25',	'russell_james1402920442.jpg',	'2048',	'1365',	'russell_james1402920442.jpg',	'2048',	'1365',	'russell_james1402920442.jpg',	'1024',	'682.5',	'russell_james1402920442.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aAFU',	'I love this shot of Lily, full length with her legs out and the complete bridal headdress, because it\'s just so irreverent and fun.',	'0.3',	'0.31',	'1',	'0',	'0',	'079e8ed585caa0b0f4d478ef7965337e6bee965a'),
(429,	30,	2,	'image',	'1402366980',	NULL,	'Lily Aldridge in another playful pose',	'',	'1',	NULL,	'russell_james1402920627.m4a',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'327.68',	'russell_james1402920551.jpg',	'512',	'655.36',	'russell_james1402920551.jpg',	'1600',	'2048',	'russell_james1402920551.jpg',	'1600',	'2048',	'russell_james1402920551.jpg',	'1024',	'1310.72',	'russell_james1402920551.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0ayhg',	'This close-up of Lily\'s bottom to put it bluntly is just of a pair of panties that one might wear on a bridal evening, and I just thought it was a playful fun shot to include.',	'0.4',	'0.57',	'1',	'0',	'0',	'b87c0e0ac5b902b41cad66b6f9d82264c4eb411a'),
(430,	30,	2,	'image',	'1402367400',	NULL,	'Lily Aldridge in bridal lingerie for Victoria’s Secret',	'',	'1',	NULL,	'russell_james1402920869.wav',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'319.68780487805',	'russell_james1402920673.jpg',	'512',	'639.3756097561',	'russell_james1402920673.jpg',	'1640',	'2048',	'russell_james1402920673.jpg',	'1640',	'2048',	'russell_james1402920673.jpg',	'1024',	'1278.7512195122',	'russell_james1402920673.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09ZnI',	'This photograph of Lily, just standing looking straight to camera in bridal wear, was one of the series of the bridal campaign for Victoria\'s Secret.',	'0.4',	'0.25',	'1',	'0',	'0',	'670db3669ba59f6185d69765d69dbd17656f23ef'),
(431,	30,	2,	'image',	'1402367460',	NULL,	'Lounging around with Lily Aldridge',	'',	'1',	NULL,	'russell_james1402920796.m4a',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'165.875',	'russell_james1402920739.jpg',	'512',	'331.75',	'russell_james1402920739.jpg',	'2048',	'1327',	'russell_james1402920739.jpg',	'2048',	'1327',	'russell_james1402920739.jpg',	'1024',	'663.5',	'russell_james1402920739.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Cto',	'On this shot of Lily, she\'s laying over a day bed, and she\'s got her hand under her chin, and its full length, and she\'s topless but wearing panties - but there\'s just something so innocent always about Lily, I think she was probably the perfect bride.',	'0.19',	'0.37',	'1',	'0',	'0',	'004c5ff6b10cea64a8f20e034a889a17574ff418'),
(432,	95,	2,	'image',	'1402369200',	NULL,	'Rachel Roberts’ powerful portrait as “Inhibition”',	'',	'0',	NULL,	'russell_james1402921606.m4a',	'',	'',	'',	'',	'russell_james1402921591.mp4',	NULL,	NULL,	'256',	'319.68780487805',	'russell_james1402921496.jpg',	'512',	'639.3756097561',	'russell_james1402921496.jpg',	'1640',	'2048',	'russell_james1402921496.jpg',	'1640',	'2048',	'russell_james1402921496.jpg',	'1024',	'1278.7512195122',	'russell_james1402921496.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09kmd',	'This portrait of Rachel Roberts set the stage for me for my character of \"Inhibition\" for my Nomad Two Worlds project. It was the way that, in the overall shoot, Rachel used her body language to really tell me what this character of \"Inhibition\" would be - what it feels like, what is the emotion. But when she looked at the camera, it just completely blew me away - it was almost as if she had assumed this other being that I wanted her to. And from a photographic perspective I have to be honest - I pointed the camera, I framed it, I pushed the shutter, and Rachel\'s intensity is what makes this shot so special.',	'0.65',	'0.27',	'1',	'0',	'0',	'a898c5391d83140cc5193e08f8ddaebd0e9ac51e'),
(433,	95,	2,	'image',	'1402369260',	NULL,	'Heidi Klum for Nomad Two Worlds: “Discovery” comes to life',	'',	'0',	NULL,	'russell_james1402921708.m4a',	'',	'',	'',	'',	'russell_james1402921707.mp4',	NULL,	NULL,	'256',	'321.25490196078',	'russell_james1402921632.jpg',	'512',	'642.50980392157',	'russell_james1402921632.jpg',	'1632',	'2048',	'russell_james1402921632.jpg',	'1632',	'2048',	'russell_james1402921632.jpg',	'1024',	'1285.0196078431',	'russell_james1402921632.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0ae28',	'When I set out to create the character of \"Discovery\" for Nomad Two Worlds, I was trying to create a creature that represented what would happen if we survived this period of conflict - there will be scars, there will be visible evidence of what has happened, but something much stronger will come out of it - it was like the Phoenix sort of \"rising from the ashes\". So to play this role, I ended up arriving on Heidi Klum. And Heidi is someone I\'ve had a long professional relationship with, she\'s a great friend. However for her, there was a great risk to this, because it was at the peak of her Sports Illustrated cover time of her career, she was extremely commercial which is a very important phase as a model, and to let someone cover you in mud and maybe do something that looks stupid or just looks bad, it\'s a risk. So I really had to rely on the trust. Heidi gave me the trust to have a shot at making this character come to life, and she just really pulled it off. Vincent Longo, amazing makeup artist, applied the makeup. Italo Gregorio applied the hair. And Heidi gave me these positions, that in this case, was on her knees. So this project now has been shooting for 10 years, and every time I\'m unclear or I have to question myself \"What is the character of Discovery?\" I go back to this picture, because this picture for me really set the stage.',	'0.48',	'0.27',	'1',	'0',	'0',	'dd5bf03983279551db7c22aec61c9ea18823fae5'),
(434,	95,	2,	'image',	'1402369380',	NULL,	'Estella Warren – A vision of “Innocence”',	'',	'0',	NULL,	'russell_james1402921825.m4a',	'',	'',	'',	'',	'russell_james1402921824.mp4',	NULL,	NULL,	'256',	'172.875',	'russell_james1402921733.jpg',	'512',	'345.75',	'russell_james1402921733.jpg',	'2048',	'1383',	'russell_james1402921733.jpg',	'2048',	'1383',	'russell_james1402921733.jpg',	'1024',	'691.5',	'russell_james1402921733.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aRJ7',	'Estella Warren, underwater, falling backwards in the massive open ocean space, is one of the luckiest photographs that I ever got. I was in Grand Bahama in 2001, right at the beginnings of the Nomad project. I was also shooting film and I was working with an incredibly experienced underwater team, headed up by a guy called Mark Robinson. And we were heading out to sea every day, and there\'s something strange that happens in the ocean as you move out over what they call \"the shelf\". The shelf is where the continental plate finishes and it drops off to incredible depth - it could be 1000 feet, it could be 2000 feet, and more. So you go from this 50 - 60 feet and all of a sudden you go into this drop off. So we would take our boats out and work on this drop off, and I would go underwater with my camera. The strange things that happen when you\'re in that kind of water... There\'s a large danger involved for all the crew, because when you\'re underwater and trying to maintain buoyancy (especially if you\'re looking through a camera) - when you\'re in a vast blue space where there\'s no bottom and there\'s no top - it\'s kind of like what happens to pilots, that they call \"white out\", where they can\'t see the horizon, they can\'t tell what\'s up or what\'s down, it\'s easy to get disoriented, and if you accidentally go too deep because your descending and you don\'t realize it, it\'s a very dangerous situation. So I constantly had to be settling at about 30 or 40 feet and locking off and just taking shots, and this time I was working on film, not on digital, so I\'m literally cranking through frames and clicking and no way to check back on what I had. But Estella was coming off a high boat, falling backwards - she\'s an incredibly experienced synchronized swimmer which added to my shoot enormously - but the thing I remember the most is that I would get the shot, and then I\'d feel the water in my ears compressing and getting much harder, and then I\'d realize \"Oh my gosh I\'m sinking!\" and I\'d check my meter and I\'d be sinking at a massively fast rate, and I\'d quickly be inflating to get back to the surface. But anyway, it was worth it: this was the end shot.',	'0.44',	'0.51',	'1',	'0',	'0',	'0fad3e9b35d5ab554a72bf83a8e4af3df3f31d9e'),
(435,	95,	2,	'image',	'1402369500',	NULL,	'Beth Whitson’s almost mythical transformation',	'',	'0',	NULL,	'russell_james1402921903.m4a',	'',	'',	'',	'',	'russell_james1402921902.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402921846.jpg',	'512',	'341.25',	'russell_james1402921846.jpg',	'2048',	'1365',	'russell_james1402921846.jpg',	'2048',	'1365',	'russell_james1402921846.jpg',	'1024',	'682.5',	'russell_james1402921846.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0as9m',	'Beth Whitson I photographed in the year 2011, which is very recent times in terms of the Nomad project, and I worked with a wonderful team headed up by Ward, who is just the most incredible hair artist, but so much more. Ward is able to - if you say the concept is \"Sticks in the hair\", then Ward will bring things for the entire body. And in this case, he transformed Beth into a creature - almost a mythological creature - just with the use of sticks, and we smeared muds and dark makeup on her body. And this image became part of a art series been shown in Berlin, and is scheduled to be shown in New York in 2012.',	'0.45',	'0.55',	'1',	'0',	'0',	'1a90a5137ead3e31f091f78ebc4721cec9a7d20b'),
(436,	95,	2,	'image',	'1402369800',	NULL,	'Nicole Trunfio channeling the theme of “Inhibition”',	'',	'0',	NULL,	'russell_james1402922043.m4a',	'',	'',	'',	'',	'russell_james1402922043.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402921926.jpg',	'512',	'766.50292397661',	'russell_james1402921926.jpg',	'1368',	'2048',	'russell_james1402921926.jpg',	'1368',	'2048',	'russell_james1402921926.jpg',	'1024',	'1533.0058479532',	'russell_james1402921926.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09QAT',	'The tree in this shot around Nicole Trunfio is fascinating to me as the actual shot, because it was built by my friend Ward who picked up all these sticks on the way to the photo shoot, and literally made that on the set on the day, and then we put Nicole Trunfio (who is a wonderful model) inside. And I asked Nicole to act out a theme for me, and the theme I called “Inhibition”. And I said “It’s a time of conflict, it’s a time of - everything is kind of in an uncertain state - and I liken that to the time of where we are right now.” And so this tree photograph of Nicole has become for me become an iconic photograph of the Nomad Two Worlds series.',	'0.44',	'0.67',	'1',	'0',	'0',	'14ef31e872458209c5431b08efd860f17889863e'),
(437,	95,	2,	'image',	'1402371000',	NULL,	'“Inhibition”: Capturing the incredible emotion of Rachel Roberts',	'',	'1',	NULL,	'russell_james1402923074.m4a',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'321.25490196078',	'russell_james1402922804.jpg',	'512',	'642.50980392157',	'russell_james1402922804.jpg',	'1632',	'2048',	'russell_james1402922804.jpg',	'1632',	'2048',	'russell_james1402922804.jpg',	'1024',	'1285.0196078431',	'russell_james1402922804.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aBts',	'When I started the Nomad Two Worlds collection, one of the first things that I did was try to create three characters. One character I called \"Innocence\", which was to represent this incredible past period of indigenous reign. One character I called \"Inhibition\", which is to represent this period of what I consider to be conflict. And one character I created to represent the future, and I called that \"Discovery\". So this creature is \"Inhibition\", and played in this case by Rachel Roberts. And it was trying to find the emotion that went with it that was the challenge. Putting mud on a girl - OK, we had a great team, we had great hair, we had great makeup - but trying to find that emotion... and I asked Rachel to consider herself someone that was not broken, but in a state where she\'d been under great peril and great threat, but was still far from finished. And she gave me this beautiful pose that just said it. So for me this shot is very emotional, and it all comes through the great body language that Rachel gave me on that day.',	'0.32',	'0.37',	'1',	'0',	'0',	'a17f3a18c6453d49ae7d13b8a07030058db2cfc0'),
(438,	95,	2,	'image',	'1402371120',	NULL,	'Beating the tide',	'',	'1',	NULL,	'russell_james1402923148.m4a',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'372.36363636364',	'russell_james1402923104.jpg',	'512',	'744.72727272727',	'russell_james1402923104.jpg',	'1408',	'2048',	'russell_james1402923104.jpg',	'1408',	'2048',	'russell_james1402923104.jpg',	'1024',	'1489.4545454545',	'russell_james1402923104.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09ZEe',	'This photograph of a stunt double in fact (a wonderful girl called Kathy, living on Grand Bahama Island) is quite extraordinary because I can\'t really understate how much controlled risk and set up had to go into a shot like this. Literally this is a hole in the bottom of the ocean floor, about a half a mile off the island. But that hole is connected about eight miles back inside of the island, and as the tide rises, it pushes water out of the hole. So you can\'t work then because it\'s just bubbling, boiling sort of - it\'s a crazy act of nature to be around it - you go anywhere near, it just blows you out. If you are near it when the tide is going the other way, you\'ll be sucked in, and you\'re gone forever - those caves go way back for many miles. So there were two challenges: One, is to get someone down the 60 feet on a breath of air (because they can\'t breathe air down below for technical reasons). We literally had to have her hold a cinder block and fall to the bottom, so that on the way up she didn\'t have to blow out any bubbles. And the second thing was, we had 20 minutes in the day, when twice a day we had 20 minutes where the tide\'s not pushing and it\'s not pulling - it\'s just what we call \"slack tide\", and that\'s when we could work in the hole. So to get this shot - I\'m sitting down inside the hole, I have divers actually inside the caves of the hole for safety for our talent, and I have this amazing stunt double who was able to come down with the cinder block, drop all the way to the bottom of the ocean, drop the block, and then slowly and gracefully swim back up.',	'0.52',	'0.56',	'1',	'0',	'0',	'1099952b0bb6189594836b1b69ccb1adea687afa'),
(439,	95,	2,	'image',	'1402371600',	NULL,	'Exploring the theme of “Innocence” with Dutch model Yfke Sturm',	'',	'1',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402923195.jpg',	'512',	'766.50292397661',	'russell_james1402923195.jpg',	'1368',	'2048',	'russell_james1402923195.jpg',	'1368',	'2048',	'russell_james1402923195.jpg',	'1024',	'1533.0058479532',	'russell_james1402923195.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09CJU',	'I was down in Grenada and working on a beautiful resort, but what had me fascinated was the volcanic sands that sort of oozed out of the island and mixed with the pure white sands of the beach, and it left me with this incredible contrast on the sand. It wasn\'t any part of the shoot that I was doing to have black and white sand. So it occurred to me that I could do a great shoot for my Nomad Two Worlds project. Yfke Sturm is a fantastic model, and again it always comes back to trust - somehow it seems like it always seems to comes back to that one word of \"trust\". Because I said \"Would you mind being naked, curled up in the sand, and I\'ll stand on some boxes and take a photograph of you against this sand because it\'s spectacular?\" And she gave me the opportunity, and the opportunity turned into this photograph.',	'0.74',	'0.3',	'1',	'0',	'0',	'263665af5e7b6f8346d5efaf0b950adf7033dfd2'),
(440,	95,	2,	'image',	'1402371900',	NULL,	'Developing the theme of “Inhibition” with Miranda Kerr',	'',	'1',	NULL,	'russell_james1402923466.m4a',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'336.08205128205',	'russell_james1402923416.jpg',	'512',	'672.1641025641',	'russell_james1402923416.jpg',	'1560',	'2048',	'russell_james1402923416.jpg',	'1560',	'2048',	'russell_james1402923416.jpg',	'1024',	'1344.3282051282',	'russell_james1402923416.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Bpm',	'I was out in what is commonly known as \"Palm 21\" (I think it\'s a couple of hours outside of Palm Springs) and I said to Miranda: \"You know I\'d love to do something for my Nomad project. Would you mind getting naked and climbing up that tree?\" Now she said \"Yes\". So I was lucky enough to photograph Miranda. We smudged her with some very light smudges. I had in my mind the character of \"Inhibition\", an extension of that series, and Miranda got up the tree. And the sun was shining, it was freezing cold, but she delivered this shot for me.',	'0.51',	'0.35',	'1',	'0',	'0',	'01304ff339a84914c01d3ef54e2e3fede4fb2eb5'),
(442,	5,	2,	'image',	'1402372800',	NULL,	'Adriana Lima backstage: Caught in the moment',	'',	'0',	NULL,	'russell_james1402925768.m4a',	'',	'',	'',	'',	'russell_james1402925767.mp4',	NULL,	NULL,	'256',	'341.33333333333',	'russell_james1402925640.jpg',	'512',	'682.66666666667',	'russell_james1402925640.jpg',	'1536',	'2048',	'russell_james1402925640.jpg',	'1536',	'2048',	'russell_james1402925640.jpg',	'1024',	'1365.3333333333',	'russell_james1402925640.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aRZD',	'Adriana Lima, adjusting her garter, just looking down, doing her thing. The girl is so beautiful that sometimes it\'s beyond words, and when you see moments like that - it\'s like it\'s not even when she\'s just looking at you, it\'s when she\'s just doing her thing, being herself - it leaves you breathless, and this is one such example.',	'0.7',	'0.2',	'1',	'0',	'0',	'7d39f817acdad010bdc71fd316d6b0cebf72c724'),
(443,	5,	2,	'image',	'1402372920',	NULL,	'Adriana Lima and Oluchi Onweagba: Agents Provocateurs',	'',	'0',	NULL,	'russell_james1402925904.m4a',	'',	'',	'',	'',	'russell_james1402925903.mp4',	NULL,	NULL,	'256',	'190.5',	'russell_james1402925842.jpg',	'512',	'381',	'russell_james1402925842.jpg',	'2048',	'1524',	'russell_james1402925842.jpg',	'2048',	'1524',	'russell_james1402925842.jpg',	'1024',	'762',	'russell_james1402925842.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Ctu',	'So the scene is, I\'m backstage in a dressing room and there is Oluchi, one of the most beautiful models you could ever hope to see (and also happens to have one of the most amazing bums, any woman in this planet would agree!). And there, sitting behind her, is Adriana Lima, one of the most beautiful women to ever walk on the planet. The lingerie that Oluchi was wearing was extraordinary just in its graphics, so I made the decision, the creative decision, I focused on her bum and had Adriana off focus in the background, and I just really liked the effect.',	'0.31',	'0.35',	'1',	'0',	'0',	'bdfcadaeabce98e7f8b0f6cbcec651bb440dd057'),
(444,	5,	2,	'image',	'1402373280',	NULL,	'',	'',	'1',	NULL,	'',	'',	'',	'',	'',	'russell_james1402926033.mp4',	NULL,	NULL,	'256',	'187.25',	'russell_james1402925934.jpg',	'512',	'374.5',	'russell_james1402925934.jpg',	'2048',	'1498',	'russell_james1402925934.jpg',	'2048',	'1498',	'russell_james1402925934.jpg',	'1024',	'749',	'russell_james1402925934.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0au19',	'Ana Beatriz has an amazing thing about her eyes and her face, that she can “lock on” to the camera.  So in this particular scene, it’s a backstage scene, but it’s backstage at a Michael Bay shoot.  Michael Bay is an amazing director, and he’s like “go big, or go home!”, his sets are HUGE and massive and extensive.  So I had all these great places to play.  I took the girls while Michael would shoot a scene, I’d be off shooting somewhere else.  Ana Beatriz literally was getting changed, and I saw her with a bunch of other people, and I said “Ana, please, go low so I can shoot you” and she just squatted down in the chaos, locked onto the camera across the room, and boom, gave me the frame.',	'0.77',	'0.17',	'1',	'0',	'0',	'6feb3fa28161ce5d78dec1968d519e1f4021ea08'),
(445,	5,	2,	'image',	'1402373700',	NULL,	'Big heart, big smile: Backstage with the boisterous Oluchi Onweagba',	'',	'0',	NULL,	'russell_james1402926109.m4a',	'',	'',	'',	'',	'russell_james1402926109.mp4',	NULL,	NULL,	'256',	'337.81443298969',	'russell_james1402926056.jpg',	'512',	'675.62886597938',	'russell_james1402926056.jpg',	'1552',	'2048',	'russell_james1402926056.jpg',	'1552',	'2048',	'russell_james1402926056.jpg',	'1024',	'1351.2577319588',	'russell_james1402926056.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09QRp',	'Oluchi is an amazing person to know. She\'s just so full of spirit and energy, and so often we see photographs in intimate / lingerie / underwear that are kind of serious and quiet and sullen. And just to see this big-spirited girl just laughing out loud in the bra on the backstage of this set, I just loved the moment. Thankfully I didn\'t have the time to really frame and set up, I just had to turn and shoot, and I really like the crop of where everything happened because I feel like it is entirely what creates the energy of the shot.',	'0.65',	'0.06',	'1',	'0',	'0',	'a8181849809dbe52c8d08d8566a91095ab6d8b17'),
(446,	5,	2,	'image',	'1402373940',	NULL,	'Silhouette photography: Creating drama and mystery backstage',	'',	'0',	NULL,	'russell_james1402926344.m4a',	'',	'',	'',	'',	'russell_james1402926343.mp4',	NULL,	NULL,	'256',	'348.59574468085',	'russell_james1402926296.jpg',	'512',	'697.1914893617',	'russell_james1402926296.jpg',	'1504',	'2048',	'russell_james1402926296.jpg',	'1504',	'2048',	'russell_james1402926296.jpg',	'1024',	'1394.3829787234',	'russell_james1402926296.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09CcR',	'To show people, and events, and things that are happening, you don\'t always have to be close up and show exactly what is happening. In this photograph, I think it\'s what you don\'t see that makes it interesting. It\'s three girls in silhouette, walking out onto a stage, and the camera is set in such a way that you really only get the silhouettes and the lights and you don\'t quite see everything that\'s happening. But it\'s one of those shots that when I look at it, I feel like you can understand right away what\'s happening - this is a show of some description. It\'s a shot that I love, and actually I think is a really strong example that I\'d like to use for Backstage.',	'0.4',	'0.54',	'1',	'0',	'0',	'4f256aea15459163d057b7ede780322338121aa1'),
(447,	5,	2,	'image',	'1402374000',	NULL,	'Backstage with Doutzen Kroes: She’s utterly flawless!',	'',	'1',	NULL,	'russell_james1402926402.m4a',	'',	'',	'',	'',	'russell_james1402926401.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402926361.jpg',	'512',	'766.50292397661',	'russell_james1402926361.jpg',	'1368',	'2048',	'russell_james1402926361.jpg',	'1368',	'2048',	'russell_james1402926361.jpg',	'1024',	'1533.0058479532',	'russell_james1402926361.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09ERV',	'At the 2012 Victoria\'s Secret Fashion Show I snapped this shot. Doutzen Kroes is absolutely flawless. The retouchers are so disappointed because they have no work anytime I photograph Doutzen in any kind of close up. They\'re like \"there\'s nothing to do\". And so this moment of Doutzen getting makeup applied right before a show, there\'s a lot of pressure on, you can\'t see any of it - the girl just looks damn gorgeous however you photograph her.',	'0.51',	'0.35',	'1',	'0',	'0',	'7856c05f8f8cced1c7529e376dfb023e964a0347'),
(448,	5,	2,	'image',	'1402374060',	NULL,	'Finding calm in the backstage chaos with Miranda Kerr',	'',	'1',	NULL,	'russell_james1402926466.m4a',	'',	'',	'',	'',	'russell_james1402926466.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402926421.jpg',	'512',	'341.25',	'russell_james1402926421.jpg',	'2048',	'1365',	'russell_james1402926421.jpg',	'2048',	'1365',	'russell_james1402926421.jpg',	'1024',	'682.5',	'russell_james1402926421.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09ABS',	'Miranda Kerr is not only a fellow Aussie, but she\'s a model that I\'ve worked with for some time, and I just love to shoot her. There\'s a delicacy to how Miranda poises herself, and in this photograph I took of her backstage at a Victoria\'s Secret Fashion Show, it\'s a very real moment. They\'re preparing, they\'re touching, she\'s got people all over her doing things, and she\'s still got the poise - where I just said \"Miranda\" - and she\'s able to look, and just really look, at the camera and just take that second out of complete chaos and give me that type of a photograph. The effect of everything moving and all blurred around Miranda while she\'s in focus is something that we call \"shutter drag\". There are other names for it, but really it means leaving the shutter of the camera open longer than you should, whilst firing a strobe. So have a practice at that.',	'0.71',	'0.42',	'1',	'0',	'0',	'87210ddb7a3759c334cd33ccb1bb1f9809acabd6'),
(449,	5,	2,	'image',	'1402374300',	NULL,	'',	'',	'1',	NULL,	'russell_james1402926557.m4a',	'',	'',	'',	'',	'russell_james1402926557.mp4',	NULL,	NULL,	'256',	'194.5',	'russell_james1402926487.jpg',	'512',	'389',	'russell_james1402926487.jpg',	'2048',	'1556',	'russell_james1402926487.jpg',	'2048',	'1556',	'russell_james1402926487.jpg',	'1024',	'778',	'russell_james1402926487.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09mKR',	'Versatility in a model is one of the best things that can happen to you as a photographer. By \"versatility\", I mean a model that can go into a scene and adapt like an actor to that scene. Adriana Lima is one such model and in this case I simply gave Adriana a sofa - I didn\'t direct her into that position, I just said I\'d love to make a beautiful shot of her laying on the day bed, and I just let her work. The trick (and it is the challenge) is to know when to push the shutter, because Adriana doesn\'t hang around - she goes into the moment, she goes into what she\'s doing, and you\'ve got to look for it and you\'ve got to nail it. This photograph I feel like she nailed it, and the timing on firing the shutter was just right.',	'0.18',	'0.48',	'1',	'0',	'0',	'9a2988689a10434bbd7cfd458132d87c00e40fe0'),
(450,	5,	2,	'image',	'1402374540',	NULL,	'Fashion as art: Sometimes it’s the little things that reveal the big picture…',	'',	'1',	NULL,	'russell_james1402926634.m4a',	'',	'',	'',	'',	'russell_james1402926633.mp4',	NULL,	NULL,	'256',	'348.59574468085',	'russell_james1402926590.jpg',	'512',	'697.1914893617',	'russell_james1402926590.jpg',	'1504',	'2048',	'russell_james1402926590.jpg',	'1504',	'2048',	'russell_james1402926590.jpg',	'1024',	'1394.3829787234',	'russell_james1402926590.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09muy',	'Backstage areas can be so cool and beautiful, and part of it is when you see things like this extraordinary garment, that was a dress created for this shoot. It\'s just sitting there on a mannequin, and around it the lights are low, and I felt like it was a piece of art. I had to photograph it, quite simply before it went on anybody! Yes, it looked beautiful on the girls, but it also looked just beautiful as a work of art, sitting by itself in isolation.',	'0.52',	'0.29',	'1',	'0',	'0',	'71da11c1649c907164cf370607cf6cdfe51283f2'),
(451,	5,	2,	'image',	'1402375080',	NULL,	'Backstage with the mischievous Gisele Bündchen and Italo Gregorio',	'',	'1',	NULL,	'russell_james1402926809.m4a',	'',	'',	'',	'',	'russell_james1402926809.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402926745.jpg',	'512',	'766.50292397661',	'russell_james1402926745.jpg',	'1368',	'2048',	'russell_james1402926745.jpg',	'1368',	'2048',	'russell_james1402926745.jpg',	'1024',	'1533.0058479532',	'russell_james1402926745.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aw9h',	'One of my close friends from this industry is an amazing hairdresser called Italo Gregorio, and Italo and I worked very often with Gisele. And backstage it\'s a combination of craziness, stress, high energy - but it\'s also about having some fun, and Italo and Gisele were never short of having some good times. In this particular moment, I took the photograph, and then I believe I cracked up!',	'0.41',	'0.28',	'1',	'0',	'0',	'80abee5319e48f26e495f9244d587f4638053001'),
(452,	28,	2,	'image',	'1402376400',	NULL,	'VOGUE magazine: Karolina Kurkova',	'',	'0',	NULL,	'russell_james1402928477.wav',	'',	'',	'',	'',	'russell_james1402928477.mp4',	NULL,	NULL,	'256',	'337.81443298969',	'russell_james1402926942.jpg',	'512',	'675.62886597938',	'russell_james1402926942.jpg',	'1552',	'2048',	'russell_james1402926942.jpg',	'1552',	'2048',	'russell_james1402926942.jpg',	'1024',	'1351.2577319588',	'russell_james1402926942.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09D0j',	'You really can\'t call yourself a fashion photographer - truly - until you\'ve shot for VOGUE, and then the ultimate stamp is when a VOGUE magazine puts your photograph on the cover. Then I think you can safely say, \"I am a fashion photographer\". One of my favorite VOGUE covers that I photographed was of Karolina Kurkova, and she was, at that time and still currently to this day, one of the most extraordinary fashion models of the world. Very hot property at that time, and I had a great relationship with her, and I photographed her in a nude series, and when Spanish VOGUE called and said they really wanted to take that as the cover of their upcoming edition, I was so honored. Over the years I\'ve seen other VOGUE covers published, but I think this one REALLY was the breakout moment, where I was able to say \"Oh I\'m actually a fashion photographer\".',	'0.22',	'0.36',	'1',	'0',	'0',	'b7f0c45d6eca094e27014f0c357c5b76e17f1e4f'),
(453,	28,	2,	'image',	'1402376460',	NULL,	'SPORTS ILLUSTRATED magazine: Tyra Banks',	'',	'0',	NULL,	'russell_james1402928608.wav',	'',	'',	'',	'',	'russell_james1402928608.mp4',	NULL,	NULL,	'256',	'352.34408602151',	'russell_james1402928514.jpg',	'512',	'704.68817204301',	'russell_james1402928514.jpg',	'1488',	'2048',	'russell_james1402928514.jpg',	'1488',	'2048',	'russell_james1402928514.jpg',	'1024',	'1409.376344086',	'russell_james1402928514.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09CK0',	'My VERY first break in the United States came in the same week - one phone call was from a magazine called W magazine, the other phone call was from a magazine called Sports Illustrated (swimwear edition). And I went off to an island with Sports Illustrated, and I photographed a couple of models - Eva Herzigova, and a young model named Tyra Banks. That image became the cover of Sports Illustrated in 1996, and it was a record setting, best selling cover. And I have to say that for both Tyra and I, it really launched us into a different spotlight that we hadn\'t seen before.',	'0.48',	'0.12',	'1',	'0',	'0',	'a88e88d2f489835ccaa759921299ccc29e8a3110'),
(454,	28,	2,	'image',	'1402376700',	NULL,	'AMERICAN PHOTO magazine: Adriana Lima',	'',	'0',	NULL,	'russell_james1402928698.wav',	'',	'',	'',	'',	'russell_james1402928697.mp4',	NULL,	NULL,	'256',	'310.5971563981',	'russell_james1402928643.jpg',	'512',	'621.19431279621',	'russell_james1402928643.jpg',	'1688',	'2048',	'russell_james1402928643.jpg',	'1688',	'2048',	'russell_james1402928643.jpg',	'1024',	'1242.3886255924',	'russell_james1402928643.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0auhF',	'Photo magazine. Adriana Lima. I\'ve had several covers for Photo magazine over the years, and it\'s probably not the most widely circulated magazine, certainly it\'s not a VOGUE or Marie Claire, but in my world it\'s the holy grail. It\'s like the big award that you can get, because it is a magazine that is really revered by my peers. So when I got my first cover for Photo magazine, it was with Adriana Lima, and it was on American Photo. And I was so proud I can\'t tell you - just to be in the magazine that really does celebrate photography.',	'0.51',	'0.19',	'1',	'0',	'0',	'caf361da5f535a3fa8a6e45294510c424bce897c'),
(455,	28,	2,	'image',	'1402376760',	NULL,	'ZINK magazine: Alessandra Ambrósio',	'',	'0',	NULL,	'russell_james1402928778.wav',	'',	'',	'',	'',	'russell_james1402928778.mp4',	NULL,	NULL,	'256',	'313.56937799043',	'russell_james1402928736.jpg',	'512',	'627.13875598086',	'russell_james1402928736.jpg',	'1672',	'2048',	'russell_james1402928736.jpg',	'1672',	'2048',	'russell_james1402928736.jpg',	'1024',	'1254.2775119617',	'russell_james1402928736.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09oCG',	'I remember doing the cover for Zink magazine, and they\'ve used different covers over the years, but I was particularly - it was a great transitional moment for me because it was with Alessandra Ambrósio, someone that I photographed almost exclusively for Victoria\'s Secret. So we both knew each other just in this one way. And this was a break out for us, because we did a big fashion story, we put it into Zink magazine, and it was just a very fashion forward photograph. Over the years with Alessandra, I\'ve now shot many magazines for her for many different countries, but this was kind of the first step into the editorial market outside of our Victoria\'s Secret world.',	'0.59',	'0.13',	'1',	'0',	'0',	'118d09a1a227730b9c004fbc788d20c77f77d145'),
(456,	28,	2,	'image',	'1402376940',	NULL,	'',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'russell_james1402928887.mp4',	NULL,	NULL,	'256',	'316.59903381643',	'russell_james1402928805.jpg',	'512',	'633.19806763285',	'russell_james1402928805.jpg',	'1656',	'2048',	'russell_james1402928805.jpg',	'1656',	'2048',	'russell_james1402928805.jpg',	'1024',	'1266.3961352657',	'russell_james1402928805.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Bpo',	'',	'0.47',	'0.35',	'1',	'0',	'0',	'0fa46a2d8249f9581cb99ef0804a2949c54ea341'),
(457,	28,	2,	'image',	'1402377300',	NULL,	'MARIE CLAIRE magazine: Daniela Pestova',	'',	'0',	NULL,	'russell_james1402928951.wav',	'',	'',	'',	'',	'russell_james1402928948.mp4',	NULL,	NULL,	'256',	'352.34408602151',	'russell_james1402928910.jpg',	'512',	'704.68817204301',	'russell_james1402928910.jpg',	'1488',	'2048',	'russell_james1402928910.jpg',	'1488',	'2048',	'russell_james1402928910.jpg',	'1024',	'1409.376344086',	'russell_james1402928910.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aCh0',	'I remember when Marie Claire decided to run a close up shot of Daniela Pestova that I\'d photographed as their cover. First of all it was no surprise, Daniela just had this face - it was so beautiful, and just so striking and close - even though it was a fashion magazine, that image said so much. And that image, that particular photograph, was requested again and again to become covers on other Marie Claire\'s around the world, so I thought it was a good example of a successful cover.',	'0.62',	'0.33',	'1',	'0',	'0',	'ca31486b3293d9fa2bb23d427ac4731bc998d89e'),
(458,	28,	2,	'image',	'1402377660',	NULL,	'ELLE magazine',	'',	'0',	NULL,	'russell_james1402929023.wav',	'',	'',	'',	'',	'russell_james1402929022.mp4',	NULL,	NULL,	'256',	'336.08205128205',	'russell_james1402928974.jpg',	'512',	'672.1641025641',	'russell_james1402928974.jpg',	'1560',	'2048',	'russell_james1402928974.jpg',	'1560',	'2048',	'russell_james1402928974.jpg',	'1024',	'1344.3282051282',	'russell_james1402928974.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09ASo',	'I\'ve shot many ELLE magazine covers over the years for different countries, but this was one of the first. And it was a very fashion, quiet, photograph, and I felt it really represented another side of photography that was just - for me it was just being born inside of myself. I was just starting to really understand the quietness and simplicity of certain types of fashion.',	'0.64',	'0.25',	'1',	'0',	'0',	'322d050b1ea8215869b31cfb66972d4f3d2ff156'),
(459,	28,	2,	'image',	'1402377900',	NULL,	'SELF magazine: Claudia Schiffer',	'',	'0',	NULL,	'russell_james1402929091.wav',	'',	'',	'',	'',	'russell_james1402929091.mp4',	NULL,	NULL,	'256',	'350.45989304813',	'russell_james1402929048.jpg',	'512',	'700.91978609626',	'russell_james1402929048.jpg',	'1496',	'2048',	'russell_james1402929048.jpg',	'1496',	'2048',	'russell_james1402929048.jpg',	'1024',	'1401.8395721925',	'russell_james1402929048.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09n1n',	'SELF is a special magazine that really concentrates somewhere between fashion, but really about lifestyle, health, well-being, and all of these areas. So there\'s a kind of balance. They try to find very fashionable people who are \"of the moment\", but also people who have a history of wellness, and to try to express that in their covers. I remember doing this particular cover of Claudia Schiffer. It was the first time that I had met her, and I was very green, I was very nervous, but it worked out.',	'0.69',	'0.18',	'1',	'0',	'0',	'cd4d6fe241cc4e44661562e26965529f31c1cd68'),
(460,	28,	2,	'image',	'1402378200',	NULL,	'MARIE CLAIRE magazine: Gisele Bündchen',	'',	'0',	NULL,	'russell_james1402929175.wav',	'',	'',	'',	'',	'russell_james1402929175.mp4',	NULL,	NULL,	'256',	'326.04975124378',	'russell_james1402929132.jpg',	'512',	'652.09950248756',	'russell_james1402929132.jpg',	'1608',	'2048',	'russell_james1402929132.jpg',	'1608',	'2048',	'russell_james1402929132.jpg',	'1024',	'1304.1990049751',	'russell_james1402929132.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0asGo',	'This particular cover of Gisele on Marie Claire was one picked up around the world, and run in many Marie Claire\'s. I shot a large story with Gisele who - I just want to make a special mention of her because I think that Gisele changed the landscape of fashion photography as a model. She came in at a time when the \"supermodel\" was a dying breed, and she re-energized that space. The world went completely crazy for her. So for me to be able to photograph Gisele in fashion - I went on to shoot countless projects with her, on Victoria\'s Secret and other projects - but this was the launch of it. It was Gisele, for Marie Claire, and just very iconic for me, and what it represents to the industry.',	'0.54',	'0.38',	'1',	'0',	'0',	'57ec1beb1219a9b578f9062164c6ff1d4c083c12'),
(461,	28,	2,	'image',	'1402378500',	NULL,	'GQ magazine: Adriana Lima',	'',	'0',	NULL,	'russell_james1402929246.wav',	'',	'',	'',	'',	'russell_james1402929245.mp4',	NULL,	NULL,	'256',	'343.12041884817',	'russell_james1402929200.jpg',	'512',	'686.24083769634',	'russell_james1402929200.jpg',	'1528',	'2048',	'russell_james1402929200.jpg',	'1528',	'2048',	'russell_james1402929200.jpg',	'1024',	'1372.4816753927',	'russell_james1402929200.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09FW3',	'GQ. So the difference between GQ and say, obviously between a VOGUE, and a Marie Claire and an ELLE, is that GQ is mostly a male audience. So strangely it was a much harder shoot for me, because I\'m use to shooting photographs that are targeted at women. I like my photographs to primarily - the main thing I\'m thinking when I\'m shooting a photograph is \"Will the woman that I\'m photographing really love this image now, and 10 years from now?\" So when you\'re shooting for a male skewed audience it gets a little different, because I could really not think that, and still do a picture that will sell well. But I was really happy with the way GQ collaborated with me and worked with me and allowed me to maintain my integrity, and Adriana Lima was one of the first people that I put on the cover of a GQ magazine.',	'0.68',	'0.18',	'1',	'0',	'0',	'26888f3b75ec52bfee8167aebf9f72dd54369b61'),
(462,	26,	2,	'image',	'1402383600',	NULL,	'Building bridges and breaking world records with The Black Eyed Peas',	'',	'0',	NULL,	'russell_james1402929390.m4a',	'',	'',	'',	'',	'russell_james1402929390.mp4',	NULL,	NULL,	'256',	'177.625',	'russell_james1402929295.jpg',	'512',	'355.25',	'russell_james1402929295.jpg',	'2048',	'1421',	'russell_james1402929295.jpg',	'2048',	'1421',	'russell_james1402929295.jpg',	'1024',	'710.5',	'russell_james1402929295.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0auyb',	'This photograph of myself and The Black Eyed Peas standing in front of a jet with imagery on it - there\'s so much to this project I can\'t - it\'s so hard to describe - but I\'ll give it my best shot. I was touring the Nomad Two Worlds collection. I had photographed The Black Eyed Peas. Richard Branson had agreed to let me put their images on an aeroplane that they would travel on. The Black Eyed Peas had agreed to fly on the aeroplane, and we flew across the country of Australia, from one coast to another, on an aeroplane that had painted with Indigenous art and with Nomad Two Worlds photographs. During that flight there were records set for the Guinness Book of Records - for the highest ever performance by an Indigenous performer, and highest ever concert (which The Black Eyed Peas performed) - and it was one rockin\' flight, that\'s all I\'m going to say!',	'0.46',	'0.57',	'1',	'0',	'0',	'b2160a10a0437c516f7565852195ab1bd9dc1a4d'),
(463,	26,	2,	'image',	'1402383900',	NULL,	'Mixing friendship and philanthropy',	'',	'0',	NULL,	'russell_james1402929462.wav',	'',	'',	'',	'',	'russell_james1402929461.mp4',	NULL,	NULL,	'256',	'187.25',	'russell_james1402929412.jpg',	'512',	'374.5',	'russell_james1402929412.jpg',	'2048',	'1498',	'russell_james1402929412.jpg',	'2048',	'1498',	'russell_james1402929412.jpg',	'1024',	'749',	'russell_james1402929412.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aSwF',	'This photograph of Miranda, myself (and Miranda\'s holding a Red Camera) really says a lot about friends and friendships, both personal and professional. In this picture, it may look like just Miranda and I are standing there holding a camera. Everything that is going on there is: Miranda is holding a camera, the Red Camera. The company was founded and is owned by a great friend of mine, Jarred Land, who\'s just done an incredible job. And Jarred has got a very philanthropic heart and allows me to use those cameras to photograph things around the world on a philanthropic level when we have no budget. I also use the camera of course commercially. The wings on Miranda\'s back are from Victoria\'s Secret. We\'re standing on a Victoria\'s Secret shoot, and I consider them close personal friends on so many levels. So I guess this picture is just about a \"behind the scenes\" look at friendship.',	'0.49',	'0.36',	'1',	'0',	'0',	'e57c2027018f67b1aab095e3db26f38f514bfa03'),
(464,	26,	2,	'image',	'1402384560',	NULL,	'Connecting with the kids of Haiti',	'',	'0',	NULL,	'russell_james1402929534.wav',	'',	'',	'',	'',	'russell_james1402929534.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402929492.jpg',	'512',	'341.25',	'russell_james1402929492.jpg',	'2048',	'1365',	'russell_james1402929492.jpg',	'2048',	'1365',	'russell_james1402929492.jpg',	'1024',	'682.5',	'russell_james1402929492.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0afDe',	'These kinds of moments, of being really \"on the ground\" and involved with people, are extraordinary. In this case, I\'m in an area that is basically tents, where people have been living a long time after the earthquake. The United Nations has a strong presence (peacekeeping forces). As always, it\'s the kids that you can communicate with. I took out the camera, and I started to speak with the kids, and the kids themselves took over the camera. In the end, I\'m posing for the pictures with the kids, and the kids have got the camera, and it was just a really great moment of connectivity.',	'0.3',	'0.36',	'1',	'0',	'0',	'c7b4dfaba8c71a713a09db283daf985720de5295'),
(465,	26,	2,	'image',	'1402384620',	NULL,	'Alessandra Ambrósio for Rolex: Taking a glimpse behind the lens',	'',	'0',	NULL,	'russell_james1402929614.wav',	'',	'',	'',	'',	'russell_james1402929613.mp4',	NULL,	NULL,	'256',	'385.50588235294',	'russell_james1402929566.jpg',	'512',	'771.01176470588',	'russell_james1402929566.jpg',	'1360',	'2048',	'russell_james1402929566.jpg',	'1360',	'2048',	'russell_james1402929566.jpg',	'1024',	'1542.0235294118',	'russell_james1402929566.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Ror',	'If you want to make life complicated, decide to photograph a person under water. In this case, I\'m photographing Alessandra Ambrósio for a Rolex watch campaign under water. I have got about everything going on. You can\'t see all the divers and everything around us, but Alessandra is just breathing air and holding her breath as long as she can. There\'s a coral reef, there\'s surge, I\'m trying to hold still. This is a small glimpse at that world.',	'0.25',	'0.29',	'1',	'0',	'0',	'a053a79b968f2fdfa193419c441cb4621ad683ae'),
(466,	26,	2,	'image',	'1402384800',	NULL,	'On set with Fergie',	'',	'1',	NULL,	'russell_james1402929720.wav',	'',	'',	'',	'',	'russell_james1402929719.mp4',	NULL,	NULL,	'256',	'206.125',	'russell_james1402929665.jpg',	'512',	'412.25',	'russell_james1402929665.jpg',	'4096',	'3298',	'russell_james1402929665.jpg',	'2048',	'1649',	'russell_james1402929665.jpg',	'1024',	'824.5',	'russell_james1402929665.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09CJT',	'Fergie is one of the people I just have an extraordinary amount of time for. She\'s just such a spirit and an energy as a person. I photograph, of course, a lot of celebrities, a lot of music people. And Fergie is someone that\'s just so generous with her time - she\'s supported Nomad Two Worlds, she supports so many things - and I just wanted to include a shot of me with someone that I idolize - Fergie!',	'0.49',	'0.38',	'1',	'0',	'0',	'ad0df585785b1c48ac37ffd02d7b9770109c4435'),
(467,	26,	2,	'image',	'1402385700',	NULL,	'Getting the perfect shot - behind the scenes of a Victoria’s Secret shoot',	'',	'0',	NULL,	'russell_james1402929789.wav',	'',	'',	'',	'',	'russell_james1402929788.mp4',	NULL,	NULL,	'256',	'341.33333333333',	'russell_james1402929749.jpg',	'512',	'682.66666666667',	'russell_james1402929749.jpg',	'1536',	'2048',	'russell_james1402929749.jpg',	'1536',	'2048',	'russell_james1402929749.jpg',	'1024',	'1365.3333333333',	'russell_james1402929749.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a0Id',	'I\'m often asked what it\'s like looking through the lens all day at some of the most amazing supermodels or celebrities. In this case, I\'m photographing Alessandra Ambrósio in St. Bart\'s for Victoria\'s Secret, and I think it\'s a pretty good example of what it\'s like to be looking through that lens!',	'0.53',	'0.39',	'1',	'0',	'0',	'88bc51ee4a192f199d4a7449768cbad1724a8c8f'),
(468,	26,	2,	'image',	'1402385880',	NULL,	'Touring Haiti with President Clinton and Donna Karan',	'',	'1',	NULL,	'russell_james1402929888.wav',	'',	'',	'',	'',	'russell_james1402929888.mp4',	NULL,	NULL,	'256',	'184.625',	'russell_james1402929830.jpg',	'512',	'369.25',	'russell_james1402929830.jpg',	'4096',	'2954',	'russell_james1402929830.jpg',	'2048',	'1477',	'russell_james1402929830.jpg',	'1024',	'738.5',	'russell_james1402929830.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aD4y',	'One of the people I truly admire for what they’ve done for the world is former President Clinton. Meeting any President of course is an honor, in terms of that these are the people that we’ve entrusted to basically run the country, and in many cases, the world. President Clinton has done so much for the world since leaving office, and I’ve met with the President several times across Nomad Two Worlds - he’s spoken so well about Nomad Two Worlds and the work we do. On this particular time, I was in Haiti with Donna Karan, and the President was reviewing a bag factory that had really got some traction, and Donna and I were just about to head to Germany to show some products from Haiti. So we quickly took a snapshot together. Of course it’s just a very humbling moment for me to be in such a photograph.',	'0.5',	'0.26',	'1',	'0',	'0',	'b573378d95d8f12fc3dfcca0f68b59d35dd24525'),
(469,	26,	2,	'image',	'1402386000',	NULL,	'The “step and repeat”',	'',	'1',	NULL,	'russell_james1402929993.wav',	'',	'',	'',	'',	'russell_james1402929993.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402929938.jpg',	'512',	'341.25',	'russell_james1402929938.jpg',	'4096',	'2730',	'russell_james1402929938.jpg',	'2048',	'1365',	'russell_james1402929938.jpg',	'1024',	'682.5',	'russell_james1402929938.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0asWU',	'There\'s something that you have to get used to, once your photography or your art form goes into the world of exhibition, and that is something called the \"step and repeat\". That means standing in front of a wall that has the name of the sponsors or what it is behind you, and all the people that are supporting it. In this case, there is a person called Lisa Fox who is an amazing person who had introduced me to Donna Karan, Hugh Jackman and others who became great supporters of Nomad. Hugh Jackman, great friend. Deborra-lee, who is his wife, and just a wonderful person, and also done so much to help Nomad and is herself greatly engaged with many other issues like reforming adoption. And someone that I absolutely idolize, her name is Professor Fiona Stanley, and her work in child health around the world is so extraordinary that I could just urge you to go and check out Telethon Institute for Child Health Research (http://www.childhealthresearch.org.au/)',	'0.53',	'0.3',	'1',	'0',	'0',	'bb01ed8a3f806a7c735ad481e7025726fa389677'),
(472,	27,	2,	'image',	'1401580800',	NULL,	'Just about to break some world records with The Black Eyed Peas (thanks to Sir Richard Branson!)',	'',	'0',	NULL,	'russell_james1402931072.wav',	'',	'',	'',	'',	'russell_james1402931072.mp4',	NULL,	NULL,	'256',	'177.625',	'russell_james1402930971.jpg',	'512',	'355.25',	'russell_james1402930971.jpg',	'2048',	'1421',	'russell_james1402930971.jpg',	'2048',	'1421',	'russell_james1402930971.jpg',	'1024',	'710.5',	'russell_james1402930971.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a0rM',	'This photograph of me standing with The Black Eyed Peas in front of a jet that has photographs that I took and collaborative art by Clifton Bieundurry, the founding artist of Nomad Two Worlds, has so much meaning that I can barely have the time to describe it to you. What I can say is the year is 2009: Richard Branson, who\'s not in the photograph, has given us permission to paint one of his aeroplanes, to take the jet across the country with the Black Eyed Peas playing on board the jet. He had taken out half the seats. We broke world records that were set for Guinness (including the world\'s highest performance, world\'s highest didgeridoo performance). It was just a very amazing moment in my life and just so much fun. So this shot, I think all the people you don\'t see are people like Richard Branson who made this happen, and then The Black Eyed Peas, and I\'m fortunate enough to be there in this amazing event.',	'0.46',	'0.58',	'1',	'0',	'0',	'33764378d3e02cf72927e4744168963b9e91699c'),
(473,	27,	2,	'image',	'1401580860',	NULL,	'My first photoshoot with Fergie',	'',	'0',	NULL,	'russell_james1402931205.m4a',	'',	'',	'',	'',	'russell_james1402931205.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402931120.jpg',	'512',	'766.50292397661',	'russell_james1402931120.jpg',	'1368',	'2048',	'russell_james1402931120.jpg',	'1368',	'2048',	'russell_james1402931120.jpg',	'1024',	'1533.0058479532',	'russell_james1402931120.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09DO4',	'I first met Fergie shooting for a Foundation that Fergie was involved with - a charity - and it was for me a case of photographic love at first sight. Her face, her personality, her vibrance - everything just appealed to me so much. This first photograph of Fergie, with her hand on her shoulder looking straight to camera, I think we probably did that photograph in about a minute. It was slammed into the middle of a crazy schedule with her on tour. We took this photograph in New York City in a hotel and I literally set up the room. Fergie was under such pressure to go from one place and be at the next. So it was a walk in, it was the first time that we\'d met, and we took a couple of minutes to get to know each other and speak, she stood in front of the camera, and boom - shot this photograph. I immediately loved it. I loved how she looked. I loved her expression, and it\'s lead to a much broader photographic relationship over the years. So this is a shot that is of great importance to me personally.',	'0.38',	'0.34',	'1',	'0',	'0',	'8964c7d7c46c70f844929339276dfe34710f6e10'),
(474,	27,	2,	'image',	'1401580920',	NULL,	'What makes for a great portrait? Amazing attitude, expression and… Fergie!',	'',	'0',	NULL,	'russell_james1402931345.m4a',	'',	'',	'',	'',	'russell_james1402931345.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402931226.jpg',	'512',	'766.50292397661',	'russell_james1402931226.jpg',	'1368',	'2048',	'russell_james1402931226.jpg',	'1368',	'2048',	'russell_james1402931226.jpg',	'1024',	'1533.0058479532',	'russell_james1402931226.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09pGK',	'This shot of Fergie, to me, is such a great look at who she is. When you see all of the accessories to her nails, and that kind of... the expression to the eyes... I think it just says so much about her in this very small frame, that really is just a hand, and her eyes, and her hair. And undoubtedly shows the great beauty that Fergie is (which is one of the wonderful things that I love about her) but it also shows her personality through how she accessorizes herself.',	'0.5',	'0.32',	'1',	'0',	'0',	'2cc7ad96dd22aa2762d20df36c10216cc42dd997'),
(475,	27,	2,	'image',	'1401580980',	NULL,	'One of my favorite shots of Fergie',	'',	'0',	NULL,	'russell_james1402931689.wav',	'',	'',	'',	'',	'russell_james1402931689.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402931628.jpg',	'512',	'766.50292397661',	'russell_james1402931628.jpg',	'1368',	'2048',	'russell_james1402931628.jpg',	'1368',	'2048',	'russell_james1402931628.jpg',	'1024',	'1533.0058479532',	'russell_james1402931628.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aMFa',	'Sometimes it\'s just a small thing in a photograph that you really love and you can\'t explain why. For me it was Fergie just pulling on the strap of that dress, it just gave it another tension, and I have always loved the image. It\'s now been broadly used, I remember fighting for the image in the beginning with different people, but thankfully Fergie loved it and I loved it, so it\'s got a lot of play and I hope you enjoy it.',	'0.51',	'0.29',	'1',	'0',	'0',	'9c6ea2b141c01a1bf003a16ecbee327e8014deed'),
(476,	27,	2,	'image',	'1401581040',	NULL,	'Fashioning Fergie',	'',	'0',	NULL,	'russell_james1402931764.wav',	'',	'',	'',	'',	'russell_james1402931763.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402931714.jpg',	'512',	'766.50292397661',	'russell_james1402931714.jpg',	'1368',	'2048',	'russell_james1402931714.jpg',	'1368',	'2048',	'russell_james1402931714.jpg',	'1024',	'1533.0058479532',	'russell_james1402931714.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Dh2',	'This photograph of Fergie was part of a series for a shoe venture that Fergie was in. But it was really a great way for me to experiment. We had an incredibly strong styling team, and this was a place I was able to let Fergie really be Fergie, and move her body shape and play into the fashion world. And this particular series of shots have been widely used, and this particular shot I\'d say is one of my most iconic of Fergie.',	'0.4',	'0.22',	'1',	'0',	'0',	'5885553329858c07eb2efdc2786c8f00065b76c5'),
(477,	27,	2,	'image',	'1401581100',	NULL,	'Fergie’s incredible swimsuit shoot',	'',	'0',	NULL,	'russell_james1402932109.wav',	'',	'',	'',	'',	'russell_james1402931860.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402931812.jpg',	'512',	'766.50292397661',	'russell_james1402931812.jpg',	'2736',	'4096',	'russell_james1402931812.jpg',	'2048',	'3066.0116959064',	'russell_james1402931812.jpg',	'1024',	'1533.0058479532',	'russell_james1402931812.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a1fk',	'This photograph of Fergie I took on top of a hotel in Los Angeles. And for me it was a great privilege because Fergie allowed me to shoot her in a swimsuit - it was already a step out, which showed a lot of trust - and this great visual that I had, this incredibly expansive area, was just wonderful to be able to shoot into. We caught the last light - I mean I literally did that image in about I\'d say 1-1.5 minutes. That was the amount of light that we had. But the professional that she is, she got up and did about 30 amazing positions in about that 1 minute span, and this was the one we chose.',	'0.48',	'0.26',	'1',	'0',	'0',	'89a1e67842b44062de6690273a6b89d67b890fe9'),
(478,	27,	2,	'image',	'1401581220',	NULL,	'Fergie for Voli: Setting the scene',	'',	'0',	NULL,	'russell_james1402931983.wav',	'',	'',	'',	'',	'russell_james1402931983.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402931921.jpg',	'512',	'341.25',	'russell_james1402931921.jpg',	'2048',	'1365',	'russell_james1402931921.jpg',	'2048',	'1365',	'russell_james1402931921.jpg',	'1024',	'682.5',	'russell_james1402931921.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09p9I',	'This photograph of Fergie with a cocktail is a part of Fergie\'s venture with \"Voli\", which is a vodka company. And we were creating scenes. The great thing is all the people in the photograph with Fergie are great friends that I\'d seen on tour with her over the years when I\'d travelled. So it\'s a very legitimate photograph, and I believe it was the launch of her relationship with a very big brand.',	'0.49',	'0.19',	'1',	'0',	'0',	'428c011e469a0fbe8c8904c0d0c514b401f14dd8'),
(479,	27,	2,	'image',	'1401581280',	NULL,	'Fine tuning Fergie’s incredible makeup for Wet’n’Wild',	'',	'0',	NULL,	'russell_james1402936181.m4a',	'',	'',	'',	'',	'russell_james1402936180.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402936001.jpg',	'512',	'341.25',	'russell_james1402936001.jpg',	'2048',	'1365',	'russell_james1402936001.jpg',	'2048',	'1365',	'russell_james1402936001.jpg',	'1024',	'682.5',	'russell_james1402936001.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0axtR',	'This is yet another perspective of behind the scenes that I think is just fascinating, and I enjoy sharing them with people because these types of shots are so interesting. In this case, there\'s a massive frenzy going on around Fergie just to finally tweak in this fine tuned look for a shoot for a company called \"Wet N Wild\", a cosmetic brand. As you can see they\'re working on her eye, they\'re working on her hair, they\'re working on her clothes, we\'re against the clock - and I just love the energy that it captures, and yet Fergie still looks remarkable in the photograph.',	'0.53',	'0.42',	'1',	'0',	'0',	'd0fcae4109dd4475389fe4e011968e6e924050cd'),
(480,	27,	2,	'image',	'1401581340',	NULL,	'Behind the scenes with Fergie for Wet’n’Wild',	'',	'0',	NULL,	'russell_james1403009202.wav',	'',	'',	'',	'',	'russell_james1402936440.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402938133.jpg',	'512',	'341.25',	'russell_james1402938133.jpg',	'4096',	'2730',	'russell_james1402938133.jpg',	'2048',	'1365',	'russell_james1402938133.jpg',	'1024',	'682.5',	'russell_james1402938133.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1U09FFz',	'Alex, my trusted assistant, snapped off yet another shot of me photographing Fergie, and I liked it because he managed to - actually Fergie looks amazing in this shot, and he\'s obscured my face out which means it\'s a good shot, so I just wanted to share it with you.',	'0.66',	'0.38',	'1',	'0',	'0',	'687d466628701cebd6945c547569da5be3145546'),
(481,	27,	2,	'image',	'1401581460',	NULL,	'Hair stylists working their magic on Fergie for Wet’n’Wild',	'',	'0',	NULL,	'russell_james1402936667.m4a',	'',	'',	'',	'',	'russell_james1402936666.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402936506.jpg',	'512',	'341.25',	'russell_james1402936506.jpg',	'4096',	'2730',	'russell_james1402936506.jpg',	'2048',	'1365',	'russell_james1402936506.jpg',	'1024',	'682.5',	'russell_james1402936506.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a7Un',	'A lot of the times the behind the scenes is so interesting to watch. And in this case, Fergie is just getting her hair done, and I see this all the time but I have this compulsion always to shoot the camera. Sometimes I think the behind the scenes is as interesting as the actual shot you\'re about to do. In this case, Fergie looking straight towards the camera with her hair being done, I just thought it was a cool shot and I\'m excited to share it with you.',	'0.35',	'0.45',	'1',	'0',	'0',	'3da54c844393813164db9c7750ae11c6ec3d0652'),
(482,	27,	2,	'image',	'1401581520',	NULL,	'Fergie and I celebrating the end of a massive campaign shoot',	'',	'0',	NULL,	'russell_james1402936882.m4a',	'',	'',	'',	'',	'russell_james1402936881.mp4',	NULL,	NULL,	'256',	'206.125',	'russell_james1402936728.jpg',	'512',	'412.25',	'russell_james1402936728.jpg',	'4096',	'3298',	'russell_james1402936728.jpg',	'2048',	'1649',	'russell_james1402936728.jpg',	'1024',	'824.5',	'russell_james1402936728.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09DNY',	'This photograph of Fergie and I was snapped in Los Angeles during a shoot for \"Voli\" vodka, and it was fun to me because I\'d just got done with a massive shoot, that it was probably 1 or 2 o\'clock in the morning, and the last shot was Fergie doing great moves wearing sporting attire, and it was just a really cool, energetic finish. And right at the end of it, Fergie just said, \"Russell James, I want to have a photograph with you\", and this is the photograph. Unfortunately she looks great, well fortunately, and I look like an idiot, but this is the shot.',	'0.5',	'0.48',	'1',	'0',	'0',	'6179a8962eb2bbc72b49f739f850a598ec91e31b'),
(483,	27,	2,	'image',	'1401582000',	NULL,	'Fergie from behind the lens',	'',	'0',	NULL,	'russell_james1402938423.m4a',	'',	'',	'',	'',	'russell_james1402938423.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402938284.jpg',	'512',	'341.25',	'russell_james1402938284.jpg',	'4096',	'2730',	'russell_james1402938284.jpg',	'2048',	'1365',	'russell_james1402938284.jpg',	'1024',	'682.5',	'russell_james1402938284.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Ssv',	'One of my great and trusted assistants, Alex Waltl, took this photograph of me photographing Fergie. And he managed to snap this shot, and I don\'t get to see myself shooting so often, so it was kind of unique for me. So the image is me, with my arm up, and you can see Fergie perfectly through the frame. So I think Alex has potential.',	'0.68',	'0.44',	'1',	'0',	'0',	'f86d028624b48a7c4c9c8a1f57a136d761fb5495'),
(484,	27,	2,	'image',	'1401582060',	NULL,	'Fergie at Nomad Two Worlds’ first Australian exhibition',	'',	'0',	NULL,	'russell_james1402938604.m4a',	'',	'',	'',	'',	'russell_james1402938603.mp4',	NULL,	NULL,	'256',	'170.25',	'russell_james1402938472.jpg',	'512',	'340.5',	'russell_james1402938472.jpg',	'4096',	'2724',	'russell_james1402938472.jpg',	'2048',	'1362',	'russell_james1402938472.jpg',	'1024',	'681',	'russell_james1402938472.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a7nl',	'This photograph was taken at an opening of an art exhibition, of my own art exhibition, Nomad Two Worlds, in the National Gallery of Victoria in the year 2009. I liked it because it\'s an unseen shot of Fergie, with me, looking at an art piece that had been created, and I just felt very privileged and honored that she took the time.',	'0.29',	'0.36',	'1',	'0',	'0',	'7e736efe11f11b5479bb40586c382d799c0602fd'),
(485,	27,	2,	'image',	'1401582120',	NULL,	'Breaking world records with Fergie and The Black Eyed Peas',	'',	'0',	NULL,	'russell_james1402938807.m4a',	'',	'',	'',	'',	'russell_james1402938807.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402938676.jpg',	'512',	'341.25',	'russell_james1402938676.jpg',	'4096',	'2730',	'russell_james1402938676.jpg',	'2048',	'1365',	'russell_james1402938676.jpg',	'1024',	'682.5',	'russell_james1402938676.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a1Mh',	'This shot was taken on board a plane. It was a 737 aircraft owned by Sir Richard Branson, or rather the Virgin Company, and we had painted the aircraft with my photographs and collaborative artworks, and then taken the plane and flown across Australia and set the record - the world record - for the highest ever performance. This is a photograph of Fergie, Will, the Peas, all performing at about 41,000 feet if I recall correctly.',	'0.51',	'0.33',	'1',	'0',	'0',	'3c85c57571e7cebcf59d518df2c65e334bc52fe4'),
(486,	27,	2,	'image',	'1401582180',	NULL,	'“Step and repeat” shots for Nomad Two Worlds: The Black Eyed Peas, Donna Karan, Clifton Bieundurry and Virgin Australia',	'',	'0',	NULL,	'russell_james1402938975.m4a',	'',	'',	'',	'',	'russell_james1402938974.mp4',	NULL,	NULL,	'256',	'123.875',	'russell_james1402938852.jpg',	'512',	'247.75',	'russell_james1402938852.jpg',	'4096',	'1982',	'russell_james1402938852.jpg',	'2048',	'991',	'russell_james1402938852.jpg',	'1024',	'495.5',	'russell_james1402938852.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Gt1',	'This \"step and repeat\" shot as it\'s known, this was taken at an event. I had an opening for my art project, Nomad Two Worlds, which is a collaboration with Indigenous artists, and it was in Melbourne in Australia in 2009. And Fergie, will.i.am, Taboo - all of the Peas turned up - as did Donna Karan and Richard Branson had an incredible presence there with all of his people, and it was just such a wonderful event. And this is what we call a \"step and repeat\" shot - it was a press shot, and it has my great friend Clifton Bieundurry who is the founding artist of Nomad Two Worlds, Fergie, Peas, everybody else.',	'0.53',	'0.34',	'1',	'0',	'0',	'79b1101f7c6a11ffe5d8d303c9b80d988c913039'),
(487,	27,	2,	'image',	'1401582300',	NULL,	'Fergie looking just as amazing on the small screen…',	'',	'0',	NULL,	'russell_james1402939143.m4a',	'',	'',	'',	'',	'russell_james1402939143.mp4',	NULL,	NULL,	'256',	'184.125',	'russell_james1402939017.jpg',	'512',	'368.25',	'russell_james1402939017.jpg',	'4096',	'2946',	'russell_james1402939017.jpg',	'2048',	'1473',	'russell_james1402939017.jpg',	'1024',	'736.5',	'russell_james1402939017.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09RVt',	'When I look around the studio often I see monitors, and those visuals can be so cool. I literally had just shot Fergie in this amazing look with a red lip, and I looked down, and on the iPad there is the image that I\'m shooting as it synced with the camera. So I just turned the camera and I took the shot. And if I had it my way I would have published that image. I didn\'t have it my way, so this is my opportunity to share the image.',	'0.32',	'0.34',	'1',	'0',	'0',	'e31e5ecb1f99c4a84cd3c413450f8c553b86cf83'),
(488,	27,	2,	'image',	'1401584400',	NULL,	'Scarlett Johansson as a man (Part 1)',	'',	'0',	NULL,	'russell_james1402939478.m4a',	'',	'',	'',	'',	'russell_james1402939459.mp4',	NULL,	NULL,	'256',	'339.56476683938',	'russell_james1402939208.jpg',	'512',	'679.12953367876',	'russell_james1402939208.jpg',	'1544',	'2048',	'russell_james1402939208.jpg',	'1544',	'2048',	'russell_james1402939208.jpg',	'1024',	'1358.2590673575',	'russell_james1402939208.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09J8f',	'This shot of Scarlett, looking straight to camera as a guy, really set the stage for the entire shoot.',	'0.49',	'0.46',	'1',	'0',	'0',	'e20e9d74f9c7042491be6d72696bb0af3acde62d'),
(489,	27,	2,	'image',	'1401584520',	NULL,	'Scarlett Johansson as a man (Part 2)',	'',	'0',	NULL,	'russell_james1402939781.m4a',	'',	'',	'',	'',	'russell_james1402939780.mp4',	NULL,	NULL,	'256',	'174.75',	'russell_james1402939518.jpg',	'512',	'349.5',	'russell_james1402939518.jpg',	'4096',	'2796',	'russell_james1402939518.jpg',	'2048',	'1398',	'russell_james1402939518.jpg',	'1024',	'699',	'russell_james1402939518.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aMoE',	'The next image in the series of Scarlett Johansson is an extension of her dressed as a man. I just asked her to act it out, to play it out. She took a cigarette, she smoked (I\'m not a promoter of smoking, I\'m a health freak) but it just fit the time and the period and what she was trying to say. And it added so much character to her, and it was just very interesting the watch the way her face contorted - she really became a guy in that shot.',	'0.25',	'0.34',	'1',	'0',	'0',	'1fdc87c00363b1e9d902c89870757d62d9a4e252'),
(490,	27,	2,	'image',	'1401584580',	NULL,	'Scarlett Johansson as a man (Part 3)',	'',	'0',	NULL,	'russell_james1402940055.m4a',	'',	'',	'',	'',	'russell_james1402940054.mp4',	NULL,	NULL,	'256',	'350.45989304813',	'russell_james1402939847.jpg',	'512',	'700.91978609626',	'russell_james1402939847.jpg',	'2992',	'4096',	'russell_james1402939847.jpg',	'2048',	'2803.679144385',	'russell_james1402939847.jpg',	'1024',	'1401.8395721925',	'russell_james1402939847.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0a0YO',	'The third image of Scarlett, in the series of her as a man, is yet another character portrait. She bites down on her lip, she looks up to the camera, and it was really more like watching a film than watching a string of print shots when I went through the edit, and I couldn\'t find a way to just say \"this one picture\", and I had to do it as a series.',	'0.56',	'0.61',	'1',	'0',	'0',	'dd7b166eac5e4b72c73ccc90bcc48b7e0b72b969'),
(492,	27,	2,	'image',	'1401586080',	NULL,	'Scarlett Johansson \"Tippi Hedren\" style',	'',	'0',	NULL,	'russell_james1402989545.wav',	'',	'',	'',	'',	'russell_james1402989544.mp4',	NULL,	NULL,	'256',	'341.33333333333',	'russell_james1402989315.jpg',	'512',	'682.66666666667',	'russell_james1402989315.jpg',	'3072',	'4096',	'russell_james1402989315.jpg',	'2048',	'2730.6666666667',	'russell_james1402989315.jpg',	'1024',	'1365.3333333333',	'russell_james1402989315.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Fp3',	'When shooting Scarlett, the next concept that we had was \"What would Scarlett look like if she had a Tippi Hedren type makeover?\" - with a beautiful Chanel jacket, went with a strong red lip, the hair was completely done - it was a complete do. It was really beautiful to look at, and I took that photograph and I enjoyed it, and it\'s one of the images that I think people see a lot in books / in exhibitions. However, there was another side of that image, because I felt like she was this wild, beautiful spirit just busting to get out. And so after I photographed Scarlett really strict and with this look perfect, I said \"Just break it down. Just take it wherever you want to take it. Just be who you are.\"',	'0.49',	'0.43',	'1',	'0',	'0',	'9dcbc9216aa65f1025276193215cb523a412c4f7'),
(493,	27,	2,	'image',	'1401586140',	NULL,	'Scarlett Johansson, “Tippi Hedren” style: the deconstruction begins',	'',	'0',	NULL,	'russell_james1402989675.wav',	'',	'',	'',	'',	'russell_james1402989674.mp4',	NULL,	NULL,	'256',	'350.45989304813',	'russell_james1402989587.jpg',	'512',	'700.91978609626',	'russell_james1402989587.jpg',	'2992',	'4096',	'russell_james1402989587.jpg',	'2048',	'2803.679144385',	'russell_james1402989587.jpg',	'1024',	'1401.8395721925',	'russell_james1402989587.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09qu5',	'The next image in the series of Scarlett, the Tippi Hedren series of Scarlett, I had asked her to just break down what the image was, and just to take it anywhere she wanted. And she took her hand and just smudged it across the lip. And as she made that movement and that smudge, I got this frame and it just - it was just a moment. Again, it was like looking at a strip of- it was like looking at a film sequence, rather than a series of individual print shots - and I couldn\'t find a way to show one without showing the other.',	'0.52',	'0.43',	'1',	'0',	'0',	'732cefd6fca73b8012dbc05ca88fab162d87ace1'),
(494,	27,	2,	'image',	'1401586200',	NULL,	'Scarlett Johansson “Tippi Hedren” style: fully deconstructed',	'',	'0',	NULL,	'russell_james1402989774.wav',	'',	'',	'',	'',	'russell_james1402989773.mp4',	NULL,	NULL,	'256',	'350.45989304813',	'russell_james1402989715.jpg',	'512',	'700.91978609626',	'russell_james1402989715.jpg',	'2992',	'4096',	'russell_james1402989715.jpg',	'2048',	'2803.679144385',	'russell_james1402989715.jpg',	'1024',	'1401.8395721925',	'russell_james1402989715.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09El6',	'This last image of Scarlett, when she\'s got a completely deconstructed look, messed up the hair, she\'s torn off the lip - and I feel like it shows inside this beautiful woman there\'s also this naughty little girl. And I think that\'s the great dichotomy that I enjoyed about her. She obviously has so many different levels, and it was just seeing those two combined. It was - from a photographer\'s point of view - it was a dream.',	'0.45',	'0.44',	'1',	'0',	'0',	'bbd6bb5cc6a3f01590605ae13ccbfa3a5b3a230c'),
(495,	27,	2,	'image',	'1401586260',	NULL,	'Sir Richard Branson: A personal portrait',	'',	'1',	NULL,	'russell_james1402989902.m4a',	'',	'',	'',	'',	'russell_james1402989902.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402989838.jpg',	'512',	'766.50292397661',	'russell_james1402989838.jpg',	'2736',	'4096',	'russell_james1402989838.jpg',	'2048',	'3066.0116959064',	'russell_james1402989838.jpg',	'1024',	'1533.0058479532',	'russell_james1402989838.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Lgn',	'Richard Branson. The first time that I photographed Richard Branson was actually on his home on Necker Island. Going to someone\'s home is so different to bringing them into a studio, and it brings another level of knowledge and understanding of what that person is about. I spent several weeks on Richard\'s island, of Necker Island, I was there shooting a project. During that time, I was so fortunate to get to know what I would call the real Richard - a guy with a great sense of humor, an amazing sense of responsibility to the world, and obviously one of the smartest guys you could ever come across, and a pretty good looking rooster. So it was a great challenge when I actually asked Richard \"May I take your photograph - a proper portrait?\" and he said \"Yes\", because there\'s a whole lot to live up to, a whole lot of expectation. This photographic series that I created of Richard I feel captures a lot of the soul of the man. I could easily assemble a series of laughing photographs, of serious photographs, but I found one that I feel really captures who he is through his eyes, through his expression, and through literally the life that\'s been lived through his face.',	'0.62',	'0.49',	'1',	'0',	'0',	'6e4e76ad33f0df9a6541b07dec3465e61b82637c'),
(496,	27,	2,	'image',	'1401586320',	NULL,	'A sophisticated portrait of the stunning Faith Hill',	'',	'1',	NULL,	'russell_james1402990018.m4a',	'',	'',	'',	'',	'russell_james1402990018.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402989956.jpg',	'512',	'766.50292397661',	'russell_james1402989956.jpg',	'2736',	'4096',	'russell_james1402989956.jpg',	'2048',	'3066.0116959064',	'russell_james1402989956.jpg',	'1024',	'1533.0058479532',	'russell_james1402989956.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aw96',	'My relationship with Faith Hill through photography began about a decade ago, when Faith was really making the transition from country to pop. She\'d always been terrifically crossover, but I was presented a great challenge: Faith wanted to continue to appeal to all the massive country audience that she had, whilst also moving into that great pop market. What I found when I met Faith is she was just a truly sincere, lovely person. So it made it such a pleasure to work with her and to collaborate with her across these photographs, and through the years. This particular photograph I took for Faith\'s Christmas album back in the year 2009, and it was put out for holiday. I just experimented with different ideas, and this particular photograph of Faith I love, it\'s been shown at many exhibitions. I like it because it shows her in what I see as her most glamorous form. She is the most sophisticated elegant, beautiful person in many regards, and I felt like this photograph captured that.',	'0.4',	'0.29',	'1',	'0',	'0',	'018f5e2cd1ed762f3861d85c09c9e88584efece3'),
(497,	27,	2,	'image',	'1401586380',	NULL,	'The laughing man, Hugh Jackman',	'',	'1',	NULL,	'russell_james1402990101.m4a',	'',	'',	'',	'',	'russell_james1402990100.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402990055.jpg',	'512',	'341.25',	'russell_james1402990055.jpg',	'4096',	'2730',	'russell_james1402990055.jpg',	'2048',	'1365',	'russell_james1402990055.jpg',	'1024',	'682.5',	'russell_james1402990055.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09oCt',	'Hugh Jackman has played a vital role in my own philanthropic endeavors in the world. I have a project - Nomad Two Worlds - that I\'m passionate about. It\'s around reconciliation. It began for me through the conflict that I saw in my own country. And Hugh, being a countryman, when we met he had a lot of compassion for what I was out to do. As a result, I\'ve gone on to work with Hugh collaborating over his shows, over photography, and in various projects. This photograph of Hugh laughing, I took in Toronto in the year 2011. And then he\'d seen this performance, and he said, \"You know mate, this really inspires me, I\'m doing a one man show and I would love to include your Nomad Two Worlds project in some way.\" So at that particular time - now we\'re fast forwarded 6 months later - he has a show off the ground, it\'s already opened in San Francisco, it has now gone to Toronto. We\'re into Toronto to rave reviews, and we\'re in a studio one afternoon and I\'m taking some candid photographs of Hugh. And just this laughing shot of Hugh - it\'s just to me, it expresses who he is - he is the laughing man, he is just a great person with this laughing personality, this strong personality, and just an absolute pleasure to be around his energy.',	'0.59',	'0.48',	'1',	'0',	'0',	'ebcedb9182ea17f2834aa7e94fac9f0cc5b99e10'),
(498,	27,	2,	'image',	'1401586500',	NULL,	'Miley Cyrus, a true icon',	'',	'1',	NULL,	'russell_james1402990367.m4a',	'',	'',	'',	'',	'russell_james1402990367.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402990139.jpg',	'512',	'341.25',	'russell_james1402990139.jpg',	'4096',	'2730',	'russell_james1402990139.jpg',	'2048',	'1365',	'russell_james1402990139.jpg',	'1024',	'682.5',	'russell_james1402990139.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U09Dxu',	'Miley Cyrus is perhaps the most iconic teenager of our time. I have never seen a reaction to somebody so young in such a vast way. When I was called by Miley\'s management and asked to work with her on a project called \"Get Ur Good On\", it was an immediate \"Yes\" for me, I just was so intrigued by who she was. So I managed to capture Miley at a time when she was making a transition from I\'d say, a young girl to a young woman - a very interesting time. And she was undertaking her first major philanthropic endeavor - \"Get Ur Good On\" was the name of it, it\'s her web and her place where she invites people to find out ways or to discuss ways that they can help improve the world around them. So these images were great to me because I felt like I was capturing someone between childhood and womanhood, in this very special precious moment. And this one image of Miley - with her hand up, and the colors in her eyes, and her face and her skin - I think walks that fine line.',	'0.66',	'0.5',	'1',	'0',	'0',	'b69421ddd9d654837a0ddafe15f50a6a12ecf1e3'),
(499,	27,	2,	'image',	'1401587100',	NULL,	'Rihanna for Esquire: “Sexiest Woman Alive” cover',	'',	'1',	NULL,	'russell_james1402990525.m4a',	'',	'',	'',	'',	'russell_james1402990524.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402990424.jpg',	'512',	'766.50292397661',	'russell_james1402990424.jpg',	'2736',	'4096',	'russell_james1402990424.jpg',	'2048',	'3066.0116959064',	'russell_james1402990424.jpg',	'1024',	'1533.0058479532',	'russell_james1402990424.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1U0aUVj',	'This photograph of Rihanna, squatted down in a very I\'d say almost animal-like pose looking to camera, is probably one of the most iconic shapes that I\'ve been known to do. I use it very much in my art world, and she was just so natural for it, and it became the cover image of Esquire 2011 Sexiest Woman Alive, which was a great honor in and of itself, and has also become an image of my own that is a favorite and that I show at exhibitions.',	'0.41',	'0.28',	'1',	'0',	'0',	'86638a47b35ac68bb38f2f0091d0ee1d96a5df0d'),
