(510,	96,	2,	'image',	'1401628800',	NULL,	'Manu for AMAZONIA',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'192.75',	'russell_james1402991019.jpg',	'512',	'385.5',	'russell_james1402991019.jpg',	'2048',	'1542',	'russell_james1402991019.jpg',	'2048',	'1542',	'russell_james1402991019.jpg',	'1024',	'771',	'russell_james1402991019.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfCbTq',	'Emanuela embraces her inner amazon.',	'0.72',	'0.49',	'1',	'0',	'0',	'bc487e7a0b4cbe363541aa76dc0f5e4ac5991f27'),
(511,	29,	2,	'image',	'1401757200',	NULL,	'Adriana Lima steps off the plane – and the journey begins…',	'',	'0',	NULL,	'russell_james1402991457.m4a',	'',	'',	'',	'',	'russell_james1402991456.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402991139.jpg',	'512',	'766.50292397661',	'russell_james1402991139.jpg',	'1368',	'2048',	'russell_james1402991139.jpg',	'1368',	'2048',	'russell_james1402991139.jpg',	'1024',	'1533.0058479532',	'russell_james1402991139.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBd9R',	'Behind the scenes of the Donna Karan campaign - and this first photograph of Adriana stepping off of a plane, it really said it all. I was so excited when, after a lot of planning and a lot of discussion and a lot of complications, there came Adriana off the charter plane, down the stairs, and I knew at that point that we were going to shoot this campaign, in Haiti.',	'0.45',	'0.35',	'1',	'0',	'0',	'515681f6951a31c7fab676062883c12bac9b9a1d'),
(512,	29,	2,	'image',	'1401757320',	NULL,	'Meet some of our amazing crew',	'',	'0',	NULL,	'russell_james1402991573.m4a',	'',	'',	'',	'',	'russell_james1402991571.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402991498.jpg',	'512',	'341.25',	'russell_james1402991498.jpg',	'2048',	'1365',	'russell_james1402991498.jpg',	'2048',	'1365',	'russell_james1402991498.jpg',	'1024',	'682.5',	'russell_james1402991498.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfASUF',	'The Haiti team. This photograph of everyone standing in front a commercial charter that we had to take from Port-au-Prince into the Jacmel area, was really the core team. There were many other people involved - there were 60 people involved at the sort of height of the production. But these people included: Greg Milne, from President Clinton\'s Global Initiative, who was more than helpful in facilitating the area. David Belle, who has an institute (a cine institute) in Haiti that provided the entire production services for us while we were there, and provided valuable jobs for Haitian people whilst we were there. It has of course Donna, Adriana Lima, and many of the other people that were vital to the production. It also includes Philippe Dodard, an amazing artist, whose designs were a part of the collection. So having literally the artist who was involved in some of the visualization, the artist Donna Karan herself who put it together, and so many people that needed to come together in order to make this happen - I just love this photograph, because it warms my heart to see what a team can do if they pull together.',	'0.51',	'0.45',	'1',	'0',	'0',	'ab71ff231dfa62e0a40a23e4aa259ec2380a572e'),
(513,	29,	2,	'image',	'1401757380',	NULL,	'Soaking up the atmosphere en route to the shoot',	'',	'0',	NULL,	'russell_james1402992193.m4a',	'',	'',	'',	'',	'russell_james1402992192.mp4',	NULL,	NULL,	'256',	'284.93913043478',	'russell_james1402992097.jpg',	'512',	'569.87826086957',	'russell_james1402992097.jpg',	'1840',	'2048',	'russell_james1402992097.jpg',	'1840',	'2048',	'russell_james1402992097.jpg',	'1024',	'1139.7565217391',	'russell_james1402992097.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBz0f',	'This photograph of Donna and Adriana, riding on the back of an open truck unsecured through the streets of Haiti, is probably a great demonstration of irresponsibility that my kids will give me a lecture about. However some things just have to happen. When Adriana arrived in Haiti, Donna just wanted her to see it, for what it is - beyond what people think it is, but the beauty of what it is. And Adriana got up on the back of a truck, and we drove through the town of Jacmel on the way to a location, and I was sitting in the car in front, and I took this picture which just really opened up the spirit of the adventure that was about to begin.',	'0.46',	'0.45',	'1',	'0',	'0',	'5fbc5d0365b6ec19c407f672d7e9c0d0423e8d65'),
(514,	29,	2,	'image',	'1401757560',	NULL,	'Adriana Lima for Donna Karan: Launching the casual collection',	'',	'0',	NULL,	'russell_james1402992355.m4a',	'',	'',	'',	'',	'russell_james1402992354.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402992267.jpg',	'512',	'341.25',	'russell_james1402992267.jpg',	'2048',	'1365',	'russell_james1402992267.jpg',	'2048',	'1365',	'russell_james1402992267.jpg',	'1024',	'682.5',	'russell_james1402992267.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBOs2',	'This first photograph of Adriana was taken the day that we arrived in Haiti to photograph the campaign. We actually weren\'t even scheduled to start shooting until the next day. Adriana Lima came on board to do this Donna Karan campaign, and to come to Haiti, partly because obviously it\'s an incredible privilege to be associated with Donna Karan and anything that she does, and also partly because Adriana understood very well that we were on a mission down there to really show Haiti for what it is today - the beauty of it, and to get outside of the preconceptions of what Haiti is / was at the time of the earthquake. And in this photograph of Adriana - we\'re in a beautiful beach house, and she\'s sitting in shorts, reclining on a chair, and it was referred to as a Donna Karan casual, the launch of the casual collection. It is a significant image because I shot it minutes after we arrived, and that photograph is one of the first few frames of the sitting that we did, and it made it into the campaign and was published.',	'0.63',	'0.3',	'1',	'0',	'0',	'564063ad5ce8feecbe9cc2a0b9b3ca1f6c4f0d42'),
(515,	29,	2,	'image',	'1401757800',	NULL,	'Adriana Lima for Donna Karan: Caught in a moment',	'',	'0',	NULL,	'russell_james1402992457.m4a',	'',	'',	'',	'',	'russell_james1402992455.mp4',	NULL,	NULL,	'256',	'161',	'russell_james1402992394.jpg',	'512',	'322',	'russell_james1402992394.jpg',	'2048',	'1288',	'russell_james1402992394.jpg',	'2048',	'1288',	'russell_james1402992394.jpg',	'1024',	'644',	'russell_james1402992394.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBlpZ',	'This photograph of Adriana was the second photograph that I shot inside of a beautiful old hotel in the Jacmel town, and it was really photographed exactly as you see it - just a moment. Adriana was in a room, I moved her towards the light, I took a few frames, and it was done, and it just felt quite perfect. And another image that I was very proud made it into the ultimate campaign.',	'0.81',	'0.21',	'1',	'0',	'0',	'7c3c4a1578785c2b702868a58f62571b791f0c1b'),
(516,	29,	2,	'image',	'1401757980',	NULL,	'Adriana Lima for Donna Karan: Pure elegance',	'',	'0',	NULL,	'russell_james1402992552.m4a',	'',	'',	'',	'',	'russell_james1402992551.mp4',	NULL,	NULL,	'256',	'381.02325581395',	'russell_james1402992492.jpg',	'512',	'762.04651162791',	'russell_james1402992492.jpg',	'1376',	'2048',	'russell_james1402992492.jpg',	'1376',	'2048',	'russell_james1402992492.jpg',	'1024',	'1524.0930232558',	'russell_james1402992492.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22Tgg52',	'This photograph of Adriana Lima, in the beautiful evening gown long dress with her arm extended up the wall - it just speaks for itself. This to me is classic, perfect Adriana. She is just this elegant being that is really hard to describe until you\'ve seen her. This photograph took just a few minutes to actually shoot, and once Donna had fitted the dress to her and she walked into this background that I\'d seen that had some colored moss growing on the wall, everything just combined together absolutely naturally. I really enjoyed this photograph and was glad that it made it into the campaign.',	'0.65',	'0.25',	'1',	'0',	'0',	'4df5551a3b93a8212f8456c912f677041e81e3d4'),
(517,	29,	2,	'image',	'1401758220',	NULL,	'Adriana Lima for Donna Karan: Military style',	'',	'0',	NULL,	'russell_james1402992676.m4a',	'',	'',	'',	'',	'russell_james1402992675.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402992610.jpg',	'512',	'341.25',	'russell_james1402992610.jpg',	'2048',	'1365',	'russell_james1402992610.jpg',	'2048',	'1365',	'russell_james1402992610.jpg',	'1024',	'682.5',	'russell_james1402992610.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TgAkm',	'This photograph of Adriana Lima in the back of a truck, commonly referred as a \"tap tap\" in Haiti, is the most common form of transportation. And it just stimulates my mind when I go to Haiti - I see this particular car, this transportation, and automatically I know where I am. The clothing that Adriana has is part of Donna\'s casual collection, and almost had a military feel to it, and it was just a lot of fun to put Adriana in that very industrial feeling vehicle and shoot something so super high end.',	'0.68',	'0.27',	'1',	'0',	'0',	'6bce6863171282e2dd5d56a0ceb6d69ee8de1d22'),
(518,	29,	2,	'image',	'1401758280',	NULL,	'Adriana Lima for Donna Karan: Launching the eyewear collection',	'',	'0',	NULL,	'russell_james1402992771.m4a',	'',	'',	'',	'',	'russell_james1402992769.mp4',	NULL,	NULL,	'256',	'172.5',	'russell_james1402992709.jpg',	'512',	'345',	'russell_james1402992709.jpg',	'2048',	'1380',	'russell_james1402992709.jpg',	'2048',	'1380',	'russell_james1402992709.jpg',	'1024',	'690',	'russell_james1402992709.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBx8J',	'Donna Karan as a brand also is very engaged in eyewear, and it was really cool to be able to put sunglasses on Adriana at night. I did that photograph probably at 10 o\'clock at night, at the end of a very long day, in the back of a \"tap tap\", which is the most common form of transportation in Haiti - and what can I say? Adriana, eyewear, very graphic photograph, and I\'m glad that it was used.',	'0.7',	'0.48',	'1',	'0',	'0',	'ac304d38d958f93c3a2aa474bc83c9efed2cc786'),
(519,	29,	2,	'image',	'1401758400',	NULL,	'Adriana Lima for Donna Karan: Capturing the color and vibrance of Haiti',	'',	'0',	NULL,	'russell_james1402992855.m4a',	'',	'',	'',	'',	'russell_james1402992854.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402992798.jpg',	'512',	'341.25',	'russell_james1402992798.jpg',	'2048',	'1365',	'russell_james1402992798.jpg',	'2048',	'1365',	'russell_james1402992798.jpg',	'1024',	'682.5',	'russell_james1402992798.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBDgv',	'This photograph for the Donna Karan campaign, of Adriana Lima in this dress, I thought this dress just looked absolutely spectacular on her. And of course having the genius, \"The Maestro\" herself on set styling for this particular campaign (Donna), was a wonderful opportunity to explore. So in the background is one of the artisans, the gentleman that we had been working with creating art concepts that we\'ve helped to take out into the world. So I really enjoyed this photograph because I feel it embodies the artisans of Haiti, the color and vibrance of Haiti, and Adriana Lima just looks bloody beautiful.',	'0.72',	'0.19',	'1',	'0',	'0',	'54ea4db687a91c84c1642a115b50601069ffdd67'),
(520,	29,	2,	'image',	'1401758460',	NULL,	'Adriana Lima for Donna Karan: Delicately balanced details',	'',	'0',	NULL,	'russell_james1402992944.m4a',	'',	'',	'',	'',	'russell_james1402992943.mp4',	NULL,	NULL,	'256',	'169.75',	'russell_james1402992881.jpg',	'512',	'339.5',	'russell_james1402992881.jpg',	'2048',	'1358',	'russell_james1402992881.jpg',	'2048',	'1358',	'russell_james1402992881.jpg',	'1024',	'679',	'russell_james1402992881.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TgKrQ',	'This photograph of Adriana sitting on the steps with a skirt was probably the hardest photograph in the campaign. It may not look hard, but to have the skirt spread on the stairway and to have all the graphic lines, I was worried that it could get very busy, and in fact it is a busy picture - but sometimes busy pictures can work. So I really enjoyed playing with the elements of the lines, of finding the right way to spray the skirt, and obviously it doesn\'t hurt when you have Adriana Lima and Donna Karan on your team!',	'0.62',	'0.24',	'1',	'0',	'0',	'4c62f6e9c6732d60660cf3dbeccb86dd4500080f'),
(521,	29,	2,	'image',	'1401758700',	NULL,	'All hands on deck as we prepare for the shoot',	'',	'0',	NULL,	'russell_james1402993031.m4a',	'',	'',	'',	'',	'russell_james1402993030.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402992970.jpg',	'512',	'341.25',	'russell_james1402992970.jpg',	'2048',	'1365',	'russell_james1402992970.jpg',	'2048',	'1365',	'russell_james1402992970.jpg',	'1024',	'682.5',	'russell_james1402992970.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TgeKr',	'This photograph of Adriana in a purple dress, talking to Fulvia Farolfi, the most incredibly talented makeup artist. And in the scene is also Alex Waltl, who is my first assistant, who really is just under such pressure to pull off a shoot like this, and many other people. This is a candid snapshot of the activity and action that\'s going on at any given time behind the scenes of a major production.',	'0.54',	'0.34',	'1',	'0',	'0',	'9e28448ff2a177db259de9148e5782f4dbd39b6e'),
(522,	29,	2,	'image',	'1401758880',	NULL,	'',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'russell_james1402993112.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402993071.jpg',	'512',	'341.25',	'russell_james1402993071.jpg',	'2048',	'1365',	'russell_james1402993071.jpg',	'2048',	'1365',	'russell_james1402993071.jpg',	'1024',	'682.5',	'russell_james1402993071.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22Tghpv',	'',	'0.36',	'0.48',	'1',	'0',	'0',	'f816c5a4dae1de46e2ff159814289f2e15d46870'),
(523,	29,	2,	'image',	'1401759300',	NULL,	'The wonderful “Ra-Ra” people!',	'',	'0',	NULL,	'russell_james1402993208.m4a',	'',	'',	'',	'',	'russell_james1402993207.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402993150.jpg',	'512',	'341.25',	'russell_james1402993150.jpg',	'2048',	'1365',	'russell_james1402993150.jpg',	'2048',	'1365',	'russell_james1402993150.jpg',	'1024',	'682.5',	'russell_james1402993150.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBo59',	'The Ra-Ra! That\'s what I refer to this picture as. This wonderful group of people known as the Ra-Ra were kind enough to come to the last hours of our shoot in Jacmel in Haiti for the Donna Karan campaign. And I remember being around the corner setting up a shot, and I heard drums and clapping and cheering and I saw Donna running excitedly around the corner. And I turned the corner to this scene of Adriana and about 30 people, mostly the Ra-Ra, and Donna, and they just were exuding this energy. It was just a fantastic scene and I videoed it as well thankfully, and I hope you enjoy this behind the scenes snap as I did making it.',	'0.51',	'0.32',	'1',	'0',	'0',	'3adf7ed766532a96b0094030f491befc1bd78b34'),
(524,	29,	2,	'image',	'1401759540',	NULL,	'Combining fashion with socially responsible passion in Haiti',	'',	'0',	NULL,	'russell_james1402993312.m4a',	'',	'',	'',	'',	'russell_james1402993310.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402993249.jpg',	'512',	'341.25',	'russell_james1402993249.jpg',	'2048',	'1365',	'russell_james1402993249.jpg',	'2048',	'1365',	'russell_james1402993249.jpg',	'1024',	'682.5',	'russell_james1402993249.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TgB7U',	'This shot of the production behind the scenes was an additional shoot that we did whilst in Haiti for the Donna Karan campaign. Donna had taken some designs from our Nomad Two Worlds project (my collaboration with Haitian artists) and taken those impressions and put them into t-shirts and other products. Donna had also designed this incredible product, ranging from beaded necklaces to bone accessories to bags, and it had been sold to a German department store called Breuninger. Why that was so important and why we wanted to do it (all of us donating our time and our services) was because this was a part of the stimulation of the Haitian economy. This is where it really happens - private sector. It was an opportunity for us to be of assistance to people that had a great product, and to introduce them to someone that could bring it to a global market. This is the first moments that we set up to shoot this, and Adriana put on the first t-shirt.',	'0.53',	'0.33',	'1',	'0',	'0',	'fd9afea868aba0ec90bc8eabc2a63e25306f3dd0'),
(525,	29,	2,	'image',	'1401759780',	NULL,	'',	'This shot of Donna and I sitting on a boat is precious to me, because Donna is truly one of my closest friends and an inspiration. We often refer to each other as \"partners in crime\". We are nomads at our center. We had just finished shooting a major campaign. We\'d also just finished shooting a major initiative for and on behalf of and with the people of Haiti for a product that will be launched in Germany. A boat pulled up - we talked to the guys on the boat - we asked if we could do a snapshot on it - and it\'s just a personal favorite photograph.',	'0',	NULL,	'russell_james1402993422.m4a',	'',	'',	'',	'',	'russell_james1402993421.mp4',	NULL,	NULL,	'256',	'170.625',	'russell_james1402993346.jpg',	'512',	'341.25',	'russell_james1402993346.jpg',	'2048',	'1365',	'russell_james1402993346.jpg',	'2048',	'1365',	'russell_james1402993346.jpg',	'1024',	'682.5',	'russell_james1402993346.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfAXb4',	'',	'0.55',	'0.4',	'1',	'0',	'0',	'b8c936b302b4bda086c6ceb685a5d12f5a026f6b'),
(526,	29,	2,	'video',	'1401760200',	NULL,	'',	'',	'0',	NULL,	'',	'russell_james1402993458.mp4',	'',	'',	'',	'russell_james1402993508.mp4',	NULL,	NULL,	'256',	'144',	'russell_james1403008713.jpg',	'512',	'288',	'russell_james1403008713.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'576',	'russell_james1403008713.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TgEk2',	'',	'0.54',	'0.42',	'1',	'0',	'0',	'367240778a6f86b75236dbdd16a9e2b8be25a792'),
(527,	29,	2,	'video',	'1401760320',	NULL,	'',	'',	'0',	NULL,	'',	'russell_james1402993601.mp4',	'',	'',	'',	'russell_james1402993665.mp4',	NULL,	NULL,	'256',	'144',	'russell_james1403008051.jpg',	'512',	'288',	'russell_james1403008051.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'576',	'russell_james1403008051.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBBVQ',	'',	'0.46',	'0.51',	'1',	'0',	'0',	'2cf2ab2340553b1ba63e8afb78221075db70522f'),
(528,	29,	2,	'video',	'1401760500',	NULL,	'',	'',	'0',	NULL,	'',	'russell_james1402993701.mp4',	'',	'',	'',	'russell_james1402993740.mp4',	NULL,	NULL,	'256',	'144',	'russell_james1403008028.jpg',	'512',	'288',	'russell_james1403008028.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'576',	'russell_james1403008028.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBfP2',	'',	'0.82',	'0.29',	'1',	'0',	'0',	'a7b1ad0b7f3bb2d30b5a3529b699b564e1017ce6'),
(529,	29,	2,	'image',	'1401760800',	NULL,	'Alessandra Ambrósio for ROLEX',	'',	'0',	NULL,	'russell_james1402993868.m4a',	'',	'',	'',	'',	'russell_james1402993867.mp4',	NULL,	NULL,	'256',	'339.56476683938',	'russell_james1402993771.jpg',	'512',	'679.12953367876',	'russell_james1402993771.jpg',	'1544',	'2048',	'russell_james1402993771.jpg',	'1544',	'2048',	'russell_james1402993771.jpg',	'1024',	'1358.2590673575',	'russell_james1402993771.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfBt8S',	'This photograph of Alessandra Ambrósio was achieved by literally putting Ali underwater by a beautiful reef, and obviously the hair plays such an important role in the underwater. Probably the most difficult part of the shoot though is the education that goes into the underwater photography for the model. I mean literally, if you think about being immersed in clothes, a mask taken off your face, and the air taken away and you can\'t go popping up to the surface, it\'s no small feat. So a lot of time is spent in a pool training, and then finally in the water. There\'s not a lot of time spent actually shooting - I\'d say 99 % of the time is spent preparing.',	'0.57',	'0.21',	'1',	'0',	'0',	'94aa5288556e6c6ebf51ec2359a0d561b89f9013'),
(530,	29,	2,	'image',	'1401760860',	NULL,	'',	'',	'0',	NULL,	'',	'',	'',	'',	'',	'russell_james1402993957.mp4',	NULL,	NULL,	'256',	'332.67005076142',	'russell_james1402993897.jpg',	'512',	'665.34010152284',	'russell_james1402993897.jpg',	'1576',	'2048',	'russell_james1402993897.jpg',	'1576',	'2048',	'russell_james1402993897.jpg',	'1024',	'1330.6802030457',	'russell_james1402993897.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22Tgid7',	'',	'0.56',	'0.29',	'1',	'0',	'0',	'9839566f14ed5ebd23dbf595baf43ab2043c3750'),
(531,	29,	2,	'image',	'1401761100',	NULL,	'Mini Andén for ROLEX',	'',	'0',	NULL,	'russell_james1402994033.m4a',	'',	'',	'',	'',	'russell_james1402994032.mp4',	NULL,	NULL,	'256',	'330.9898989899',	'russell_james1402993994.jpg',	'512',	'661.9797979798',	'russell_james1402993994.jpg',	'1584',	'2048',	'russell_james1402993994.jpg',	'1584',	'2048',	'russell_james1402993994.jpg',	'1024',	'1323.9595959596',	'russell_james1402993994.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TghG1',	'This shot of Mini Andén looking straight at the camera in the white dress, I achieved by first photographing Mini in a swimming pool by the ocean, so I had good clear water between her and me. She had such fine skin and I just really wanted that to come out. Then I went out into the open sea and I took the photographs of what I wanted to be the background. I also took Mini and submerged her so that I gave her the real experience of being underwater. The end result though is that I took an image that I\'d photographed in a pool because of the clarity of the water and I combined it with the background of something that Mini and I had seen out while we were shooting. And that\'s called a \"composite photograph\".',	'0.46',	'0.34',	'1',	'0',	'0',	'42b0cced9b6dcd601b8d0d2f3028c3229b3238ac'),
(532,	29,	2,	'image',	'1401761280',	NULL,	'Karolina Kurkova for ROLEX',	'',	'0',	NULL,	'russell_james1402994096.m4a',	'',	'',	'',	'',	'russell_james1402994096.mp4',	NULL,	NULL,	'256',	'175.25',	'russell_james1402994056.jpg',	'512',	'350.5',	'russell_james1402994056.jpg',	'2048',	'1402',	'russell_james1402994056.jpg',	'2048',	'1402',	'russell_james1402994056.jpg',	'1024',	'701',	'russell_james1402994056.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfAV2U',	'This photograph of Karolina Kurkova, where she\'s small in the frame and there\'s a lot of water around her, is an example of a place that really has great qualities to shoot underwater. What you\'re looking for when you\'re shooting underwater is not to be too close to shore where the sand is stirred up. The deeper water that you\'re in, the less likely you are to have any particles floating in the water which causes a lot of problems. Another issue is to have a wide lens. In underwater photography, I generally break all the rules that I do in daylight photography / normal photography. I use a wide lens on the model so that I have the minimal amount of water between me and my subject. I shoot when the sun is between 10 o\'clock and 2 o\'clock which is directly overhead - which generally breaks the rules of photography - you want low light, morning or evening. And this photograph of Karolina - literally she\'s jumped in from the surface, has taken this incredible pose, and I\'ve been sitting with my tanks underwater, closer to her than it actually looks in the photograph because of the wide lens, and snapped the shot in relatively clear water.',	'0.77',	'0.31',	'1',	'0',	'0',	'8b2cc229a7b73fe8be4a737e872363bd6f6e942e'),
(533,	29,	2,	'image',	'1401762000',	NULL,	'Noot Seear for ROLEX',	'',	'0',	NULL,	'russell_james1402994227.m4a',	'',	'',	'',	'',	'russell_james1402994226.mp4',	NULL,	NULL,	'256',	'332.67005076142',	'russell_james1402994149.jpg',	'512',	'665.34010152284',	'russell_james1402994149.jpg',	'1576',	'2048',	'russell_james1402994149.jpg',	'1576',	'2048',	'russell_james1402994149.jpg',	'1024',	'1330.6802030457',	'russell_james1402994149.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TgNDW',	'This photograph of a model called Noot, down on a rock, was by far the most difficult photograph of this production. Noot had this extraordinary quality. It\'s very unusual with people and underwater. They can train and train and train, but you just don\'t know who\'s going to be good at going down deep, equalizing their ears, and not have the fear. The rock that Noot is standing on, and the reason it looks a lot bluer and darker than the other photographs, is the depth of the water is about 60 feet, about 20 meters. That is very, very deep water. There is no way to get to the surface. So we\'re taking her down, on a regulator so she\'s breathing, putting her in position. Then she\'s watching me with a mask, I\'m telling her \"We\'re okay, I\'m going to shoot\". And then the divers have to clear the frame. So if you can imagine being in 60 feet of water in the open ocean, fully weighted with lead on your legs so you don\'t float, in a very heavy dress, and you\'re supposed to look beautiful, and not panic, and rely that someone\'s going to swim in and give you air when you need it? That\'s quite a feat. And I think that Noot just pulled it off fantastically.',	'0.52',	'0.42',	'1',	'0',	'0',	'858e361f637d7e6646dbddcbcc5e2125c40d9779'),
(534,	29,	2,	'image',	'1401762600',	NULL,	'ROLEX campaign: Tips and tricks for underwater photography',	'',	'0',	NULL,	'russell_james1402994333.m4a',	'',	'',	'',	'',	'russell_james1402994333.mp4',	NULL,	NULL,	'256',	'192.25',	'russell_james1402994264.jpg',	'512',	'384.5',	'russell_james1402994264.jpg',	'2048',	'1538',	'russell_james1402994264.jpg',	'2048',	'1538',	'russell_james1402994264.jpg',	'1024',	'769',	'russell_james1402994264.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TfLId',	'In this \"Behind the Scenes\" shot, you\'ll notice that there is a line, a piece of rope through the water, and the model has her foot interlaced into the line. That is tricky, it\'s not a simple trick. Divers have to go in very deep, we\'re in deep water, and put lines up and then across, so that the model has something to brace on so that she does automatically float straight back up to the top. The fish that you see swimming around didn\'t just come there because they like us and like the models. We actually use peas. Peas I found to be very effective for two reasons. One, the fish just seem to love them, we get frozen peas and put them in the water. Two, the fish just go through the water and there\'s no mush left, they just eat them up, they just gobble them up in one hit. So I\'m left with these beautiful fish that have come for the food. I\'m left with a model that can stay in position on the rope. And in post-production, I just have to use Photoshop to take out the rope so you don\'t see the rope. A little trick is given away.',	'0.23',	'0.49',	'1',	'0',	'0',	'3ce020b8e721e879002a77d0783bf57515cd0c85'),
(535,	29,	2,	'image',	'1401763200',	NULL,	'ROLEX campaign: Behind the scenes with Alessandra Ambrósio',	'',	'0',	NULL,	'russell_james1402994429.m4a',	'',	'',	'',	'',	'russell_james1402994429.mp4',	NULL,	NULL,	'256',	'385.50588235294',	'russell_james1402994366.jpg',	'512',	'771.01176470588',	'russell_james1402994366.jpg',	'1360',	'2048',	'russell_james1402994366.jpg',	'1360',	'2048',	'russell_james1402994366.jpg',	'1024',	'1542.0235294118',	'russell_james1402994366.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfAUMq',	'Part of the Rolex campaign is the \"Behind the Scenes\". It\'s almost - maybe it is - as interesting as the actual campaign itself!? In this particular photograph of me photographing Alessandra, what you don\'t see is the amount of support divers and team that it takes to get you in position, but it\'s a great perspective of trying to understand what the model is going through.?I\'m there all comfortable in my wetsuit, with my mask on, actually even with a device where I can talk and speak to the divers around me. I\'m weighted on the floor. I have to get my divers all not moving so there is no sand kicking up. But Alessandra has to float very close to a reef where she could get scratched. I\'m also an environmentalist, and I don\'t want to break or damage the reef. And here she is in a dress, and trying to look gorgeous, and I think this shot shows the perspective that I see and what she is going through in the struggle to hold it all together so that we can make the photograph.',	'0.24',	'0.3',	'1',	'0',	'0',	'ed55f2971e4ca63cbb14bc8d7fddb0811a2717a6'),
(536,	29,	2,	'image',	'1401764280',	NULL,	'ROLEX campaign: The incredibly talented crew behind the scenes',	'',	'0',	NULL,	'russell_james1402994718.m4a',	'',	'',	'',	'',	'russell_james1402994718.mp4',	NULL,	NULL,	'256',	'385.50588235294',	'russell_james1402994594.jpg',	'512',	'771.01176470588',	'russell_james1402994594.jpg',	'1360',	'2048',	'russell_james1402994594.jpg',	'1360',	'2048',	'russell_james1402994594.jpg',	'1024',	'1542.0235294118',	'russell_james1402994594.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TgDwy',	'This photograph is of one of our team free diving under our boat. The reason I want to include it is a lot of the divers that I use on my underwater team, they\'re not people - they\'re fish, they\'re something else. A lot can dive down 50 - 60 feet on a breath hold - I\'ve worked with divers that can stay down 3 minutes on a breath hold AND work! The great advantage of that, without them having gear and having to have equipment, is: (1) they can go up and down all day - they\'re not subject to any of the limitations of \"the bends\" as it\'s known in diving; and (2) they don\'t create any bubbles, because when someone is going up and down with the gear, I\'ve got bubbles going everywhere throughout my shot and I can\'t shoot while I have bubbles. So as many free divers as I can get the better. So I often have people that can swim down, put something in place, work with the girl\'s dress, put her leg back in place, put the dress down, get her hair sorted, then swim out of the frame and stay still while I shoot, and then go back in, help the talent, make sure that she gets her air, and then go back to the surface. That\'s a whole lot of stuff to happen on one breath hold. I have a lot of respect for the free divers of the world.',	'0.4',	'0.58',	'1',	'0',	'0',	'01a3dfff5af6440d58b79a3413757e1e0614b2c0'),
(537,	29,	2,	'image',	'1401764400',	NULL,	'ROLEX campaign: Navigating new dimensions in underwater photography',	'',	'0',	NULL,	'russell_james1402994808.m4a',	'',	'',	'',	'',	'russell_james1402994807.mp4',	NULL,	NULL,	'256',	'385.50588235294',	'russell_james1402994746.jpg',	'512',	'771.01176470588',	'russell_james1402994746.jpg',	'1360',	'2048',	'russell_james1402994746.jpg',	'1360',	'2048',	'russell_james1402994746.jpg',	'1024',	'1542.0235294118',	'russell_james1402994746.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfC9eg',	'It\'s so hard to describe just how very hard it is having that extra dimension of a plane of movement. In normal photography, I have a stationary plane. Someone stands here, I stand here, camera can be here, it\'s locked. In water, suddenly everything is liquefied, it\'s like floating in the air. I can be shooting upside down, the model can float up this way... everything from having people conquer their fears from being underwater without a mask and a regulator, feeding them air so that you can take it away and they\'ll stand there and be confident, and wait for you to come and put it back in place... all the way through to the risks that are associated, and there are great risks. And I\'m a safety freak, so I have a very big safety team when I shoot underwater, and they work very hard for their money.',	'0.46',	'0.43',	'1',	'0',	'0',	'e53663d14b1331fbcb38f0cd60d4c0e6af7cbc3a'),
(538,	29,	2,	'video',	'1401765000',	NULL,	'',	'',	'0',	NULL,	'',	'russell_james1402994914.mp4',	'',	'',	'',	'russell_james1402994951.mp4',	NULL,	NULL,	'256',	'194.91689008043',	'russell_james1403007971.jpg',	'512',	'389.83378016086',	'russell_james1403007971.jpg',	'',	'',	'',	'',	'',	'',	'746',	'568',	'russell_james1403007971.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBg5x',	'',	'0.5',	'0.26',	'1',	'0',	'0',	'8e38f2727fc2cbeb33f423bc7e6c60dde840e155'),
(539,	29,	2,	'image',	'1401768000',	NULL,	'Casting for Cuba: Noot Seear',	'',	'0',	NULL,	'russell_james1402995222.m4a',	'',	'',	'',	'',	'russell_james1402995222.mp4',	NULL,	NULL,	'256',	'319.68780487805',	'russell_james1402995068.jpg',	'512',	'639.3756097561',	'russell_james1402995068.jpg',	'1640',	'2048',	'russell_james1402995068.jpg',	'1640',	'2048',	'russell_james1402995068.jpg',	'1024',	'1278.7512195122',	'russell_james1402995068.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22Tgt8r',	'The model in this story is Noot, and I photographed Noot because she just had so much - I don\'t know what to say - when she walked into the room when I cast her in New York, just this \"thing\", this kind of mystery to her look, to her feel. And when I thought of Cuba, and I thought of Noot as a mix, it was a \"no brainer\" for me. And this particular photograph of Noot, it\'s nothing more than a darkened room, and her looking at the camera, and she just oozed the emotion that I wanted to create with this story.',	'0.3',	'0.18',	'1',	'0',	'0',	'88ab8abbc96dab440e1d33f500a025f5e607c240'),
(540,	29,	2,	'image',	'1401768300',	NULL,	'Sensual, cool, unique – that’s Nicole Trunfio (and her jewelry designs) for you!',	'',	'0',	NULL,	'russell_james1402995407.m4a',	'',	'',	'',	'',	'russell_james1402995407.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402995282.jpg',	'512',	'766.50292397661',	'russell_james1402995282.jpg',	'1368',	'2048',	'russell_james1402995282.jpg',	'1368',	'2048',	'russell_james1402995282.jpg',	'1024',	'1533.0058479532',	'russell_james1402995282.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/22TfUeQ',	'What’s that in Nicole’s mouth? That is actually a ring from her own collection. Nicole is from Perth, Western Australia; this overall photo shoot was for Western Australian fashion; and it so happens that Nicole is a very talented jewelry designer and she had her own ring on that is sold commercially. So I asked her, “I want to see the ring”. And she put it in her mouth, and I just thought it touched on everything - it was sensual, it was cool, it was unique, and the photograph made it.',	'0.34',	'0.27',	'1',	'0',	'0',	'eda6d88b23adfce94e099da1934171407aff87c0'),
(541,	29,	2,	'image',	'1401771600',	NULL,	'Setting the tone: Beautiful blues',	'',	'1',	NULL,	'russell_james1402995620.m4a',	'',	'',	'',	'',	'russell_james1402995620.mp4',	NULL,	NULL,	'256',	'383.2514619883',	'russell_james1402995559.jpg',	'512',	'766.50292397661',	'russell_james1402995559.jpg',	'1368',	'2048',	'russell_james1402995559.jpg',	'1368',	'2048',	'russell_james1402995559.jpg',	'1024',	'1533.0058479532',	'russell_james1402995559.jpg',	'',	NULL,	NULL,	NULL,	NULL,	'',	'',	'http://j.mp/1YfAXaN',	'This first photograph for the Urban Zen Collection - really you see so little of the collection, it’s just that you get the sense of the blue. The young lady’s looking down, her eyes are closed, it’s very quiet and very peaceful and beautiful - and the very fact that she’s bald adds a very special element to that photograph for me. And it was really the textures of the clothes, but it also set the tone for what the whole shoot would be.',	'0.51',	'0.43',	'1',	'0',	'0',	'3936e25bb8ebd39f5fdcc621e7e19c96cbe27c51'),
