(1117,	140,	47,	'image',	'1408485985',	NULL,	'',	'Last night at #ThankYouFestival I had my picture taken with these two incredible men who are making a huge difference in the world. On the left is Hugh Evans from @glblctzn and on the right is Dr. Rajiv Shah from @usaidgram. Hugh put together last night’s show with a goal of increasing awareness about the fight for child survival. As a result of this show, Dr. Shah came on stage to celebrate a $2.9 billion commitment from the US government to end preventable child deaths. Thank you to everyone who came to the show last night and supported the cause. With your help we have just taken a huge step forward. #childhood #globalcitizen #globalpovertyproject',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'241.72972972973',	'1408485972.png',	'512',	'483.45945945946',	'1408485972.png',	'592',	'559',	'1408485972.png',	'592',	'559',	'1408485972.png',	'592',	'559',	'1408485972.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MWrl0',	'Last night at #ThankYouFestival I had my picture taken with these two incredible men who are making a huge difference in the world. On the left is Hugh Evans from @glblctzn and on the right is Dr. Rajiv Shah from @usaidgram. Hugh put together last night’s show with a goal of increasing awareness about the fight for child survival. As a result of this show, Dr. Shah came on stage to celebrate a $2.9 billion commitment from the US government to end preventable child deaths. Thank you to everyone who came to the show last night and supported the cause. With your help we have just taken a huge step forward. #childhood #globalcitizen #globalpovertyproject',	'0.61',	'0.29',	'1',	'0',	'0',	'7bfb8a127427ba2912d960e18eccd574ddb86096'),
