(1341,	186,	57,	'image',	'1409159001',	NULL,	'Linkin Park Carnivores Tour: Volunteer Opportunities',	'Music for Relief is seeking enthusiastic volunteers to help at the MFR booth at each of the Carnivores Tour concerts across the US. If you are 17 years or older and can be at the venue at least 90 minutes prior to doors opening and would like to volunteer, please email volunteercoordinator@musicforrelief.org with your name, age, mobile number and why you would be a great MFR representative at the shows. Volunteers do not need a ticket to the show, however they must provide their own transportation, parking and food at the venue.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'191.8905982906',	'1409158958.jpg',	'512',	'383.7811965812',	'1409158958.jpg',	'1170',	'877',	'1409158958.jpg',	'1170',	'877',	'1409158958.jpg',	'1024',	'767.56239316239',	'1409158958.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Pi3aGH',	'Music for Relief is seeking enthusiastic volunteers to help at the MFR booth at each of the Carnivores Tour concerts across the US. If you are 17 years or older and can be at the venue at least 90 minutes prior to doors opening and would like to volunteer, please email volunteercoordinator@musicforrelief.org with your name, age, mobile number and why you would be a great MFR representative at the shows. Volunteers do not need a ticket to the show, however they must provide their own transportation, parking and food at the venue.',	'0.46',	'0.8',	'1',	'0',	'0',	'2f0327f13b07ab0d15d07ae05c9b4f358ab5ae2a'),
(1342,	186,	57,	'image',	'1409159307',	NULL,	'Power the World',	'1.3 billion people in the world lack access to electricity. This staggering fact ignited Linkin Park’s interest in helping to find solutions. In support of UN Secretary-General Ban Ki Moon’s Sustainable Energy for All Initiative, Linkin Park has pledged to Power the World by helping raise awareness about energy access, highlighting solutions and providing clean energy tools.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'257.6',	'1409159289.jpg',	'512',	'515.2',	'1409159289.jpg',	'640',	'644',	'1409159289.jpg',	'640',	'644',	'1409159289.jpg',	'640',	'644',	'1409159289.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Pi2XDr',	'1.3 billion people in the world lack access to electricity. This staggering fact ignited Linkin Park’s interest in helping to find solutions. In support of UN Secretary-General Ban Ki Moon’s Sustainable Energy for All Initiative, Linkin Park has pledged to Power the World by helping raise awareness about energy access, highlighting solutions and providing clean energy tools.',	'0.29',	'0.44',	'1',	'0',	'0',	'ca41e82de4ff03e99a65b0d76ea7a6556723fbfc'),
(1343,	186,	57,	'image',	'1409159404',	NULL,	'Concert for the Philippines',	'After Typhoon Haiyan struck in November 2013, Music for Relief responded immediately to raise funds for those in need. We created a Typhoon Haiyan Bracelet for supporters who donated $25 or more to the cause. Artist partner, Steve Aoki pledged to match donations up to $36,000 in honor of his 36th birthday.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'169.46478873239',	'1409159370.jpg',	'512',	'338.92957746479',	'1409159370.jpg',	'639',	'423',	'1409159370.jpg',	'639',	'423',	'1409159370.jpg',	'639',	'423',	'1409159370.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Pi3rtg',	'After Typhoon Haiyan struck in November 2013, Music for Relief responded immediately to raise funds for those in need. We created a Typhoon Haiyan Bracelet for supporters who donated $25 or more to the cause. Artist partner, Steve Aoki pledged to match donations up to $36,000 in honor of his 36th birthday.',	'0.59',	'0.3',	'1',	'0',	'0',	'96e7ae63d4669de396ac0e129881c0b564c90fad'),
(1344,	186,	57,	'image',	'1409159556',	NULL,	'Balkans Flood Relief',	'In May 2014 the Balkans were hit with severe floods affecting over 1 million people. In Bosnia alone, approximately 500 homes have been destroyed and 75,000 people have been displaced.\r\n\r\nIn partnership with International Medical Corps, Music for Relief took immediate action to raise funds for food as well as clean water and sanitation support, with an emphasis on disease prevention. Make a donation here and use #SupportTheBalkans to raise awareness.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.64228571429',	'1409159534.jpg',	'512',	'341.28457142857',	'1409159534.jpg',	'3500',	'2333',	'1409159534.jpg',	'2048',	'1365.1382857143',	'1409159534.jpg',	'1024',	'682.56914285714',	'1409159534.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Pi3JjS',	'In May 2014 the Balkans were hit with severe floods affecting over 1 million people. In Bosnia alone, approximately 500 homes have been destroyed and 75,000 people have been displaced.\r\n\r\nIn partnership with International Medical Corps, Music for Relief took immediate action to raise funds for food as well as clean water and sanitation support, with an emphasis on disease prevention. Make a donation here and use #SupportTheBalkans to raise awareness.',	'0.43',	'0.51',	'1',	'0',	'0',	'9452e6e69ffbb40b0186b3bbd6fab2819a03f418'),
(1345,	186,	57,	'image',	'1409159610',	NULL,	'Our Story',	'Music for Relief was founded by the band Linkin Park in response to the 2004 Indian Ocean tsunami. Since inception in 2005 Music for Relief has raised over $6 million for survivors of multiple disasters across four continents including Hurricane Katrina, China’s Wenchuan earthquake, a cholera outbreak in Zimbabwe, earthquakes in Haiti and Japan in 2010 and Typhoon Haiyan in the Philippines.\r\n\r\nMFR has organized benefit concerts, online auctions and events with multi-platinum musicians and celebrities to help rebuild and donate supplies to people in need. Music for Relief has also planted over 1 million trees to help reduce global warming.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'154',	'1409159579.jpg',	'512',	'308',	'1409159579.jpg',	'640',	'385',	'1409159579.jpg',	'640',	'385',	'1409159579.jpg',	'640',	'385',	'1409159579.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Pi32XQ',	'Music for Relief was founded by the band Linkin Park in response to the 2004 Indian Ocean tsunami. Since inception in 2005 Music for Relief has raised over $6 million for survivors of multiple disasters across four continents including Hurricane Katrina, China’s Wenchuan earthquake, a cholera outbreak in Zimbabwe, earthquakes in Haiti and Japan in 2010 and Typhoon Haiyan in the Philippines.\r\n\r\nMFR has organized benefit concerts, online auctions and events with multi-platinum musicians and celebrities to help rebuild and donate supplies to people in need. Music for Relief has also planted over 1 million trees to help reduce global warming.\r\n',	'0.46',	'0.65',	'1',	'0',	'0',	'1d5be97979fd0b5a2e5f9007dd93265f7656946f'),
