(1976,	312,	75,	'image',	'1412266234',	NULL,	'',	'You know we have to hook my newest class of Wheels for Ed kids up with school uniform shirts!!! And for my Class of 2021, entering into the Akron I PROMISE Network, we have something EXTRA special for you guys… I’m talking EXTRA, SUPER DUPER, OVER THE TOP special (special thank you to my secret partner). My motto is #EarnedNotGiven and it’s no different for my kids. Everything my kids receive is EARNED. My Wheels for Ed kids complete a two week tech camp and my Akron I PROMISE Network students will have two community service days.\r\n\r\nSpecial shout out to Two Men And A Truck/Akron for ALWAYS being there for my family and my kids. \r\n\r\nLeBron James Family Foundation #IPROMISE\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'177.6',	'1412266224.jpg',	'512',	'355.2',	'1412266224.jpg',	'960',	'666',	'1412266224.jpg',	'960',	'666',	'1412266224.jpg',	'960',	'666',	'1412266224.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/218UYyY',	'You know we have to hook my newest class of Wheels for Ed kids up with school uniform shirts!!! And for my Class of 2021, entering into the Akron I PROMISE Network, we have something EXTRA special for you guys… I’m talking EXTRA, SUPER DUPER, OVER THE TOP special (special thank you to my secret partner). My motto is #EarnedNotGiven and it’s no different for my kids. Everything my kids receive is EARNED. My Wheels for Ed kids complete a two week tech camp and my Akron I PROMISE Network students will have two community service days.\r\n\r\nSpecial shout out to Two Men And A Truck/Akron for ALWAYS being there for my family and my kids. \r\n\r\nLeBron James Family Foundation #IPROMISE\r\n',	'0.5',	'0.41',	'1',	'0',	'0',	'f3e812bd24c1c7c82e91592a3ce9e0291ab7849e'),
