(2070,	336,	78,	'image',	'1412278695',	NULL,	'BEYGOOD X STATE BAG DROPS',	'This summer STATE and #BeyGOOD hit the road with the goal of giving back to thousands of kids in underfunded communities across the east coast with the #BeyGOOD x STATE GIVEBACKPACK Program.\r\nSTATE and #BeyGOOD have successfully introduced children from Charlotte, Baltimore, Washington D.C, Philadelphia, Newark, and New York City to STATE’s signature high-energy, motivational bag drop rallies while simultaneously providing more than 2,000 students with new backpacks and supplies for the school year.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'219.367003367',	'1412278661.png',	'512',	'438.73400673401',	'1412278661.png',	'594',	'509',	'1412278661.png',	'594',	'509',	'1412278661.png',	'594',	'509',	'1412278661.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MWzRM',	'This summer STATE and #BeyGOOD hit the road with the goal of giving back to thousands of kids in underfunded communities across the east coast with the #BeyGOOD x STATE GIVEBACKPACK Program.\r\nSTATE and #BeyGOOD have successfully introduced children from Charlotte, Baltimore, Washington D.C, Philadelphia, Newark, and New York City to STATE’s signature high-energy, motivational bag drop rallies while simultaneously providing more than 2,000 students with new backpacks and supplies for the school year.',	'0.24',	'0.35',	'1',	'0',	'0',	'827e2801c14d822d7aecdebb33c0b6d4a812486d'),
(2071,	336,	78,	'image',	'1412278767',	NULL,	'CHIME FOR CHANGE + EMBRACE INNOVATIONS',	'To celebrate the first anniversary of CHIME FOR CHANGE, Beyoncé committed to a $500,000 donation to fund four projects for girls and women in the areas of Education, Health and Justice. Amongst them was Embrace Innovations, an organization founded by Jane Chen that designs and distributes infant warmers, a low-cost alternative to the incubator that resembles a tiny sleeping bag.\r\n\r\nThe donation will fund pilot testing of the device in Ethiopia, Ghana, Kenya, Malawi, Mali, Nigeria, Rwanda, Senegal, Tanzania and Uganda, and could help 1,900 underweight babies who, without it, might not live.\r\n\r\nRead more about the Embrace Innovations innitative and their life saving efforts on the Ted Blog. \r\n\r\nFor more information about Embrace Innovations, visit their website, or  follow them on Twitter and Facebook.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.44897959184',	'1412278738.png',	'512',	'340.89795918367',	'1412278738.png',	'784',	'522',	'1412278738.png',	'784',	'522',	'1412278738.png',	'784',	'522',	'1412278738.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MWX2F',	'To celebrate the first anniversary of CHIME FOR CHANGE, Beyoncé committed to a $500,000 donation to fund four projects for girls and women in the areas of Education, Health and Justice. Amongst them was Embrace Innovations, an organization founded by Jane Chen that designs and distributes infant warmers, a low-cost alternative to the incubator that resembles a tiny sleeping bag.\r\n\r\nThe donation will fund pilot testing of the device in Ethiopia, Ghana, Kenya, Malawi, Mali, Nigeria, Rwanda, Senegal, Tanzania and Uganda, and could help 1,900 underweight babies who, without it, might not live.\r\n\r\nRead more about the Embrace Innovations innitative and their life saving efforts on the Ted Blog. \r\n\r\nFor more information about Embrace Innovations, visit their website, or  follow them on Twitter and Facebook.',	'0.17',	'0.18',	'1',	'0',	'0',	'7ab6aa76c8f6b277eeb4bb4cf0ab8d13427db824'),
(2072,	336,	78,	'image',	'1412278861',	NULL,	'MAKE-A-WISH',	'Make-A-Wish grants the wish of a child diagnosed with a life-threatening medical condition in the United States and its territories, on average, every 38 minutes.\r\n\r\nBeyGood and Make-A-Wish believe that fulfilling wishes can be a game-changer for a child with a life-threatening medical condition and strive to fulfill as many wishes as possible for children who dream of meeting Beyoncé.\r\n\r\nDuring the Mrs. Carter Show 2013 World Tour, 18 wishes were granted. The children and their family were met by VIP staff, met with Beyoncé where they are given a personally autographed photo and escorted to the most amazing seats in the BeyStage to enjoy the show up close and personal.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'167.08396946565',	'1412278835.png',	'512',	'334.1679389313',	'1412278835.png',	'786',	'513',	'1412278835.png',	'786',	'513',	'1412278835.png',	'786',	'513',	'1412278835.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXeCL',	'Make-A-Wish grants the wish of a child diagnosed with a life-threatening medical condition in the United States and its territories, on average, every 38 minutes.\r\n\r\nBeyGood and Make-A-Wish believe that fulfilling wishes can be a game-changer for a child with a life-threatening medical condition and strive to fulfill as many wishes as possible for children who dream of meeting Beyoncé.\r\n\r\nDuring the Mrs. Carter Show 2013 World Tour, 18 wishes were granted. The children and their family were met by VIP staff, met with Beyoncé where they are given a personally autographed photo and escorted to the most amazing seats in the BeyStage to enjoy the show up close and personal.',	'0.39',	'0.15',	'1',	'0',	'0',	'0ed5ff00f2bd46c84cb7e11231602447e86d7108'),
(2073,	336,	78,	'image',	'1412279017',	NULL,	'CUFA',	'Central Única das Favelas (CUFA) organizes and promotes education and cultural awareness in the ghettos of Fortaleza, Brazil. CUFA seeks to contribute to the human development of the youth, offering new perspectives of social inclusion.\r\n\r\nThey receive support through activities promoting education, sports, culture, citizenship and environment. On September 8, 2013 the students and teachers of CUFA met the Mrs. Carter Show band and dancers before meeting Beyoncé herself. They were then given up close and personal seats in the BeyStage where they enjoyed the show.\r\n\r\nCUFA will be featured in the Chime for Change program for 2014 project funding.\r\n\r\nFor more info on CUFA, please visit http://cufa.org.br/cufae',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.7750952986',	'1412278998.png',	'512',	'341.5501905972',	'1412278998.png',	'787',	'525',	'1412278998.png',	'787',	'525',	'1412278998.png',	'787',	'525',	'1412278998.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXVvy',	'Central Única das Favelas (CUFA) organizes and promotes education and cultural awareness in the ghettos of Fortaleza, Brazil. CUFA seeks to contribute to the human development of the youth, offering new perspectives of social inclusion.\r\n\r\nThey receive support through activities promoting education, sports, culture, citizenship and environment. On September 8, 2013 the students and teachers of CUFA met the Mrs. Carter Show band and dancers before meeting Beyoncé herself. They were then given up close and personal seats in the BeyStage where they enjoyed the show.\r\n\r\nCUFA will be featured in the Chime for Change program for 2014 project funding.\r\n\r\nFor more info on CUFA, please visit http://cufa.org.br/cufae',	'0.45',	'0.19',	'1',	'0',	'0',	'93f57951fd34d240be82050b6e3f0c26a915c8d9'),
(2074,	336,	78,	'image',	'1412279127',	NULL,	'GIRL UP, UNITED NATIONS FOUNDATION',	'There are more than 600 million adolescent girls living in developing countries today. These girls are bright, talented and full of dreams, but are often unable to reach their full potential.\r\n\r\nMany of them struggle for the opportunity to go to school, see a doctor or be included in their communities. This has serious consequences including: low levels of enrollment in school, high levels of child marriage and way too many girls facing health risks from pregnancy and early child birth.\r\n\r\nGirl Up believes that American girls are a part of the solution. We know that girls give, girls talk and girls get involved. This generation of girls cares about global issues and is concerned about the challenges facing other girls around the world. For more information, visit Girl Up.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.4498094028',	'1412279109.png',	'512',	'340.89961880559',	'1412279109.png',	'787',	'524',	'1412279109.png',	'787',	'524',	'1412279109.png',	'787',	'524',	'1412279109.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXWzC',	'There are more than 600 million adolescent girls living in developing countries today. These girls are bright, talented and full of dreams, but are often unable to reach their full potential.\r\n\r\nMany of them struggle for the opportunity to go to school, see a doctor or be included in their communities. This has serious consequences including: low levels of enrollment in school, high levels of child marriage and way too many girls facing health risks from pregnancy and early child birth.\r\n\r\nGirl Up believes that American girls are a part of the solution. We know that girls give, girls talk and girls get involved. This generation of girls cares about global issues and is concerned about the challenges facing other girls around the world. For more information, visit Girl Up.',	'0.42',	'0.38',	'1',	'0',	'0',	'f9397e38a42b4148bafcc55b1cef61022404accf'),
(2075,	336,	78,	'image',	'1412279243',	NULL,	'LIFE STANDARD',	'Life Standard is an initiative that supports children of orphanages in Monterrey, Mexico. Their mission is to remodel their self-esteem in order to prepare them for success in society by helping the youth discover their true potential, through education, arts and socialization.\r\n\r\nThis group of children met the Mrs. Carter Show band and dancers before meeting Beyoncé herself, where they paused to give Beyoncé prayers of blessings. They were then escorted to the BeyStage where they experienced the Mrs. Carter Show up close and personal.\r\n\r\nFor more about Life Standard, please visit http://www.familycare.org/network/lifestandard/\r\n\r\nWATCH #BEYGOOD IN LATIN AMERICA',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'168.80921895006',	'1412279224.png',	'512',	'337.61843790013',	'1412279224.png',	'781',	'515',	'1412279224.png',	'781',	'515',	'1412279224.png',	'781',	'515',	'1412279224.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXDou',	'Life Standard is an initiative that supports children of orphanages in Monterrey, Mexico. Their mission is to remodel their self-esteem in order to prepare them for success in society by helping the youth discover their true potential, through education, arts and socialization.\r\n\r\nThis group of children met the Mrs. Carter Show band and dancers before meeting Beyoncé herself, where they paused to give Beyoncé prayers of blessings. They were then escorted to the BeyStage where they experienced the Mrs. Carter Show up close and personal.\r\n\r\nFor more about Life Standard, please visit http://www.familycare.org/network/lifestandard/\r\n\r\nWATCH #BEYGOOD IN LATIN AMERICA',	'0.16',	'0.28',	'1',	'0',	'0',	'e034e62073e91b759e29f1c115a4a0d965f1b639'),
