(2389,	393,	86,	'image',	'1413318671',	NULL,	'PAINT IT BLACK ',	'When I was working on the Paint it Black poster concept I tried several approaches, as I do with every poster, but instead of only one successful direction, I felt I found two solutions for Paint it Black. Both versions are inspired by the Rolling Stones song, but the first version was fashioned more after a vintage newspaper ad, while the Paint it Black Hand has a bit more of a propaganda feel. Regardless, they are both about oil dictating too much of our energy policy and our foreign policy. Imagine if all the money spent on wars and strategic interests in the Middle East had been spent on developing green energy alternatives. Instead, our government subsidizes the highly profitable oil and gas industries for $40 billion a year because no politician wants a rise in the price of gas to be blamed on them. Newsflash: we are still paying more for gas whether it’s at the pump or through our taxes. The need for gas will remain, but we need to invest in sustainable energy alternatives as we transition off of the finite supply of fossil fuels that are also terrible for CO2 emissions. Proceeds from this print will go to the NRDC to support their efforts to shape responsible environmental policy. Thanks for caring.\r\n\r\n-Shepard',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'340.48',	'1413318639.jpg',	'500',	'665',	'1413318639.jpg',	'500',	'665',	'1413318639.jpg',	'500',	'665',	'1413318639.jpg',	'500',	'665',	'1413318639.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MX0eJ',	'When I was working on the Paint it Black poster concept I tried several approaches, as I do with every poster, but instead of only one successful direction, I felt I found two solutions for Paint it Black. Both versions are inspired by the Rolling Stones song, but the first version was fashioned more after a vintage newspaper ad, while the Paint it Black Hand has a bit more of a propaganda feel. Regardless, they are both about oil dictating too much of our energy policy and our foreign policy. Imagine if all the money spent on wars and strategic interests in the Middle East had been spent on developing green energy alternatives. Instead, our government subsidizes the highly profitable oil and gas industries for $40 billion a year because no politician wants a rise in the price of gas to be blamed on them. Newsflash: we are still paying more for gas whether it’s at the pump or through our taxes. The need for gas will remain, but we need to invest in sustainable energy alternatives as we transition off of the finite supply of fossil fuels that are also terrible for CO2 emissions. Proceeds from this print will go to the NRDC to support their efforts to shape responsible environmental policy. Thanks for caring.\r\n\r\n-Shepard',	'0.52',	'0.17',	'1',	'0',	'0',	'd8015e08dad8917a08bce07c30ac540c2a04a967'),
(2390,	393,	86,	'image',	'1413318740',	NULL,	'THIS NEW WAVE IS A LITTLE SLICK FOR MY TASTE',	'I enjoy doing illustrations of water with its  hypnotic ripples and reflections. There’s oil in this water, which mixes ok in an illustration, but not so well in real life. I want future generations to inhabit a livable planet, so I will be donating a portion of the proceeds from this print to the NRDC Natural Resources Defense Council. They are concerned with changing policy to achieve environmental and energy solutions, not just putting a band-aid on existing problems. \r\n-Shepard\r\n\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'191.488',	'1413318709.jpg',	'500',	'374',	'1413318709.jpg',	'500',	'374',	'1413318709.jpg',	'500',	'374',	'1413318709.jpg',	'500',	'374',	'1413318709.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MWNIC',	'I enjoy doing illustrations of water with its  hypnotic ripples and reflections. There’s oil in this water, which mixes ok in an illustration, but not so well in real life. I want future generations to inhabit a livable planet, so I will be donating a portion of the proceeds from this print to the NRDC Natural Resources Defense Council. They are concerned with changing policy to achieve environmental and energy solutions, not just putting a band-aid on existing problems. \r\n-Shepard\r\n\r\n',	'0.77',	'0.45',	'1',	'0',	'0',	'45991302861fe1890ea4986a9dac7039f8381cb4'),
