(2392,	393,	86,	'image',	'1413318891',	NULL,	'BNE X SHEPARD FAIREY',	'I first encountered BNE’s work through his graffiti in San Francisco in the late 90’s. At that time he was up huge in some daring spots. A few years later I started seeing a massive number of his stickers in cities around the USA, Europe, and Asia. I was, and am, incredibly impressed by his proliferation of his stickers, if for no other reason than his work is proof that one person has the power to literally change the landscape of many cities! I think BNE may be the most “up” sticker bomber on the planet. Whether or not you appreciate or hate graffiti/street art, it requires tenacity and risk taking. It is easy for me to recognize guts, passion, and dedication in BNE, and unlike most graffiti artists, he is not using his notoriety solely for personal glory, but has put his infamy toward a very worthwhile cause… clean water. The print we have collaborated on benefits CharityWater.org… A NYC based NPO that has helped over 3.1 million people get access to clean, safe drinking water. They are radically transparent and use 100% of donations for actual water project costs.\r\n\r\nBNE shot the photo I illustrated from in Indonesia and he and I have both signed all of the prints. The print is $60 and comes with four BNE lip balms worth $16 and two BNE stickers (priceless). All profits go to CharityWater.org\r\n\r\nBNE started with water as his cause, but is expanding to produce organic and environmentally responsible products that raise funds + awareness for the world’s greatest charities.\r\n\r\nThanks for caring!\r\n-Shepard Fairey',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'340.992',	'1413318821.jpg',	'500',	'666',	'1413318821.jpg',	'500',	'666',	'1413318821.jpg',	'500',	'666',	'1413318821.jpg',	'500',	'666',	'1413318821.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TivWb',	'I first encountered BNE’s work through his graffiti in San Francisco in the late 90’s. At that time he was up huge in some daring spots. A few years later I started seeing a massive number of his stickers in cities around the USA, Europe, and Asia. I was, and am, incredibly impressed by his proliferation of his stickers, if for no other reason than his work is proof that one person has the power to literally change the landscape of many cities! I think BNE may be the most “up” sticker bomber on the planet. Whether or not you appreciate or hate graffiti/street art, it requires tenacity and risk taking. It is easy for me to recognize guts, passion, and dedication in BNE, and unlike most graffiti artists, he is not using his notoriety solely for personal glory, but has put his infamy toward a very worthwhile cause… clean water. The print we have collaborated on benefits CharityWater.org… A NYC based NPO that has helped over 3.1 million people get access to clean, safe drinking water. They are radically transparent and use 100% of donations for actual water project costs.\r\n\r\nBNE shot the photo I illustrated from in Indonesia and he and I have both signed all of the prints. The print is $60 and comes with four BNE lip balms worth $16 and two BNE stickers (priceless). All profits go to CharityWater.org\r\n\r\nBNE started with water as his cause, but is expanding to produce organic and environmentally responsible products that raise funds + awareness for the world’s greatest charities.\r\n\r\nThanks for caring!\r\n-Shepard Fairey',	'0.49',	'0.18',	'1',	'0',	'0',	'8a4b9b52f1b58ac70e63e650d9d03adcf5b7cd19'),
