(2417,	397,	86,	'image',	'1413320595',	NULL,	'THE MEDIUM IS THE MASSAGE',	'The Medium is the Massage is Marshall McLuhan’s most condensed, and perhaps most effective, presentation of his ideas. Using a layout style that was later copied by Wired, McLuhan and coauthor/designer Quentin Fiore combine word and image to illustrate and enact the ideas that were first put forward in the dense and poorly organized Understanding Media. McLuhan’s ideas about the nature of media, the increasing speed of communication, and the technological basis for our understanding of who we are come to life in this slender volume. Although originally printed in 1967, the art and style in The Medium is the Massage seem as fresh today as in the summer of love, and the ideas are even more resonant now that computer interfaces are becoming gateways to the global village.  Cover design by Shepard Fairey.\r\n\r\nSigned copies available for $20 while supplies last.  SOLD OUT',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'419.84',	'1413320574.jpg',	'500',	'820',	'1413320574.jpg',	'500',	'820',	'1413320574.jpg',	'500',	'820',	'1413320574.jpg',	'500',	'820',	'1413320574.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TiFg0',	'The Medium is the Massage is Marshall McLuhan’s most condensed, and perhaps most effective, presentation of his ideas. Using a layout style that was later copied by Wired, McLuhan and coauthor/designer Quentin Fiore combine word and image to illustrate and enact the ideas that were first put forward in the dense and poorly organized Understanding Media. McLuhan’s ideas about the nature of media, the increasing speed of communication, and the technological basis for our understanding of who we are come to life in this slender volume. Although originally printed in 1967, the art and style in The Medium is the Massage seem as fresh today as in the summer of love, and the ideas are even more resonant now that computer interfaces are becoming gateways to the global village.  Cover design by Shepard Fairey.\r\n\r\nSigned copies available for $20 while supplies last.  SOLD OUT',	'0.46',	'0.5',	'1',	'0',	'0',	'0a705f18e5429083b945c4822919e1eafd4ed116'),
(2418,	397,	86,	'image',	'1413320637',	NULL,	'HOT WHEELS :: PETERSEN MUSEUM',	'Automotive Museum and Hot Wheels to create this classic mini OBEY VW Bus. The Petersen Museum approached Shepard for his take on this custom ’60’s VW Microbus. He delivered this colorful and compelling design for a modern day hippie van – complete with the message of “PEACE”. The detail on this model is amazing! Limited Edition of 5000. Comes signed, once again, by Shepard. For the car collecting, wheat pasting, peace loving Posse Member.\r\n\r\nSOLD OUT',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'229.376',	'1413320617.jpg',	'500',	'448',	'1413320617.jpg',	'500',	'448',	'1413320617.jpg',	'500',	'448',	'1413320617.jpg',	'500',	'448',	'1413320617.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TiHoa',	'Automotive Museum and Hot Wheels to create this classic mini OBEY VW Bus. The Petersen Museum approached Shepard for his take on this custom ’60’s VW Microbus. He delivered this colorful and compelling design for a modern day hippie van – complete with the message of “PEACE”. The detail on this model is amazing! Limited Edition of 5000. Comes signed, once again, by Shepard. For the car collecting, wheat pasting, peace loving Posse Member.\r\n\r\nSOLD OUT',	'0.52',	'0.21',	'1',	'0',	'0',	'a88a515c1472f8c65310b40712a941f5087ff588'),
