(2421,	398,	86,	'image',	'1413320991',	NULL,	'Printed Matters: Dallas',	'The Public Trust Presents\r\nPrinted Matters\r\nEditioned Works By Shepard Fairey\r\nSeptember 15-October 20, 2012\r\nOpening Reception: Saturday, September 15, 2012 (6-10 PM)\r\nThe artist will not be in attendance at the opening.\r\n\r\nABOUT THE EXHIBITION\r\nThe Public Trust is pleased to present Printed Matters, a solo exhibition featuring editioned work of renowned artist Shepard Fairey. Printed Matters, is a continuous series of exhibitions, which focuses on the importance of printed material in Fairey’s art. Each exhibition highlights this significance by incorporating a variety of Shepard’s printed material; including serigraphs on paper, editions on wood, editions on metal, and fine art collage; with new works added for each venue, making each Printed Matters exhibition a unique experience. Beginning in 2010, the Printed Matters platform was first presented in Los Angeles and for its next installment will exhibit in Dallas, Texas at The Public Trust and will be on view from September 15-October 20, 2012.\r\n\r\nShepard states, “I’m a product of the era of mass production and the mass culture it has created. I can’t imagine my art practice without the influence of, and the use of, printing. Some of my biggest art influences were not paintings, but printed things like album covers, skateboard graphics, punk flyers, and t-shirt designs. When I discovered stencil making and screen-printing in high school, I used them to make t-shirts and stickers, but by college I began to use screen-printing to make art. I enjoyed illustration, photography, collage, and graphic design separately, but with screen-printing I could synthesize those techniques into an integrated final product. Screen-printing also provided latitude for experimentation and the ability to make multiples, and my style began to evolve as I explored the graphic nature of the medium. I tried to make images that would translate well to screen-print production. A harmony of beauty, power, and utility was my goal.\r\n\r\nSome people say print is on its way out, that it will be wiped out by digital media, but I say you can never replace the provocative, tactile experience of an art print on the street or in a gallery. Printing still matters.”\r\n\r\nGallery Information\r\nThe Public Trust\r\n2919-C Commerce St. :: Dallas, TX 75226 :: 214.760.7170',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'368.128',	'1413320955.jpg',	'500',	'719',	'1413320955.jpg',	'500',	'719',	'1413320955.jpg',	'500',	'719',	'1413320955.jpg',	'500',	'719',	'1413320955.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TiaCI',	'The Public Trust Presents\r\nPrinted Matters\r\nEditioned Works By Shepard Fairey\r\nSeptember 15-October 20, 2012\r\nOpening Reception: Saturday, September 15, 2012 (6-10 PM)\r\nThe artist will not be in attendance at the opening.\r\n\r\nABOUT THE EXHIBITION\r\nThe Public Trust is pleased to present Printed Matters, a solo exhibition featuring editioned work of renowned artist Shepard Fairey. Printed Matters, is a continuous series of exhibitions, which focuses on the importance of printed material in Fairey’s art. Each exhibition highlights this significance by incorporating a variety of Shepard’s printed material; including serigraphs on paper, editions on wood, editions on metal, and fine art collage; with new works added for each venue, making each Printed Matters exhibition a unique experience. Beginning in 2010, the Printed Matters platform was first presented in Los Angeles and for its next installment will exhibit in Dallas, Texas at The Public Trust and will be on view from September 15-October 20, 2012.\r\n\r\nShepard states, “I’m a product of the era of mass production and the mass culture it has created. I can’t imagine my art practice without the influence of, and the use of, printing. Some of my biggest art influences were not paintings, but printed things like album covers, skateboard graphics, punk flyers, and t-shirt designs. When I discovered stencil making and screen-printing in high school, I used them to make t-shirts and stickers, but by college I began to use screen-printing to make art. I enjoyed illustration, photography, collage, and graphic design separately, but with screen-printing I could synthesize those techniques into an integrated final product. Screen-printing also provided latitude for experimentation and the ability to make multiples, and my style began to evolve as I explored the graphic nature of the medium. I tried to make images that would translate well to screen-print production. A harmony of beauty, power, and utility was my goal.\r\n\r\nSome people say print is on its way out, that it will be wiped out by digital media, but I say you can never replace the provocative, tactile experience of an art print on the street or in a gallery. Printing still matters.”\r\n\r\nGallery Information\r\nThe Public Trust\r\n2919-C Commerce St. :: Dallas, TX 75226 :: 214.760.7170',	'0.63',	'0.4',	'1',	'0',	'0',	'95df681532fce22d95a563afe640aad15badd7c2'),
(2422,	398,	86,	'image',	'1413321070',	NULL,	'Sound & Vision: London',	'StolenSpace Gallery Presents\r\n\r\nSOUND & VISION\r\nArtwork by Shepard Fairey\r\n\r\nOpening 10/19/2012\r\n10.19.12 – 11.04.12\r\n\r\nSTOLENSPACE GALLERY\r\nThe Old Truman Brewery\r\nDray Walk\r\n91 Brick Lane\r\nLondon E1 6QL\r\nUnited Kingdom\r\nstolenspace.com\r\n\r\nSound and Vision takes its name from the David Bowie song and “the gift of sound and vision” that he embodies. Bowie is one of my favorite musicians, and has crafted his music and visual presentation with equal brilliance. Music has long been an inspiration for me as a democratic medium that can bring joy but also deliver provocative and compelling social commentary. Sound and Vision not only captures the profound effect that my favorite music has had on me and my work, but even more broadly it represents the accessible and infectious nature of music as we all experience it.\r\n\r\nMusic has taught me far more than art has about connecting with an audience. I’ve often thought “I can’t get this song out of my head,” but rarely thought “I can’t get this painting out of my head.” I’ve had some very moving encounters with art in my life, especially in the street, but almost nothing can compare to the first time I heard the boots marching and first chord of the Sex Pistols’ Holidays in the Sun, or the air raid sirens leading into “too black, too strong” on the intro to Public Enemy’s It Takes A Nation of Millions to Hold Us Back, or the opening guitar scream of Black Flag’s Rise Above. Those songs did, and still do, make my arm hairs stand up. Music is visceral, but also has the additional powerful layers of the lyrics, with their content and politics, and the style, politics, and personalities of the musicians themselves. No matter how much I love art, or try to convince myself of its relevance in society, the fact remains that music is a lot cooler and much more able to reach people’s hearts and minds. There’s something subversive about bundling seductive visuals with provocative ideas, or provocative visuals with seductive ideas. An audience that approaches a work of art or music for the sake of enjoyment doesn’t expect intellectual engagement, and vice versa. An audience that’s looking for escape doesn’t expect a confrontation and a call to action, but I believe the best music, and the best art, delivers both. Call the approach hi-brow/lo-fi or lo-brow/hi-fi, but I try to use it in my work to capture the same energy and spirit that makes music so powerful.\r\n\r\nThe Sound and Vision art show includes mixed media works on canvas weaving my social commentary with inspiration from a range of musicians, including the Sex Pistols, David Bowie, Roxy Music, Gang of Four, the Clash, the Circle Jerks, Kraftwerk, Public Enemy, Neil Young, and Metallica. Sound and Vision will also include an installation of a record store environment, with customized vintage turntables and a portion of my own record collection for public listening. The record store space will also showcase over 80 12″x12″ images I’ve created as tributes to the 12″ LP sleeve. A comprehensive variety of other works will be featured, including screen prints on wood, metal, and paper; rubylith cuts; and retired stencils.\r\n– Shepard',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'340.992',	'1413321037.jpg',	'500',	'666',	'1413321037.jpg',	'500',	'666',	'1413321037.jpg',	'500',	'666',	'1413321037.jpg',	'500',	'666',	'1413321037.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22Tivp3',	'StolenSpace Gallery Presents\r\n\r\nSOUND & VISION\r\nArtwork by Shepard Fairey\r\n\r\nOpening 10/19/2012\r\n10.19.12 – 11.04.12\r\n\r\nSTOLENSPACE GALLERY\r\nThe Old Truman Brewery\r\nDray Walk\r\n91 Brick Lane\r\nLondon E1 6QL\r\nUnited Kingdom\r\nstolenspace.com\r\n\r\nSound and Vision takes its name from the David Bowie song and “the gift of sound and vision” that he embodies. Bowie is one of my favorite musicians, and has crafted his music and visual presentation with equal brilliance. Music has long been an inspiration for me as a democratic medium that can bring joy but also deliver provocative and compelling social commentary. Sound and Vision not only captures the profound effect that my favorite music has had on me and my work, but even more broadly it represents the accessible and infectious nature of music as we all experience it.\r\n\r\nMusic has taught me far more than art has about connecting with an audience. I’ve often thought “I can’t get this song out of my head,” but rarely thought “I can’t get this painting out of my head.” I’ve had some very moving encounters with art in my life, especially in the street, but almost nothing can compare to the first time I heard the boots marching and first chord of the Sex Pistols’ Holidays in the Sun, or the air raid sirens leading into “too black, too strong” on the intro to Public Enemy’s It Takes A Nation of Millions to Hold Us Back, or the opening guitar scream of Black Flag’s Rise Above. Those songs did, and still do, make my arm hairs stand up. Music is visceral, but also has the additional powerful layers of the lyrics, with their content and politics, and the style, politics, and personalities of the musicians themselves. No matter how much I love art, or try to convince myself of its relevance in society, the fact remains that music is a lot cooler and much more able to reach people’s hearts and minds. There’s something subversive about bundling seductive visuals with provocative ideas, or provocative visuals with seductive ideas. An audience that approaches a work of art or music for the sake of enjoyment doesn’t expect intellectual engagement, and vice versa. An audience that’s looking for escape doesn’t expect a confrontation and a call to action, but I believe the best music, and the best art, delivers both. Call the approach hi-brow/lo-fi or lo-brow/hi-fi, but I try to use it in my work to capture the same energy and spirit that makes music so powerful.\r\n\r\nThe Sound and Vision art show includes mixed media works on canvas weaving my social commentary with inspiration from a range of musicians, including the Sex Pistols, David Bowie, Roxy Music, Gang of Four, the Clash, the Circle Jerks, Kraftwerk, Public Enemy, Neil Young, and Metallica. Sound and Vision will also include an installation of a record store environment, with customized vintage turntables and a portion of my own record collection for public listening. The record store space will also showcase over 80 12″x12″ images I’ve created as tributes to the 12″ LP sleeve. A comprehensive variety of other works will be featured, including screen prints on wood, metal, and paper; rubylith cuts; and retired stencils.\r\n– Shepard',	'0.51',	'0.2',	'1',	'0',	'0',	'19f1a5c15628d3fcd8a78f8f30ee1ca7f94d258b'),
(2423,	398,	86,	'image',	'1413321115',	NULL,	'Sid: Superman is Dead',	'SID: Superman Is Dead\r\n\r\nA collaborative exhibition between Dennis Morris and Shepard Fairey\r\n\r\nOpening Reception: Friday, December 13 from 8-11pm\r\nExhibition Dates: December 13 – January 11, 2014\r\n\r\nSpecial opening night musical performance by RITCHIE LOVE featuring: Steve Jones, Billy Idol, Clem Burke, and Leigh Gorman.\r\n($10 suggested donation at the door)\r\n\r\nThis exhibition will open at SUBLIMINAL PROJECTS on Friday the 13th and will feature collaborative paintings, prints and photographs by Shepard Fairey and British photographer Dennis Morris. An installation of a hotel room Sid destroyed after a night of drinks, drugs, and depression in 1977 will also be on view.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'373.76',	'1413321094.jpg',	'500',	'730',	'1413321094.jpg',	'500',	'730',	'1413321094.jpg',	'500',	'730',	'1413321094.jpg',	'500',	'730',	'1413321094.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22Timlx',	'SID: Superman Is Dead\r\n\r\nA collaborative exhibition between Dennis Morris and Shepard Fairey\r\n\r\nOpening Reception: Friday, December 13 from 8-11pm\r\nExhibition Dates: December 13 – January 11, 2014\r\n\r\nSpecial opening night musical performance by RITCHIE LOVE featuring: Steve Jones, Billy Idol, Clem Burke, and Leigh Gorman.\r\n($10 suggested donation at the door)\r\n\r\nThis exhibition will open at SUBLIMINAL PROJECTS on Friday the 13th and will feature collaborative paintings, prints and photographs by Shepard Fairey and British photographer Dennis Morris. An installation of a hotel room Sid destroyed after a night of drinks, drugs, and depression in 1977 will also be on view.\r\n',	'0.4',	'0.22',	'1',	'0',	'0',	'f9a389f556cb166a5f9b52d3edb0dc8d40f22628'),
