(2465,	405,	87,	'image',	'1413388916',	NULL,	'Galerie Mensing March Tour 2014',	'An action packed weekend of art brought Romero Britto together with some of his famous fans including musician Peter Maffay and actor Moritz Bleibtreu. Galerie Mensing hosted solo exhibitions of Britto art in Hanover, Hamburg and Dusseldorf, Germany on friday, saturday and sunday! Britto admirers and collectors from across Germany and around the world had the incredible opportunity to acquire art dedicated to them personally by the artist, as well as enjoy accolades expressed by fans from Maffay and Bleibtreu to a young girl moved to tears by his presence. A historic weekend of solo shows and praise. for a much deserving artist!',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'209.45454545455',	'1413388894.jpg',	'512',	'418.90909090909',	'1413388894.jpg',	'550',	'450',	'1413388894.jpg',	'550',	'450',	'1413388894.jpg',	'550',	'450',	'1413388894.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBHgg',	'An action packed weekend of art brought Romero Britto together with some of his famous fans including musician Peter Maffay and actor Moritz Bleibtreu. Galerie Mensing hosted solo exhibitions of Britto art in Hanover, Hamburg and Dusseldorf, Germany on friday, saturday and sunday! Britto admirers and collectors from across Germany and around the world had the incredible opportunity to acquire art dedicated to them personally by the artist, as well as enjoy accolades expressed by fans from Maffay and Bleibtreu to a young girl moved to tears by his presence. A historic weekend of solo shows and praise. for a much deserving artist!',	'0.57',	'0.34',	'1',	'0',	'0',	'3a834cb8cad349dc75ecce9ba2721cbbdc91319c'),
(2466,	405,	87,	'image',	'1413389042',	NULL,	'June\'s Exhibitions in China',	'Romero Participated to two exhibitions in China during the month of June.\r\n \r\nRomero attended the first one:  the \"Fantasy Soccer\" exhibition of the apm Mall in Kowloon, Honk Kong. It was a: Fantasy Soccer.\r\nRomero was flanked not only by monumental size renderings of his Giftcraft soccer figurines and Goebel goal, but also by famous Asian models Ana R., Marie Zhuge, Jolie Chan, and Lea T. From the mall was Maureen Fung, who participated in the ribbon cutting ceremony. There was an abundance of media, which was so wonderful and they loved Romero. Besides the ribbon cutting there were numerous activities that Romero participated in the embellished the illustrations that the models did, he also did a signing of beautiful postcards, and he walked giving explanations of the artwork.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'209.45454545455',	'1413389025.jpg',	'512',	'418.90909090909',	'1413389025.jpg',	'550',	'450',	'1413389025.jpg',	'550',	'450',	'1413389025.jpg',	'550',	'450',	'1413389025.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCk9w',	'Romero Participated to two exhibitions in China during the month of June.\r\n \r\nRomero attended the first one:  the \"Fantasy Soccer\" exhibition of the apm Mall in Kowloon, Honk Kong. It was a: Fantasy Soccer.\r\nRomero was flanked not only by monumental size renderings of his Giftcraft soccer figurines and Goebel goal, but also by famous Asian models Ana R., Marie Zhuge, Jolie Chan, and Lea T. From the mall was Maureen Fung, who participated in the ribbon cutting ceremony. There was an abundance of media, which was so wonderful and they loved Romero. Besides the ribbon cutting there were numerous activities that Romero participated in the embellished the illustrations that the models did, he also did a signing of beautiful postcards, and he walked giving explanations of the artwork.',	'0.72',	'0.28',	'1',	'0',	'0',	'b4eed53996876e8e77d248c75172aa9be086d3af'),
(2467,	405,	87,	'image',	'1413389130',	NULL,	'Britto Exhibition at apm in Hong Kong',	'On the heels of two successful exhibits in China earlier this summer, apm mall selected Romero Britto yet again as the focus of their summer exhibit to run July 27 through the end of August.  Bigger and more amazing than before, the mall created a fantasy wonderland, erecting a 6,000 square foot replica of Britto\'s famed Hyde Park pyramid in the center atrium. Walking into this gigantic Pyramid Museum, visitors were amazed by the collection of mini sculptures, figurines and colorful portrait paintings of world-class celebrities such as Mao Zedong, Marilyn Monroe, Madonna, Michael Jackson, Prince William, Duke of Cambridge and his wife Catherine, Duchess of Cambridge. Stepping out from the Pyramid Museum, visitors found themselves entering into another fantasy surrounded by two 5 meters height gigantic sculptures of the Royalty Dog and the Princess Cat; two famous Romero sculptures and other artwork as Pleasures, the Big Apple sculpture inspired by the city of New York, Garden Butterfly and more.  Opening ceremonies were supported by superstar actor Aaron Kwok, with adoring press and fans also in attendance.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'209.45454545455',	'1413389095.jpg',	'512',	'418.90909090909',	'1413389095.jpg',	'550',	'450',	'1413389095.jpg',	'550',	'450',	'1413389095.jpg',	'550',	'450',	'1413389095.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBTMr',	'On the heels of two successful exhibits in China earlier this summer, apm mall selected Romero Britto yet again as the focus of their summer exhibit to run July 27 through the end of August.  Bigger and more amazing than before, the mall created a fantasy wonderland, erecting a 6,000 square foot replica of Britto\'s famed Hyde Park pyramid in the center atrium. Walking into this gigantic Pyramid Museum, visitors were amazed by the collection of mini sculptures, figurines and colorful portrait paintings of world-class celebrities such as Mao Zedong, Marilyn Monroe, Madonna, Michael Jackson, Prince William, Duke of Cambridge and his wife Catherine, Duchess of Cambridge. Stepping out from the Pyramid Museum, visitors found themselves entering into another fantasy surrounded by two 5 meters height gigantic sculptures of the Royalty Dog and the Princess Cat; two famous Romero sculptures and other artwork as Pleasures, the Big Apple sculpture inspired by the city of New York, Garden Butterfly and more.  Opening ceremonies were supported by superstar actor Aaron Kwok, with adoring press and fans also in attendance.',	'0.47',	'0.42',	'1',	'0',	'0',	'da723c271b34ae31ae01e7338212e19c06cb6e17'),
(2468,	405,	87,	'image',	'1413389212',	NULL,	'Romero Britto\'s intimate evening with CKI Hong Kong',	'In July 28th, 2014 The World-renowned pop artist, Romero Britto graced the CKI Hong Kong gallery for an intimate evening with art collectors and tastemakers. This night was accentuated by the premiere of his APM Mall pyramid installation the previous afternoon; paying homage to his former installation in London\'s Hyde Park.\r\nRomero Britto creates expressions that reflects his optimistic faith in the world around him. Eileen Guggenheim wrote it best when stating, \'Chagall\'s floating lovers seem to foreshadow so many of Britto\'s buoyant exultant couples.\'\r\nBritto brings his vitality to everything and this event was no exception. His enthusiasts gathered in the CKI Soho space for cocktails and conversations for an evening they will never forget. Romero\'s warm demeanor created approachability like no other inviting guests for photos and anecdotes for which he was more than happy to please. Attendees consisted mainly of fans who invested in his Asia Pacific Suite, which was available exclusively through CKI. The sold out suite depicts quintessential Asian figures and his liveliness provided a platform for Britto to access his Asian enthusiasts.\r\nThe opportunity to meet and mingle with Britto was one unique.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'209.45454545455',	'1413389163.jpg',	'512',	'418.90909090909',	'1413389163.jpg',	'550',	'450',	'1413389163.jpg',	'550',	'450',	'1413389163.jpg',	'550',	'450',	'1413389163.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBytg',	'In July 28th, 2014 The World-renowned pop artist, Romero Britto graced the CKI Hong Kong gallery for an intimate evening with art collectors and tastemakers. This night was accentuated by the premiere of his APM Mall pyramid installation the previous afternoon; paying homage to his former installation in London\'s Hyde Park.\r\nRomero Britto creates expressions that reflects his optimistic faith in the world around him. Eileen Guggenheim wrote it best when stating, \'Chagall\'s floating lovers seem to foreshadow so many of Britto\'s buoyant exultant couples.\'\r\nBritto brings his vitality to everything and this event was no exception. His enthusiasts gathered in the CKI Soho space for cocktails and conversations for an evening they will never forget. Romero\'s warm demeanor created approachability like no other inviting guests for photos and anecdotes for which he was more than happy to please. Attendees consisted mainly of fans who invested in his Asia Pacific Suite, which was available exclusively through CKI. The sold out suite depicts quintessential Asian figures and his liveliness provided a platform for Britto to access his Asian enthusiasts.\r\nThe opportunity to meet and mingle with Britto was one unique.',	'0.51',	'0.3',	'1',	'0',	'0',	'5d1969ff9f4cd0e4ac9c28222aa0a3f353702129'),
(2469,	405,	87,	'image',	'1413389285',	NULL,	'Britto Paint Party',	'On September 20, 2014 celebrity ambassadors Romero Britto and Sports Illustrated supermodel Nina Agdal hosted a special paint party with the children of Miami Children\'s Hospital to create a work of art for its Together For The Children, The Campaign for Miami Children\'s Hospital. The campaign, which is on track to fundraise $150 million dollars by 2017, also counts on the support of superstar Armando \"Pitbull\" Perez as a celebrity ambassador. A select group of children had the opportunity to paint with Romero Britto as he created an exclusive work of art that will be part of the campaign collateral. Other celebrities and influencers, as well as local dignitaries came together for this inspirational initiative and celebration.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'209.45454545455',	'1413389254.jpg',	'512',	'418.90909090909',	'1413389254.jpg',	'550',	'450',	'1413389254.jpg',	'550',	'450',	'1413389254.jpg',	'550',	'450',	'1413389254.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBA4o',	'On September 20, 2014 celebrity ambassadors Romero Britto and Sports Illustrated supermodel Nina Agdal hosted a special paint party with the children of Miami Children\'s Hospital to create a work of art for its Together For The Children, The Campaign for Miami Children\'s Hospital. The campaign, which is on track to fundraise $150 million dollars by 2017, also counts on the support of superstar Armando \"Pitbull\" Perez as a celebrity ambassador. A select group of children had the opportunity to paint with Romero Britto as he created an exclusive work of art that will be part of the campaign collateral. Other celebrities and influencers, as well as local dignitaries came together for this inspirational initiative and celebration.',	'0.67',	'0.39',	'1',	'0',	'0',	'9969dfecafeeb4dee92e7df65ddf878fa317345a'),
(2470,	405,	87,	'image',	'1413389355',	NULL,	'KIAF/14 - BandiTrazos, Seoul, Korea',	'As featured in Seoul Selection Magazine, \"Since 2002, KIAF has provided opportunities for art-lovers to expand their collections by experiencing outstanding works of art while revitalizing galleries from all corners of the earth. Artists and visitors will also discover the excellence and potential power of the Korean art market in the midst of global trends in art.  KIAF is visitor-friendly with several lecture programs by renowned speakers in the field of art open to the general public at the Conference Hall. The artists and visitors may also receive docent programs to help their understanding of the displayed art and make their time at KIAF more meaningful.\" For more information please visit http://www.kiaf.org/.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'209.45454545455',	'1413389322.jpg',	'512',	'418.90909090909',	'1413389322.jpg',	'550',	'450',	'1413389322.jpg',	'550',	'450',	'1413389322.jpg',	'550',	'450',	'1413389322.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfChur',	'As featured in Seoul Selection Magazine, \"Since 2002, KIAF has provided opportunities for art-lovers to expand their collections by experiencing outstanding works of art while revitalizing galleries from all corners of the earth. Artists and visitors will also discover the excellence and potential power of the Korean art market in the midst of global trends in art.  KIAF is visitor-friendly with several lecture programs by renowned speakers in the field of art open to the general public at the Conference Hall. The artists and visitors may also receive docent programs to help their understanding of the displayed art and make their time at KIAF more meaningful.\" For more information please visit http://www.kiaf.org/.\r\n',	'0.5',	'0.44',	'1',	'0',	'0',	'c2f2649d9a863c1367f18f98ca2cde8c67dd0c07'),
