(2481,	408,	88,	'image',	'1413394726',	NULL,	'Dame Elizabeth Taylor ',	'A Herb Ritts portrait of Dame Elizabeth Taylor as a remembrance to and in honor of all her many efforts in matters related to #HIV/#AIDS. \r\n\r\nTaylor founded The Elizabeth Taylor AIDS Foundation) in 1991, created to provide critically needed support services for people with HIV/AIDS. She was also a cofounder of the American Foundation for AIDS Research (amfAR) in 1985.\r\n\r\nOn this day in 2011, the world mourned the loss of Dame Elizabeth.\r\n\r\nPictured here with her dog Sugar.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1413394708.jpg',	'512',	'512',	'1413394708.jpg',	'720',	'720',	'1413394708.jpg',	'720',	'720',	'1413394708.jpg',	'720',	'720',	'1413394708.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TkBVQ',	'A Herb Ritts portrait of Dame Elizabeth Taylor as a remembrance to and in honor of all her many efforts in matters related to #HIV/#AIDS. \r\n\r\nTaylor founded The Elizabeth Taylor AIDS Foundation) in 1991, created to provide critically needed support services for people with HIV/AIDS. She was also a cofounder of the American Foundation for AIDS Research (amfAR) in 1985.\r\n\r\nOn this day in 2011, the world mourned the loss of Dame Elizabeth.\r\n\r\nPictured here with her dog Sugar.',	'0.39',	'0.39',	'1',	'0',	'0',	'23c621bd6d2570e9f758d699863117e078e481f2'),
