(2541,	415,	89,	'image',	'1413562869',	NULL,	'TR3 FEATURING TIM REYNOLDS ANNOUNCE NEW ALBUM',	'“Like Some Kind of Alien Invasion,” TR3′s first major studio release comes out on October 7, 2014. Available in both CD and vinyl for pre-order, the album features fourteen new original songs from guitarist Tim Reynolds, with help from bassist Mick Vaughn and drummer Dan Martier. \r\n\r\nTR3 will tour nationally this fall. ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1413562798.JPG',	'512',	'512',	'1413562798.JPG',	'1200',	'1200',	'1413562798.JPG',	'1200',	'1200',	'1413562798.JPG',	'1024',	'1024',	'1413562798.JPG',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCxJM',	'“Like Some Kind of Alien Invasion,” TR3′s first major studio release comes out on October 7, 2014. Available in both CD and vinyl for pre-order, the album features fourteen new original songs from guitarist Tim Reynolds, with help from bassist Mick Vaughn and drummer Dan Martier. \r\n\r\nTR3 will tour nationally this fall. ',	'0.55',	'0.25',	'1',	'0',	'0',	'4e30465d2194a7d249f5ac2f761c084794d75b48'),
(2542,	415,	89,	'image',	'1413563148',	NULL,	'DAVE MATTHEWS TO PERFORM FOR STAND UP TO CANCER EVENT',	'Dave is uniting with fellow supporters to Stand Up To Cancer and will be performing for tomorrow evening’s telecast. During the event, participating celebrities will be making calls to raise money for cancer research and clinical trials. Tune into the televised Stand Up To Cancer event tomorrow night, September 5th on ABC, CBS, FOX and NBC at 8ET/7CT.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'1413563125.jpg',	'512',	'288',	'1413563125.jpg',	'800',	'450',	'1413563125.jpg',	'800',	'450',	'1413563125.jpg',	'800',	'450',	'1413563125.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBKsh',	'Dave is uniting with fellow supporters to Stand Up To Cancer and will be performing for tomorrow evening’s telecast. During the event, participating celebrities will be making calls to raise money for cancer research and clinical trials. Tune into the televised Stand Up To Cancer event tomorrow night, September 5th on ABC, CBS, FOX and NBC at 8ET/7CT.',	'0.5',	'0.5',	'1',	'0',	'0',	'94bdd0cbd36700c82d288ba45bc73d9321c03741'),
