(2544,	415,	89,	'image',	'1413563478',	NULL,	'FARM AID TV BROADCAST, WEBCAST AND MOBILE APP',	'Farm Aid announced that AXS TV will be the exclusive television broadcaster of Farm Aid 2014, to be presented live in high definition on Sept. 13 at 7 p.m. EDT/4 p.m. PDT. The concert experience will be available to fans who are unable to attend the sold-out family farm festival at Walnut Creek Amphitheatre in Raleigh, N.C. The broadcast on AXS TV will feature live performances by Farm Aid board members Willie Nelson, John Mellencamp, Neil Young and Dave Matthews with Tim Reynolds, as well as performances recorded earlier in the day from additional artists including Jack White, Gary Clark Jr., Jamey Johnson, Preservation Hall Jazz Band, Delta Rae and more.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'231.33785617368',	'1413563450.jpg',	'512',	'462.67571234735',	'1413563450.jpg',	'1474',	'1332',	'1413563450.jpg',	'1474',	'1332',	'1413563450.jpg',	'1024',	'925.35142469471',	'1413563450.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfC3Dt',	'Farm Aid announced that AXS TV will be the exclusive television broadcaster of Farm Aid 2014, to be presented live in high definition on Sept. 13 at 7 p.m. EDT/4 p.m. PDT. The concert experience will be available to fans who are unable to attend the sold-out family farm festival at Walnut Creek Amphitheatre in Raleigh, N.C. The broadcast on AXS TV will feature live performances by Farm Aid board members Willie Nelson, John Mellencamp, Neil Young and Dave Matthews with Tim Reynolds, as well as performances recorded earlier in the day from additional artists including Jack White, Gary Clark Jr., Jamey Johnson, Preservation Hall Jazz Band, Delta Rae and more.',	'0.61',	'0.54',	'1',	'0',	'0',	'3fa4caa55fa2b69079e09894b24b2627a43a6109'),
(2545,	415,	89,	'image',	'1413563571',	NULL,	'DAVE MATTHEWS AND TIM REYNOLDS ANNOUNCE SHOWS IN OAKLAND, CA',	'Dave and Tim will perform at the historic Paramount Theatre in Oakland, CA on January 16 and 17, 2015. The longtime friends and collaborators will play a pair of intimate shows at the restored, state-of-the art theatre, one of the finest remaining examples of Art Deco architecture in the United States.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1413563549.png',	'512',	'512',	'1413563549.png',	'526',	'526',	'1413563549.png',	'526',	'526',	'1413563549.png',	'526',	'526',	'1413563549.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBZ6L',	'Dave and Tim will perform at the historic Paramount Theatre in Oakland, CA on January 16 and 17, 2015. The longtime friends and collaborators will play a pair of intimate shows at the restored, state-of-the art theatre, one of the finest remaining examples of Art Deco architecture in the United States.',	'0.2',	'0.51',	'1',	'0',	'0',	'9d2c1c1a0fc3d8c790708a7b9da58f8253381d6e'),
(2546,	415,	89,	'image',	'1413563742',	NULL,	'20TH ANNIVERSARY NEWLY REMASTERED DELUXE VINYL EDITION OF UNDER THE TABLE AND DREAMING TO BE RELEASED NOVEMBER 24TH',	'To celebrate the 20th anniversary of the major label debut of Under The Table And Dreaming,  Dave Matthews Band will release a vinyl edition on Monday, November 24th.  The record has been newly remastered from the original flat analog tapes and will be available, for the first time ever, in a 2LP 12″ vinyl version featuring an 8-page book packed with previously unpublished photographs of the band in a limited, numbered gatefold jacket. The deluxe vinyl is limited edition and lacquers were cut by Chris Bellman at Bernie Grundman.\r\n\r\nThe 20th anniversary vinyl edition also includes a download card featuring the entire album and three unreleased bonus tracks, including the original studio version of live-favorite “Granny” and intimate, acoustic versions of “Dancing Nancies” and “The Song That Jane Likes.”  In addition, the newly remastered edition will also be re-released in CD and will include the three bonus tracks.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'260.89171974522',	'1413563714.jpg',	'512',	'521.78343949045',	'1413563714.jpg',	'785',	'800',	'1413563714.jpg',	'785',	'800',	'1413563714.jpg',	'785',	'800',	'1413563714.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBMQZ',	'To celebrate the 20th anniversary of the major label debut of Under The Table And Dreaming,  Dave Matthews Band will release a vinyl edition on Monday, November 24th.  The record has been newly remastered from the original flat analog tapes and will be available, for the first time ever, in a 2LP 12″ vinyl version featuring an 8-page book packed with previously unpublished photographs of the band in a limited, numbered gatefold jacket. The deluxe vinyl is limited edition and lacquers were cut by Chris Bellman at Bernie Grundman.\r\n\r\nThe 20th anniversary vinyl edition also includes a download card featuring the entire album and three unreleased bonus tracks, including the original studio version of live-favorite “Granny” and intimate, acoustic versions of “Dancing Nancies” and “The Song That Jane Likes.”  In addition, the newly remastered edition will also be re-released in CD and will include the three bonus tracks.',	'0.49',	'0.43',	'1',	'0',	'0',	'904ca3e766f73020cc8fef0bb1412843297a7c15'),
(2547,	416,	89,	'image',	'1413565352',	NULL,	'DMB Danny Clinch Photo Shirt Version 2',	'100% cotton shirt in charcoal featuring a photo of the band with one of Leroi\'s horns. Shot by acclaimed photographer Danny Clinch in 2009, the photo was taken in the attic of a New Orleans recording studio during the production of Big Whiskey and the Groo Grux King. We are excited to offer this shirt as the second in a series of DMB/Danny Clinch merchandise items. Available S-3X. \r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'1413565320.png',	'302',	'302',	'1413565320.png',	'302',	'302',	'1413565320.png',	'302',	'302',	'1413565320.png',	'302',	'302',	'1413565320.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfC0Yn',	'100% cotton shirt in charcoal featuring a photo of the band with one of Leroi\'s horns. Shot by acclaimed photographer Danny Clinch in 2009, the photo was taken in the attic of a New Orleans recording studio during the production of Big Whiskey and the Groo Grux King. We are excited to offer this shirt as the second in a series of DMB/Danny Clinch merchandise items. Available S-3X. \r\n',	'0.53',	'0.38',	'1',	'0',	'0',	'4735724b9ad1e2305de9b1387a25a528b3fda90d'),
