(2566,	418,	89,	'image',	'1413574268',	NULL,	'Boyd Tinsley',	'As the last one to join, violinist Boyd Tinsley may be the member of the Dave Matthews Band least surprised by its success. “When I first heard this band, I knew it was something special,” says Tinsley, who was asked in early 1991 to play on the demo song “Tripping Billies” and hooked up with the band full-time later that year. “When I first heard these songs played by these musicians, it was some of the most powerful stuff I’d heard in a long time. It doesn’t surprise me it works.” Tinsley certainly has the musical grounding from which to judge. A native of Charlottesville, who grew up in the same neighborhood as drummer Carter Beauford and saxophonist Leroi Moore, Tinsley was raised in a musical household. His father directed the church choir and an uncle played upright bass and trumpet in local jazz bands. There was a steady stream of Motown pumping out of the family stereo, as well.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.66666666667',	'1413574202.jpg',	'512',	'341.33333333333',	'1413574202.jpg',	'1200',	'800',	'1413574202.jpg',	'1200',	'800',	'1413574202.jpg',	'1024',	'682.66666666667',	'1413574202.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCy0i',	'As the last one to join, violinist Boyd Tinsley may be the member of the Dave Matthews Band least surprised by its success. “When I first heard this band, I knew it was something special,” says Tinsley, who was asked in early 1991 to play on the demo song “Tripping Billies” and hooked up with the band full-time later that year. “When I first heard these songs played by these musicians, it was some of the most powerful stuff I’d heard in a long time. It doesn’t surprise me it works.” Tinsley certainly has the musical grounding from which to judge. A native of Charlottesville, who grew up in the same neighborhood as drummer Carter Beauford and saxophonist Leroi Moore, Tinsley was raised in a musical household. His father directed the church choir and an uncle played upright bass and trumpet in local jazz bands. There was a steady stream of Motown pumping out of the family stereo, as well.\r\n',	'0.5',	'0.39',	'1',	'0',	'0',	'4eeb58dd168d3e6e024f6ee4360256412f85505f'),
(2567,	418,	89,	'image',	'1413574456',	NULL,	'Carter Beauford ',	'Carter Beauford started on his music career at an early age — three years old. That’s when his father, who couldn’t find a baby sitter, took the toddler drummer-to-be to see the legendary Buddy Rich, which Beauford says “put the icing on the cake for me as far as what I wanted to do and what route to take. Believe it or not, I knew it was what I wanted to do then,” Beauford says. “My dad was a jazz trumpet player and kinda hipped me to the whole music scene. And he made it look like so much fun I decided to go ahead and pursue it.” Charlottesville, VA native Beauford largely lived behind his kit as a youth. “As long as I was on the drums, I was fine,” he says. Beauford played his first professional gig at age nine with a jazz-fusion outfit led by local luminary Big Nick Nicholas (an associate of John Coltrane’s). Eventually, he wound up in a Richmond, VA based group called Secrets, which a young Dave Matthews used to watch before approaching Beauford and the group’s saxophonist, LeRoi Moore, to help him work on some material he was developing. “I took a listen to it, and it was kind of interesting, the way he played and the way he wrote music” Beauford says. “Before long we were in the studio recording, not our first record, but something that we could go back and listen to and play for friends and see what people thought. We played it to friends and people were whooping and hollering over that sound we generated.” Obviously, it was successful. Beauford’s work with the Dave Matthews Band has generated a demand for his playing on others’ records as well. Since the release of “Before These Crowded Streets,” Beauford has shown up on albums by Carlos Santana, Blues Traveler’s John Popper, Victor Wooten of Bela Fleck’s Flecktones and Robin Andre (AKA Boy Wonder). “Outside work keeps the creativity flowing for me,” Beauford says. “I feel it’s important to get in there and try to tackle someone else’s music and play a little differently, and then bring it back to the band.”',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.66666666667',	'1413574427.jpg',	'512',	'341.33333333333',	'1413574427.jpg',	'900',	'600',	'1413574427.jpg',	'900',	'600',	'1413574427.jpg',	'900',	'600',	'1413574427.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCUUE',	'Carter Beauford started on his music career at an early age — three years old. That’s when his father, who couldn’t find a baby sitter, took the toddler drummer-to-be to see the legendary Buddy Rich, which Beauford says “put the icing on the cake for me as far as what I wanted to do and what route to take. Believe it or not, I knew it was what I wanted to do then,” Beauford says. “My dad was a jazz trumpet player and kinda hipped me to the whole music scene. And he made it look like so much fun I decided to go ahead and pursue it.” Charlottesville, VA native Beauford largely lived behind his kit as a youth. “As long as I was on the drums, I was fine,” he says. Beauford played his first professional gig at age nine with a jazz-fusion outfit led by local luminary Big Nick Nicholas (an associate of John Coltrane’s). Eventually, he wound up in a Richmond, VA based group called Secrets, which a young Dave Matthews used to watch before approaching Beauford and the group’s saxophonist, LeRoi Moore, to help him work on some material he was developing. “I took a listen to it, and it was kind of interesting, the way he played and the way he wrote music” Beauford says. “Before long we were in the studio recording, not our first record, but something that we could go back and listen to and play for friends and see what people thought. We played it to friends and people were whooping and hollering over that sound we generated.” Obviously, it was successful. Beauford’s work with the Dave Matthews Band has generated a demand for his playing on others’ records as well. Since the release of “Before These Crowded Streets,” Beauford has shown up on albums by Carlos Santana, Blues Traveler’s John Popper, Victor Wooten of Bela Fleck’s Flecktones and Robin Andre (AKA Boy Wonder). “Outside work keeps the creativity flowing for me,” Beauford says. “I feel it’s important to get in there and try to tackle someone else’s music and play a little differently, and then bring it back to the band.”',	'0.5',	'0.48',	'1',	'0',	'0',	'd4c206da54072cd589c11af7a36c6c1e512fe70e'),
(2568,	418,	89,	'image',	'1413574990',	NULL,	'Dave Matthews',	'Dave Matthews has chronicled his life’s travels so often that when asked, he can rattle off the details without pause. It goes like this:\r\n\r\nBorn in Johannesburg, South Africa, in 1967. Moves two years later with his family to Westchester County, NY, where his dad, a physicist, goes to work for IBM. Then, in the early `70s, to Cambridge, England, before returning to New York — where his dad died in 1977. The family moved back to South Africa in 1980, where Matthews went to a few different schools and “got more wise about the evils of government, there and in general.” O.K.; pause for a breath.\r\n\r\nThe key move for Dave Matthews Band fans, of course, was when he relocated in 1986 to Charlottesville, VA, where his parents had lived before he was born. Though he also logged time back in South Africa and in Amsterdam, it was in Charlottesville where Matthews — who took piano lessons as a child before picking up the guitar at age nine — became part of the local music community and hatched the idea for his own band.\r\n\r\n“I didn’t really have a vision, or a plan,” says Matthews, acknowledging that some of his musical sensibility came from spending time in so many different places as a child. “I’m sure it gave me a little bit of an openness. The most diverse music in the world is in America, ’cause there’s so many different cultures here, but what tends to be pushed to the top is often a narrow view of what there really is. So maybe (his travels) just gave me a wider pool of listening.”\r\n\r\nMatthews says his principal goal with the band was to surround himself with the best players possible. To this day he remains “amazed” that he was able to recruit and retain the four musicians he rather modestly refers to as his superiors. “I was just looking for people that I liked,” explains Matthews, who feels he’s “gotten a bit better” over the years. “Could I play with them was more of the question, I think. We just ended up fitting together. The band wasn’t something that I was looking for; it was very much I loved the people I asked to play with me. There was a connection at the beginning, and I think what we’ve been about is not some grand scheme but more the spirit of everyone, which is why we ended up with this band and why it sounds like it does.”',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.66666666667',	'1413574970.jpg',	'512',	'341.33333333333',	'1413574970.jpg',	'900',	'600',	'1413574970.jpg',	'900',	'600',	'1413574970.jpg',	'900',	'600',	'1413574970.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCca0',	'Dave Matthews has chronicled his life’s travels so often that when asked, he can rattle off the details without pause. It goes like this:\r\n\r\nBorn in Johannesburg, South Africa, in 1967. Moves two years later with his family to Westchester County, NY, where his dad, a physicist, goes to work for IBM. Then, in the early `70s, to Cambridge, England, before returning to New York — where his dad died in 1977. The family moved back to South Africa in 1980, where Matthews went to a few different schools and “got more wise about the evils of government, there and in general.” O.K.; pause for a breath.\r\n\r\nThe key move for Dave Matthews Band fans, of course, was when he relocated in 1986 to Charlottesville, VA, where his parents had lived before he was born. Though he also logged time back in South Africa and in Amsterdam, it was in Charlottesville where Matthews — who took piano lessons as a child before picking up the guitar at age nine — became part of the local music community and hatched the idea for his own band.\r\n\r\n“I didn’t really have a vision, or a plan,” says Matthews, acknowledging that some of his musical sensibility came from spending time in so many different places as a child. “I’m sure it gave me a little bit of an openness. The most diverse music in the world is in America, ’cause there’s so many different cultures here, but what tends to be pushed to the top is often a narrow view of what there really is. So maybe (his travels) just gave me a wider pool of listening.”\r\n\r\nMatthews says his principal goal with the band was to surround himself with the best players possible. To this day he remains “amazed” that he was able to recruit and retain the four musicians he rather modestly refers to as his superiors. “I was just looking for people that I liked,” explains Matthews, who feels he’s “gotten a bit better” over the years. “Could I play with them was more of the question, I think. We just ended up fitting together. The band wasn’t something that I was looking for; it was very much I loved the people I asked to play with me. There was a connection at the beginning, and I think what we’ve been about is not some grand scheme but more the spirit of everyone, which is why we ended up with this band and why it sounds like it does.”',	'0.51',	'0.23',	'1',	'0',	'0',	'923603c3c381fdab82c98f35348c3a3f976d8261'),
(2569,	418,	89,	'image',	'1413575092',	NULL,	'Stefan Lessard',	'Bassist Stefan Lessard (aka Fonzy) is the youngest member of Dave Matthews Band, by a good seven years. He was just 16 when approached by the then bartender Dave Matthews who asked Stefan to join him, Carter Beauford and LeRoi Moore in their attempt to form a band. He was the perfect fit. Being so young, he saw the band as a continuation of his musical education and took the group very seriously. Still fresh in high school, he weaved simple yet strong bass lines proving to be an integral part of the new sound being created by the group.\r\n\r\nBorn in Anaheim, CA, his parents had both been musicians, which had a great effect on Stefan. Stefan remembers music always being played in his house and recalled that his Dad would get back from his 9 to 5 and immediately start playing guitar or flute, while Stefan usually banged on the bongos. Stefan was quoted as saying, “My Mom had a beautiful voice and she and my Dad would do jazz gigs at weddings or lounges. They always wanted to be playing more, but the music couldn’t support the cost of life.” His family moved back and forth between California and Rhode Island until they landed in Virginia when he was 6. It was around this time that he began to show a real interest in music.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'384',	'1413575060.jpg',	'400',	'600',	'1413575060.jpg',	'400',	'600',	'1413575060.jpg',	'400',	'600',	'1413575060.jpg',	'400',	'600',	'1413575060.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCnSK',	'Bassist Stefan Lessard (aka Fonzy) is the youngest member of Dave Matthews Band, by a good seven years. He was just 16 when approached by the then bartender Dave Matthews who asked Stefan to join him, Carter Beauford and LeRoi Moore in their attempt to form a band. He was the perfect fit. Being so young, he saw the band as a continuation of his musical education and took the group very seriously. Still fresh in high school, he weaved simple yet strong bass lines proving to be an integral part of the new sound being created by the group.\r\n\r\nBorn in Anaheim, CA, his parents had both been musicians, which had a great effect on Stefan. Stefan remembers music always being played in his house and recalled that his Dad would get back from his 9 to 5 and immediately start playing guitar or flute, while Stefan usually banged on the bongos. Stefan was quoted as saying, “My Mom had a beautiful voice and she and my Dad would do jazz gigs at weddings or lounges. They always wanted to be playing more, but the music couldn’t support the cost of life.” His family moved back and forth between California and Rhode Island until they landed in Virginia when he was 6. It was around this time that he began to show a real interest in music.',	'0.38',	'0.37',	'1',	'0',	'0',	'fcde4e8d5d788cc5855628bd06c2af34fc6eb0c4'),
(2571,	418,	89,	'image',	'1413817225',	NULL,	'Jeff Coffin',	'Jeff Coffin is an internationally recognized saxophonist, bandleader, composer and educator and has been traveling the globe since the late 20th Century. He is a 3x Grammy Award winner from Bela Fleck & the Flecktones and played with them from 1997-2010. In July 2008, Jeff began touring with Dave Matthews Band, and officially joined the group in 2009 following the tragic passing of founding member LeRoi Moore. When not on the road with DMB, Coffin fronts his own group, Jeff Coffin & the Mu’tet.\r\n\r\nSome of the artists Coffin has shared the stage and the recording studio include a “who’s who” of musicians such as Bela Fleck & the Flecktones, Dave Matthews Band, Branford Marsalis, Bob Mintzer, DJ Logic, New Orleans Social Club, Maceo Parker, McCoy Tyner, Baaba Maal, Phish, Mike Clark’s Prescription Trio, Galactic, Kirk Whalum, My Morning Jacket, Widespread Panic, Chris Thile, Willie Nelson, Chester Thompson, Garth Brooks, Van Morrison, J.D. Souther, Vinnie Colaiuta, The Dixie Chicks, ‘Rakalam’ Bob Moses, Stanton Moore, Brooks and Dunn, Tuvan Throat Singers – the Alash Ensemble & Konger Ol Ondar, George Porter Jr., Umphrey’s McGee, Del McCoury, John Scofield, Yonder Mountain String Band, Marc Broussard, Martina McBride, Lynyrd Skynyrd, the Wailers and many, many others.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'393.95113282985',	'1413817197.jpg',	'512',	'787.90226565971',	'1413817197.jpg',	'2251',	'3464',	'1413817197.jpg',	'2048',	'3151.6090626388',	'1413817197.jpg',	'1024',	'1575.8045313194',	'1413817197.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCzRU',	'Jeff Coffin is an internationally recognized saxophonist, bandleader, composer and educator and has been traveling the globe since the late 20th Century. He is a 3x Grammy Award winner from Bela Fleck & the Flecktones and played with them from 1997-2010. In July 2008, Jeff began touring with Dave Matthews Band, and officially joined the group in 2009 following the tragic passing of founding member LeRoi Moore. When not on the road with DMB, Coffin fronts his own group, Jeff Coffin & the Mu’tet.\r\n\r\nSome of the artists Coffin has shared the stage and the recording studio include a “who’s who” of musicians such as Bela Fleck & the Flecktones, Dave Matthews Band, Branford Marsalis, Bob Mintzer, DJ Logic, New Orleans Social Club, Maceo Parker, McCoy Tyner, Baaba Maal, Phish, Mike Clark’s Prescription Trio, Galactic, Kirk Whalum, My Morning Jacket, Widespread Panic, Chris Thile, Willie Nelson, Chester Thompson, Garth Brooks, Van Morrison, J.D. Souther, Vinnie Colaiuta, The Dixie Chicks, ‘Rakalam’ Bob Moses, Stanton Moore, Brooks and Dunn, Tuvan Throat Singers – the Alash Ensemble & Konger Ol Ondar, George Porter Jr., Umphrey’s McGee, Del McCoury, John Scofield, Yonder Mountain String Band, Marc Broussard, Martina McBride, Lynyrd Skynyrd, the Wailers and many, many others.',	'0.48',	'0.2',	'1',	'0',	'0',	'1dcde06f0107697d55669f321c25adc0b544ac3d'),
(2572,	418,	89,	'image',	'1413817313',	NULL,	'Rashawn Ross',	'Rashawn Ross started his musical journey from humble beginnings in St. Thomas, Virgin Islands. While in high school, Ross began performing and traveling with some of the islands’ most popular dance and calypso bands. From that point, music became a huge part his life which led to his decision to pursue it as a career.\r\n\r\nA graduate of Berklee College of Music (1996-2000), Ross has worked with artists in many different genres of music ranging from funk, rock, jazz, hip hop, gospel and country music. Since graduating from Berklee in 2000, He has toured with Yerba Buena, Soulive and DJ Quik. Rashawn began working with Dave Matthews Band in 2005 and became a regular tour musician beginning with the 2006 DMB tour.\r\n\r\nRashawn has enjoyed the unique opportunity to perform and record with an impressive roster of artists including: Usher, Ludacris, Chris Cornell, The Fugees, Maceo Parker, Ron Blake, Christian McBride, Chaka Khan, Stevie Wonder, Willie Nelson, The Edge, Rodney Jerkins, Christina Milan, Fred Hammond, Sean Paul, Roy Hargrove, Nicholas Payton, ?uestlove, Mobb Deep, Talib Kweli, Common, Pharoah Monch, Mark Batson, Robert Randolph, Mo Horns, Doug E. Fresh, B Real, Chingy, Nate Dogg, Kim Burrell, Richard Smallwood, Kelly Price, The Hawkins Family, James Hall, Me’Shell Ndegeocello, String Cheese Incident, Baaba Maal, Taj Mahal, and Femi Kuti.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'169.6',	'1413817287.jpg',	'512',	'339.2',	'1413817287.jpg',	'640',	'424',	'1413817287.jpg',	'640',	'424',	'1413817287.jpg',	'640',	'424',	'1413817287.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfC1LW',	'Rashawn Ross started his musical journey from humble beginnings in St. Thomas, Virgin Islands. While in high school, Ross began performing and traveling with some of the islands’ most popular dance and calypso bands. From that point, music became a huge part his life which led to his decision to pursue it as a career.\r\n\r\nA graduate of Berklee College of Music (1996-2000), Ross has worked with artists in many different genres of music ranging from funk, rock, jazz, hip hop, gospel and country music. Since graduating from Berklee in 2000, He has toured with Yerba Buena, Soulive and DJ Quik. Rashawn began working with Dave Matthews Band in 2005 and became a regular tour musician beginning with the 2006 DMB tour.\r\n\r\nRashawn has enjoyed the unique opportunity to perform and record with an impressive roster of artists including: Usher, Ludacris, Chris Cornell, The Fugees, Maceo Parker, Ron Blake, Christian McBride, Chaka Khan, Stevie Wonder, Willie Nelson, The Edge, Rodney Jerkins, Christina Milan, Fred Hammond, Sean Paul, Roy Hargrove, Nicholas Payton, ?uestlove, Mobb Deep, Talib Kweli, Common, Pharoah Monch, Mark Batson, Robert Randolph, Mo Horns, Doug E. Fresh, B Real, Chingy, Nate Dogg, Kim Burrell, Richard Smallwood, Kelly Price, The Hawkins Family, James Hall, Me’Shell Ndegeocello, String Cheese Incident, Baaba Maal, Taj Mahal, and Femi Kuti.',	'0.54',	'0.4',	'1',	'0',	'0',	'f4eb071cda4776fa8ff6f72380d99da472215966'),
(2573,	418,	89,	'image',	'1413817783',	NULL,	'Tim Reynolds',	'Tim Reynolds has been playing music all of his life. Starting as a bass player in a gospel band in his hometown of St. Louis to his days in Charlottesville with TR3, his breakthrough electric trio in the 1980s, and his recent recording and touring with Dave Matthews Band and the Dave Matthews-Tim Reynolds Acoustic Duo. Tim’s progression has continued through his last eight years on the road as a solo acoustic guitar wizard, playing for packed houses and crowds who have come to realize that Tim is not just Dave’s sideman; he is one of the most talented, amazing, and thoughtful players on the circuit today.\r\n\r\nHaving explored most musical styles, from rock to jazz and flamenco to reggae, Tim makes use of every instrument with his wide-ranging musical ability and rises above the mere mastery of chops to a virtual state of communion with whatever instrument he happens to be holding. He is a self-taught master of the sitar, solo jazz guitar, solo djembe, twelve string guitar, violin, and mandolin, along with his acoustic and electric guitars. His many influences, which include Carlos Santana, Jimi Hendrix, Bob Marley, and Led Zeppelin, among others, are indirectly felt in the fabric of Tim’s power trio and solo projects.\r\n\r\nAfter living in New Mexico for the last eight years, Tim recently relocated to the Outer Banks of North Carolina where he ran across two musicians, bass player Mick Vaughn and drummer Dan Martier, who would eventually form this latest version of TR3, his favorite project. After a chance meeting of these three talented players, a few rehearsals and several stealth appearances around the North Carolina shore Tim realized it was time to get back to the basics of rocking out the way only Tim can. Once again things have come full circle and TR3 is back to rock and funk the house down. Their songs are a mix of updated Tim classics to wild covers of everything from James Brown to Prince to TR3′s newest catalogue of material.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'143.70133333333',	'1413817766.jpg',	'512',	'287.40266666667',	'1413817766.jpg',	'750',	'421',	'1413817766.jpg',	'750',	'421',	'1413817766.jpg',	'750',	'421',	'1413817766.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCe1C',	'Tim Reynolds has been playing music all of his life. Starting as a bass player in a gospel band in his hometown of St. Louis to his days in Charlottesville with TR3, his breakthrough electric trio in the 1980s, and his recent recording and touring with Dave Matthews Band and the Dave Matthews-Tim Reynolds Acoustic Duo. Tim’s progression has continued through his last eight years on the road as a solo acoustic guitar wizard, playing for packed houses and crowds who have come to realize that Tim is not just Dave’s sideman; he is one of the most talented, amazing, and thoughtful players on the circuit today.\r\n\r\nHaving explored most musical styles, from rock to jazz and flamenco to reggae, Tim makes use of every instrument with his wide-ranging musical ability and rises above the mere mastery of chops to a virtual state of communion with whatever instrument he happens to be holding. He is a self-taught master of the sitar, solo jazz guitar, solo djembe, twelve string guitar, violin, and mandolin, along with his acoustic and electric guitars. His many influences, which include Carlos Santana, Jimi Hendrix, Bob Marley, and Led Zeppelin, among others, are indirectly felt in the fabric of Tim’s power trio and solo projects.\r\n\r\nAfter living in New Mexico for the last eight years, Tim recently relocated to the Outer Banks of North Carolina where he ran across two musicians, bass player Mick Vaughn and drummer Dan Martier, who would eventually form this latest version of TR3, his favorite project. After a chance meeting of these three talented players, a few rehearsals and several stealth appearances around the North Carolina shore Tim realized it was time to get back to the basics of rocking out the way only Tim can. Once again things have come full circle and TR3 is back to rock and funk the house down. Their songs are a mix of updated Tim classics to wild covers of everything from James Brown to Prince to TR3′s newest catalogue of material.',	'0.47',	'0.23',	'1',	'0',	'0',	'3511194b951d407bd046e995739a27059c6b15b5'),
