(2602,	422,	90,	'image',	'1413908802',	NULL,	'Eminem x Carhartt Hoodie',	'Eminem is proud to announce a partnership with Detroit\'s own Carhartt for a limited edition zip-front hoodie.  Limited to only 500 units total.  To benefit the next generation of Detroit\'s youth, 100% of the proceeds will benefit the Marshall Mathers Foundation, whose mission is to provide assistance to disadvantage and at-risk youth in the city and it\'s surrounding communities. ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'1413908717.png',	'480',	'270',	'1413908717.png',	'480',	'270',	'1413908717.png',	'480',	'270',	'1413908717.png',	'480',	'270',	'1413908717.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TkYjk',	'Eminem is proud to announce a partnership with Detroit\'s own Carhartt for a limited edition zip-front hoodie.  Limited to only 500 units total.  To benefit the next generation of Detroit\'s youth, 100% of the proceeds will benefit the Marshall Mathers Foundation, whose mission is to provide assistance to disadvantage and at-risk youth in the city and it\'s surrounding communities. ',	'0.75',	'0.49',	'1',	'0',	'0',	'd616b404cc2e416bc2695f96cef0011949961425'),
