(2604,	422,	90,	'image',	'1413908945',	NULL,	'Eminem X Detroit Tigers Official Fitted Cap',	'To commemorate Eminem\'s home performance at Comerica Park during The Monster Tour, we partnered with the Detroit Tigers to make Official Eminem New Era hats and Majestic Jerseys. Very special item, available in very limited quantities one time only! These jerseys and hats were only sold at the Detroit Comerica Park shows, but we were able to make some available for those that couldn\'t be there. \r\n\r\nGet a piece of The Monster Tour with this limited edition Detroit Tigers New Era Fitted Cap. This cap features a custom patch on the side commemorating The Monster Tour, featuring the iconic Eminem Logo and the Detroit \"D\".\r\n\r\nVery special item, available in limited quantities one time only!',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'1413908930.png',	'480',	'270',	'1413908930.png',	'480',	'270',	'1413908930.png',	'480',	'270',	'1413908930.png',	'480',	'270',	'1413908930.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TkVEf',	'To commemorate Eminem\'s home performance at Comerica Park during The Monster Tour, we partnered with the Detroit Tigers to make Official Eminem New Era hats and Majestic Jerseys. Very special item, available in very limited quantities one time only! These jerseys and hats were only sold at the Detroit Comerica Park shows, but we were able to make some available for those that couldn\'t be there. \r\n\r\nGet a piece of The Monster Tour with this limited edition Detroit Tigers New Era Fitted Cap. This cap features a custom patch on the side commemorating The Monster Tour, featuring the iconic Eminem Logo and the Detroit \"D\".\r\n\r\nVery special item, available in limited quantities one time only!',	'0.44',	'0.53',	'1',	'0',	'0',	'368dcd7d649eb0e7066ea300f3dece562d9977b0'),
