(2710,	449,	91,	'video',	'1418366341',	NULL,	'‘We Gotta Pray’',	'From the NYTimes: \r\n\r\nWhile Alicia Keys is known for her unabashed celebration of New York on Jay Z’s “Empire State of Mind,” she released another kind of anthem on Wednesday night: “We Gotta Pray,” which protests a Staten Island grand jury’s decision not to indict a New York police officer in the death of Eric Garner.\r\n\r\nHer three-minute song pleads for strength and peaceful protest, and an accompanying video combines photos of civil rights protests from the past and present with quotes from the Rev. Dr. Martin Luther King Jr. and Gandhi. Near the end of the video, a portrait of Mr. Garner appears for nearly 10 seconds.',	'0',	'',	'',	'vastvideo14183659844.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'139.19621749409',	'1418366302.png',	'512',	'278.39243498818',	'1418366302.png',	'',	'',	'',	'',	'',	'',	'846',	'460',	'1418366302.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/2koe9Hg',	'From the NYTimes: \r\n\r\nWhile Alicia Keys is known for her unabashed celebration of New York on Jay Z’s “Empire State of Mind,” she released another kind of anthem on Wednesday night: “We Gotta Pray,” which protests a Staten Island grand jury’s decision not to indict a New York police officer in the death of Eric Garner.\r\n\r\nHer three-minute song pleads for strength and peaceful protest, and an accompanying video combines photos of civil rights protests from the past and present with quotes from the Rev. Dr. Martin Luther King Jr. and Gandhi. Near the end of the video, a portrait of Mr. Garner appears for nearly 10 seconds.',	'0.53',	'0.18',	'1',	'0',	'0',	'f506fdefcfaffffb38f8e5a761b766462eccbdd9'),
