(2722,	452,	91,	'image',	'1418367400',	NULL,	'Songs in A Minor',	'The original release of Songs in A Minor sold more than 12 million albums worldwide and garnered five,Grammy® Awards including Best New Artist, Best Song of the Year  for “Fallin,” and Best R&B Album. Rediscover this seminal album and explore previously unreleased and original bonus material featured on the 10th Anniversary Editions. The Deluxe Edition two-disc set and Collector’s Edition three-disc set will feature very special packaging and the Collector’s Edition will also include a documentary specifically created for this release based on the making of Songs in A Minor. For the first time, a vinyl version of the original album will also be made available.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'254.6455026455',	'1418367370.jpg',	'378',	'376',	'1418367370.jpg',	'378',	'376',	'1418367370.jpg',	'378',	'376',	'1418367370.jpg',	'378',	'376',	'1418367370.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/2kog1zH',	'The original release of Songs in A Minor sold more than 12 million albums worldwide and garnered five,Grammy® Awards including Best New Artist, Best Song of the Year  for “Fallin,” and Best R&B Album. Rediscover this seminal album and explore previously unreleased and original bonus material featured on the 10th Anniversary Editions. The Deluxe Edition two-disc set and Collector’s Edition three-disc set will feature very special packaging and the Collector’s Edition will also include a documentary specifically created for this release based on the making of Songs in A Minor. For the first time, a vinyl version of the original album will also be made available.',	'0.65',	'0.18',	'1',	'0',	'0',	'9408211327366e4983250fed5b3a56b1a3e73d36'),
