(2798,	479,	88,	'image',	'1418857358',	NULL,	'About the Foundation',	'The charitable purposes of the Herb Ritts Foundation focus on two main objectives. First, it is continuing Herb\'s longstanding support of HIV/AIDS research. The Foundation is instrumental in helping fund organizations that provide assistance and care for individuals with HIV and AIDS. It is equally important for the Foundation to advocate continued awareness of AIDS and its devastating impact on all continents, with an emphasis on how we can all contribute to finding a cure for this disease.\r\n\r\nThe Foundation\'s second objective is to support Herb\'s great passion for photography and other forms of art. It offers assistance to institutions with education programs that advance the art of photography. With the great success of the \'Work\' exhibition at the Museum of Fine Arts, Boston, Herb felt it essential to have the Foundation fund future museum exhibitions of photography and other visual art forms.\r\n\r\nIn addition to the Foundation\'s charitable work, it is responsible for maintaining Herb\'s legacy by organizing exhibitions of his work, publishing books and catalogues, preserving the archive of editioned prints and maintaining the integrity of the editions established during his lifetime. The net revenue proceeds from the sales of Herb Ritts\' work is being used to support and insure the directives of the Foundation and its future contributions.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'143.16433121019',	'1418857327.jpg',	'512',	'286.32866242038',	'1418857327.jpg',	'785',	'439',	'1418857327.jpg',	'785',	'439',	'1418857327.jpg',	'785',	'439',	'1418857327.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TjLbQ',	'The charitable purposes of the Herb Ritts Foundation focus on two main objectives. First, it is continuing Herb\'s longstanding support of HIV/AIDS research. The Foundation is instrumental in helping fund organizations that provide assistance and care for individuals with HIV and AIDS. It is equally important for the Foundation to advocate continued awareness of AIDS and its devastating impact on all continents, with an emphasis on how we can all contribute to finding a cure for this disease.\r\n\r\nThe Foundation\'s second objective is to support Herb\'s great passion for photography and other forms of art. It offers assistance to institutions with education programs that advance the art of photography. With the great success of the \'Work\' exhibition at the Museum of Fine Arts, Boston, Herb felt it essential to have the Foundation fund future museum exhibitions of photography and other visual art forms.\r\n\r\nIn addition to the Foundation\'s charitable work, it is responsible for maintaining Herb\'s legacy by organizing exhibitions of his work, publishing books and catalogues, preserving the archive of editioned prints and maintaining the integrity of the editions established during his lifetime. The net revenue proceeds from the sales of Herb Ritts\' work is being used to support and insure the directives of the Foundation and its future contributions.',	'0.4',	'0.41',	'1',	'0',	'0',	'02c8b3b62bef9ede9850407c83c50e827b952d78'),
