(2805,	482,	74,	'image',	'1418817360',	NULL,	'A Photographer\'s Life',	'Annie Leibovitz: A Photographer\'s Life, 1990–2005 includes over 150 photographs by the celebrated photographer, encompassing well-known work made on editorial assignment as well as personal photographs of her family and close friends. \"I don\'t have two lives,\" Leibovitz says. \"This is one life, and the personal pictures and the assignment work are all part of it.\" \r\n\r\nThis image is of Mikhail Baryshnikov and Rob Besserer, Cumberland Island, Georgia, 1990',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'287.28888888889',	'1418860992.jpg',	'512',	'574.57777777778',	'1418860992.jpg',	'540',	'606',	'1418860992.jpg',	'540',	'606',	'1418860992.jpg',	'540',	'606',	'1418860992.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MWspi',	'Annie Leibovitz: A Photographer\'s Life, 1990–2005 includes over 150 photographs by the celebrated photographer, encompassing well-known work made on editorial assignment as well as personal photographs of her family and close friends. \"I don\'t have two lives,\" Leibovitz says. \"This is one life, and the personal pictures and the assignment work are all part of it.\" \r\n\r\nThis image is of Mikhail Baryshnikov and Rob Besserer, Cumberland Island, Georgia, 1990',	'0.56',	'0.22',	'1',	'0',	'0',	'2e6dfe876ccd31e41e791a4a87e5e06ea6f2e9f9'),
(2806,	482,	74,	'image',	'1418861247',	NULL,	'ArtScience Museum in Singapore',	'Leibovitz, who is known particularly for photographing celebrities for magazines like Vanity Fair and Vogue, will be showcasing her portraits of stars such as Leonardo Di Caprio, Brad Pitt, Jamie Foxx, the pregnant Demi Moore, Scarlett Johansson and Nicole Kidman. The exhibition will also include Leibovitz’s reportage from the siege of Sarajevo in the 1990s and the election of Hillary Clinton to the United States Senate.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'192',	'1418861205.JPG',	'512',	'384',	'1418861205.JPG',	'560',	'420',	'1418861205.JPG',	'560',	'420',	'1418861205.JPG',	'560',	'420',	'1418861205.JPG',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXotL',	'Leibovitz, who is known particularly for photographing celebrities for magazines like Vanity Fair and Vogue, will be showcasing her portraits of stars such as Leonardo Di Caprio, Brad Pitt, Jamie Foxx, the pregnant Demi Moore, Scarlett Johansson and Nicole Kidman. The exhibition will also include Leibovitz’s reportage from the siege of Sarajevo in the 1990s and the election of Hillary Clinton to the United States Senate.',	'0.2',	'0.38',	'1',	'0',	'0',	'baa15daab481d1f7884375adf125a06a2d701929'),
(2807,	482,	74,	'image',	'1418861314',	NULL,	'Pilgrimage',	'Annie Leibovitz: Pilgrimage charts a new direction for one of America’s best-known living photographers. Unlike her staged and carefully lit portraits made on assignment for magazines and advertising clients, the photographs in this exhibition were taken simply because Leibovitz was moved by the subject. The images speak in a commonplace language to the photographer’s curiosity about the world she inherited, spanning landscapes both dramatic and quiet, interiors of living rooms and bedrooms, and objects that are talismans of past lives.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.66666666667',	'1418861292.jpg',	'512',	'341.33333333333',	'1418861292.jpg',	'555',	'370',	'1418861292.jpg',	'555',	'370',	'1418861292.jpg',	'555',	'370',	'1418861292.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXi5p',	'Annie Leibovitz: Pilgrimage charts a new direction for one of America’s best-known living photographers. Unlike her staged and carefully lit portraits made on assignment for magazines and advertising clients, the photographs in this exhibition were taken simply because Leibovitz was moved by the subject. The images speak in a commonplace language to the photographer’s curiosity about the world she inherited, spanning landscapes both dramatic and quiet, interiors of living rooms and bedrooms, and objects that are talismans of past lives.',	'0.65',	'0.54',	'1',	'0',	'0',	'9f9e913fcb4bafa381f84f1f192ed883624c1df1'),
