(2813,	486,	84,	'image',	'1418862784',	NULL,	'Cristiano Ronaldo wins BBC Overseas Sports Personality award',	' The 29-year-old former Manchester United star was named world player of the year 11 months ago.\r\n\r\n\"Thank you BBC for choosing me and to my old fans in England. Thank you very much,\" said Ronaldo, who has scored 281 goals in 267 matches for Real.\r\n\r\nHe won the award ahead of tennis player Serena Williams, boxer Floyd Mayweather and MotoGP rider Marc Marquez. ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'1418862748.jpg',	'512',	'288',	'1418862748.jpg',	'640',	'360',	'1418862748.jpg',	'640',	'360',	'1418862748.jpg',	'640',	'360',	'1418862748.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXjWU',	' The 29-year-old former Manchester United star was named world player of the year 11 months ago.\r\n\r\n\"Thank you BBC for choosing me and to my old fans in England. Thank you very much,\" said Ronaldo, who has scored 281 goals in 267 matches for Real.\r\n\r\nHe won the award ahead of tennis player Serena Williams, boxer Floyd Mayweather and MotoGP rider Marc Marquez. ',	'0.66',	'0.23',	'1',	'0',	'0',	'6da4866863c640c437e1c859216deb9158677460'),
(2814,	486,	84,	'image',	'1418862984',	NULL,	'Cristiano Ronaldo and co train in Morocco ahead of World Club Cup semi-final',	'Real Madrid prepared for their World Club Cup semi-final against Cruz Azul on Tuesday by training in Rabat - the city which was meant to host the game, before heading south for the re-arranged fixture.\r\n\r\nOver 1000 fans turned up to watch the European Champions, who are many locals\' preferred team after Moroccan side Moghreb Tetouan were knocked out last Wednesday. \r\n\r\nTuesday\'s clash with Mexican side Cruz Azul has been moved to Marrakech, which will also host Wednesday\'s semi-final and the competitions final. ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'224.10094637224',	'1418862937.jpg',	'512',	'448.20189274448',	'1418862937.jpg',	'634',	'555',	'1418862937.jpg',	'634',	'555',	'1418862937.jpg',	'634',	'555',	'1418862937.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MX524',	'Real Madrid prepared for their World Club Cup semi-final against Cruz Azul on Tuesday by training in Rabat - the city which was meant to host the game, before heading south for the re-arranged fixture.\r\n\r\nOver 1000 fans turned up to watch the European Champions, who are many locals\' preferred team after Moroccan side Moghreb Tetouan were knocked out last Wednesday. \r\n\r\nTuesday\'s clash with Mexican side Cruz Azul has been moved to Marrakech, which will also host Wednesday\'s semi-final and the competitions final. ',	'0.52',	'0.15',	'1',	'0',	'0',	'a1ad6fdbc033d5132f95032ba6a6c019fb9a8372'),
(2815,	486,	84,	'image',	'1418863069',	NULL,	'Cristiano Ronaldo sees \'rabona\' saved at Club World Cup',	'Cristiano Ronaldo pulled off a half-volley \"rabona\" in Real Madrid\'s 4-0 victory over Mexican side Cruz Azul in the Fifa Club World Cup semi-final.\r\n\r\nRonaldo\'s shot was saved by goalkeeper Jose Corona but team-mates Sergio Ramos, Karim Benzema, Gareth Bale and Isco all found the net and helped Madrid secure their 21st successive win.\r\n\r\nReal face either Auckland City or San Lorenzo in Saturday\'s final, with the other semi-final to be played on Wednesday.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'1418863001.png',	'512',	'288',	'1418863001.png',	'640',	'360',	'1418863001.png',	'640',	'360',	'1418863001.png',	'640',	'360',	'1418863001.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25MXy4i',	'Cristiano Ronaldo pulled off a half-volley \"rabona\" in Real Madrid\'s 4-0 victory over Mexican side Cruz Azul in the Fifa Club World Cup semi-final.\r\n\r\nRonaldo\'s shot was saved by goalkeeper Jose Corona but team-mates Sergio Ramos, Karim Benzema, Gareth Bale and Isco all found the net and helped Madrid secure their 21st successive win.\r\n\r\nReal face either Auckland City or San Lorenzo in Saturday\'s final, with the other semi-final to be played on Wednesday.\r\n',	'0.48',	'0.39',	'1',	'0',	'0',	'7da7938915f5e28e225a38ab8fd2e97bf5c4d768'),
