(2860,	496,	98,	'image',	'1421176639',	NULL,	'HOW MANY LIVES WILL THIS YEAR\'S GLOBAL CITIZEN FESTIVAL AFFECT?',	'In short: the lives of up to 259 million people by 2020.\r\nIt’s a wrap for Global Citizen Festival 2014 but our flagship event in Central Park on September 27th 2014 is set to see major impact, making a significant contribution towards making the end of extreme poverty by 2030 a reality, and yet we can’t stop now - we need a movement stronger than ever if we are to achieve this dream.\r\nThis is like directly reaching the entire population of a country that could be the fourth largest on Earth, with only China, India and the United States with larger populations.\r\nWe couldn\'t be more excited to share this snapshot of what happened at the festival but know that there’s way more news to share in the coming weeks. ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421176576.jpg',	'512',	'228.69333333333',	'1421176576.jpg',	'1500',	'670',	'1421176576.jpg',	'1500',	'670',	'1421176576.jpg',	'1024',	'457.38666666667',	'1421176576.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCei7',	'In short: the lives of up to 259 million people by 2020.\r\nIt’s a wrap for Global Citizen Festival 2014 but our flagship event in Central Park on September 27th 2014 is set to see major impact, making a significant contribution towards making the end of extreme poverty by 2030 a reality, and yet we can’t stop now - we need a movement stronger than ever if we are to achieve this dream.\r\nThis is like directly reaching the entire population of a country that could be the fourth largest on Earth, with only China, India and the United States with larger populations.\r\nWe couldn\'t be more excited to share this snapshot of what happened at the festival but know that there’s way more news to share in the coming weeks. ',	'0.51',	'0.46',	'1',	'0',	'0',	'f439d004dfe22d67039932381c6f8f2eb216ed96'),
(2861,	497,	98,	'image',	'1421177225',	NULL,	'Global Poverty Project Commits to Campaigning for the Vaccine Alliance ',	'THE COMMITMENT\r\nFollowing Global Citizen Festival 2013, Global Poverty Project committed to continue campaigning in support of Gavi, the Vaccine Alliance\'s work, calling on donor countries to support its replenishment.\r\nPROGRESS\r\nGlobal Poverty Project worked with Gavi making its replenishment one of the key campaign platforms of the Global Citizen Festival 2014. In May we launched a petition with our friends at the ONE Campaign, calling on world leaders to commit the funds needed to immunize 300 million children from 2015 through to 2020. Over 46,000 global citizens signed the petition and called on U.S. leaders to increase support for vaccines worldwide!\r\nIMPACT\r\nLast week, Judith Rowland and Christina Nunez from the Global Citizen team joined our friends at ONE, Results, and United Nations Foundation to handover the petition signatures. Together, we collected over 148,000 signatures supporting increased access to vaccines worldwide! Along with representatives from our partner organizations we handed over the petition signatures to Raj Shah, Administrator of USAID. Raj Shah seemed delighted to receive the petition signatures and urged us to continue to work with Congress to ensure that the United States makes a strong pledge in support of Gavi.\r\nWHAT HAPPENS NEXT?\r\nIn January, Gavi will host their replenishment conference in Germany. The Global Citizen team will continue to confirm cosponsors for the resolutions supporting Gavi (H.Res.688 and S.Res.578).',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'107.34933333333',	'1421177137.jpg',	'512',	'214.69866666667',	'1421177137.jpg',	'1500',	'629',	'1421177137.jpg',	'1500',	'629',	'1421177137.jpg',	'1024',	'429.39733333333',	'1421177137.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCmOE',	'THE COMMITMENT\r\nFollowing Global Citizen Festival 2013, Global Poverty Project committed to continue campaigning in support of Gavi, the Vaccine Alliance\'s work, calling on donor countries to support its replenishment.\r\nPROGRESS\r\nGlobal Poverty Project worked with Gavi making its replenishment one of the key campaign platforms of the Global Citizen Festival 2014. In May we launched a petition with our friends at the ONE Campaign, calling on world leaders to commit the funds needed to immunize 300 million children from 2015 through to 2020. Over 46,000 global citizens signed the petition and called on U.S. leaders to increase support for vaccines worldwide!\r\nIMPACT\r\nLast week, Judith Rowland and Christina Nunez from the Global Citizen team joined our friends at ONE, Results, and United Nations Foundation to handover the petition signatures. Together, we collected over 148,000 signatures supporting increased access to vaccines worldwide! Along with representatives from our partner organizations we handed over the petition signatures to Raj Shah, Administrator of USAID. Raj Shah seemed delighted to receive the petition signatures and urged us to continue to work with Congress to ensure that the United States makes a strong pledge in support of Gavi.\r\nWHAT HAPPENS NEXT?\r\nIn January, Gavi will host their replenishment conference in Germany. The Global Citizen team will continue to confirm cosponsors for the resolutions supporting Gavi (H.Res.688 and S.Res.578).',	'0.68',	'0.33',	'1',	'0',	'0',	'e5a655eff2a014c7230fd5cde2b541bd74dd8f02'),
(2862,	497,	98,	'image',	'1421177389',	NULL,	'Global Citizens Work to Build Support for the Water for the World Act',	'THE COMMITMENT\r\nThere are currently 1.1 billion people who practice open defecation. I think you’ll agree that that’s unacceptable.\r\nThe Senator Paul Simon Water for the World Act of 2013 would allow the United States Government to more efficiently increase access to water, sanitation, and hygiene. The bill places a focus on increased transparency and monitoring and evaluation that can help ensure that mistakes aren’t repeated and successes become greater.\r\nGLOBAL CITIZENS RESPOND\r\nAs a Global Citizen, you know that water and sanitation programs are some of the best investments that our country can make. The Water for the World Act will help improve the lives of 2.5 billion people in the world who live without a basic latrine every day. So far, global citizens have taken over 35,000 actions by signing this petition to increase access to water and sanitation.\r\nIMPACT\r\nNovember 19 was World Toilet Day. Judith Rowland from the Global Citizen team joined Congressman Blumenauer (D-OR), Congressman Poe (R-TX) and our partners at WaterAid, WASH Advocates, and Millennium Water Alliance for a rally in support of Water for the World Act. Congressman Poe explained, “This is an issue that rises way above politics. It rises way above our U.S. self-interest. We are dealing with people who don’t have access to water – and there are a lot of them!”\r\nLater on World Toilet Day, Senator Durbin (D-IL) and Senator Corker (R-TN) introduced the Water for the World Act in the Senate. “Inadequate access to safe water and sanitation services sickens and kills thousands of children every day, and leads to poverty across the globe,” Senator Durbin said. “But this is no longer simply a global health and development issue—it’s a long-term problem that increasingly threatens our national security. The Senate passed a version of this bill in 2009 and I hope we pass today’s legislation before this crisis reaches a devastating tipping point.”\r\nThe momentum around Water for the World Act is pretty incredible. An unprecedented 107 Members of the House of Representatives have become co-sponsors of this bipartisan bill. Just yesterday, the House Foreign Affairs Committee marked up the Water for the World Act and now the bill is ready for a vote in the House of Representatives.\r\nWHAT\'S NEXT?\r\nIt is super important that global citizens keep up the momentum to ensure that the Water for the World Act passes this year! Now that the bill has been marked up in the House, it is vital that we rally Members of Congress to be ready to vote ‘yes’ on the Water for the World Act!\r\nWe’ll keep you updated when we have more news!',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421177316.jpg',	'512',	'228.69333333333',	'1421177316.jpg',	'1500',	'670',	'1421177316.jpg',	'1500',	'670',	'1421177316.jpg',	'1024',	'457.38666666667',	'1421177316.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBXvD',	'THE COMMITMENT\r\nThere are currently 1.1 billion people who practice open defecation. I think you’ll agree that that’s unacceptable.\r\nThe Senator Paul Simon Water for the World Act of 2013 would allow the United States Government to more efficiently increase access to water, sanitation, and hygiene. The bill places a focus on increased transparency and monitoring and evaluation that can help ensure that mistakes aren’t repeated and successes become greater.\r\nGLOBAL CITIZENS RESPOND\r\nAs a Global Citizen, you know that water and sanitation programs are some of the best investments that our country can make. The Water for the World Act will help improve the lives of 2.5 billion people in the world who live without a basic latrine every day. So far, global citizens have taken over 35,000 actions by signing this petition to increase access to water and sanitation.\r\nIMPACT\r\nNovember 19 was World Toilet Day. Judith Rowland from the Global Citizen team joined Congressman Blumenauer (D-OR), Congressman Poe (R-TX) and our partners at WaterAid, WASH Advocates, and Millennium Water Alliance for a rally in support of Water for the World Act. Congressman Poe explained, “This is an issue that rises way above politics. It rises way above our U.S. self-interest. We are dealing with people who don’t have access to water – and there are a lot of them!”\r\nLater on World Toilet Day, Senator Durbin (D-IL) and Senator Corker (R-TN) introduced the Water for the World Act in the Senate. “Inadequate access to safe water and sanitation services sickens and kills thousands of children every day, and leads to poverty across the globe,” Senator Durbin said. “But this is no longer simply a global health and development issue—it’s a long-term problem that increasingly threatens our national security. The Senate passed a version of this bill in 2009 and I hope we pass today’s legislation before this crisis reaches a devastating tipping point.”\r\nThe momentum around Water for the World Act is pretty incredible. An unprecedented 107 Members of the House of Representatives have become co-sponsors of this bipartisan bill. Just yesterday, the House Foreign Affairs Committee marked up the Water for the World Act and now the bill is ready for a vote in the House of Representatives.\r\nWHAT\'S NEXT?\r\nIt is super important that global citizens keep up the momentum to ensure that the Water for the World Act passes this year! Now that the bill has been marked up in the House, it is vital that we rally Members of Congress to be ready to vote ‘yes’ on the Water for the World Act!\r\nWe’ll keep you updated when we have more news!',	'0.19',	'0.23',	'1',	'0',	'0',	'ccc7bdf68aaf6e953f8ab3c6d7af1cfc2187e5e4'),
(2863,	497,	98,	'image',	'1421177463',	NULL,	'The UK Commits to Saving 1.4 Million Children\'s Lives',	'WHAT’S THE ISSUE?\r\nGavi, the Vaccine Alliance, aims to immunise the world\'s poorest children against some of its deadliest killers. Since it started in 2000, Gavi has immunised nearly half a billion people and saved six million lives - but their fight isn’t over. From 2016 to 2020 they have set an ambitious target of saving another five to six million lives - equalling the last 15 years but delivering this in just five. To do this they needed the support of global citizens.\r\nGLOBAL CITIZENS RESPOND\r\nThis year, Global Citizen has been campaigning with partner charities advocating for  the UK Government to commit to saving children\'s lives through vaccinations by funding Gavi, the Vaccine Alliance.\r\nGlobal Citizen UK joined forces with the One Campaign, Save the Children UK and Results UK to campaign for the UK Government to commit to spending £1.2 billion on Gavi for the 2016 strategy. In light of the UK being the biggest country donor already, we asked for £1.2 billion to help ensure Gavi reaches their total ask of $7 billion.\r\nGlobal citizens from around the world took over 1000 actions to achieve this significant campaign result. Emails and Tweets, directed at both the Secretary of State for International Development and the Prime Minister, asked for the UK to continue to be a major donor for Gavi. These actions were very effective, as the Secretary of State confirmed global citizens’ tweets helped influence her decision.\r\nWHAT’S THE IMPACT?\r\nThrough the hard work of global citizens from around the world, on 27 November 2014,  the UK government announced a commitment of up to £1 billion to help in the fight against preventable child deaths. We estimate that this commitment could affect almost 63 million children’s lives by reaching them with vaccines - and the UK government states that this commitment will save 1.4 million lives.\r\nWhile this commitment of up to £1 billion is slightly under our £1.2 billion ask, it is still something global citizens can really celebrate.\r\nWHAT’S NEXT?\r\nFor global citizens, the campaign isn’t over. We now move our attention to other countries who are yet to commit. Following some fantastic early commitments from countries like UK and Canada, we will mobilise to ensure the U.S. and Germany also make commitments to Gavi, and that when they do, these are substantial and meaningful contributions to the replenishment plan.\r\nThis is particularly important as the UK government has capped its commitment of £1 billion to a maximum of 26% of the total Gavi replenishment ask of $7.5 billion. So its really important we continue to push  this campaign in other donor countries to maximise the impact for child survival.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421177418.jpg',	'512',	'228.69333333333',	'1421177418.jpg',	'1500',	'670',	'1421177418.jpg',	'1500',	'670',	'1421177418.jpg',	'1024',	'457.38666666667',	'1421177418.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCyxo',	'WHAT’S THE ISSUE?\r\nGavi, the Vaccine Alliance, aims to immunise the world\'s poorest children against some of its deadliest killers. Since it started in 2000, Gavi has immunised nearly half a billion people and saved six million lives - but their fight isn’t over. From 2016 to 2020 they have set an ambitious target of saving another five to six million lives - equalling the last 15 years but delivering this in just five. To do this they needed the support of global citizens.\r\nGLOBAL CITIZENS RESPOND\r\nThis year, Global Citizen has been campaigning with partner charities advocating for  the UK Government to commit to saving children\'s lives through vaccinations by funding Gavi, the Vaccine Alliance.\r\nGlobal Citizen UK joined forces with the One Campaign, Save the Children UK and Results UK to campaign for the UK Government to commit to spending £1.2 billion on Gavi for the 2016 strategy. In light of the UK being the biggest country donor already, we asked for £1.2 billion to help ensure Gavi reaches their total ask of $7 billion.\r\nGlobal citizens from around the world took over 1000 actions to achieve this significant campaign result. Emails and Tweets, directed at both the Secretary of State for International Development and the Prime Minister, asked for the UK to continue to be a major donor for Gavi. These actions were very effective, as the Secretary of State confirmed global citizens’ tweets helped influence her decision.\r\nWHAT’S THE IMPACT?\r\nThrough the hard work of global citizens from around the world, on 27 November 2014,  the UK government announced a commitment of up to £1 billion to help in the fight against preventable child deaths. We estimate that this commitment could affect almost 63 million children’s lives by reaching them with vaccines - and the UK government states that this commitment will save 1.4 million lives.\r\nWhile this commitment of up to £1 billion is slightly under our £1.2 billion ask, it is still something global citizens can really celebrate.\r\nWHAT’S NEXT?\r\nFor global citizens, the campaign isn’t over. We now move our attention to other countries who are yet to commit. Following some fantastic early commitments from countries like UK and Canada, we will mobilise to ensure the U.S. and Germany also make commitments to Gavi, and that when they do, these are substantial and meaningful contributions to the replenishment plan.\r\nThis is particularly important as the UK government has capped its commitment of £1 billion to a maximum of 26% of the total Gavi replenishment ask of $7.5 billion. So its really important we continue to push  this campaign in other donor countries to maximise the impact for child survival.',	'0.48',	'0.61',	'1',	'0',	'0',	'a11113894e342c46329d08b02ea7b6450493524b'),
(2864,	497,	98,	'image',	'1421177643',	NULL,	'Canada Commits CAN $500 MILLION to Gavi, the Vaccine Alliance ',	'WHAT’S THE ISSUE\r\nGavi, the Vaccine Alliance is seeking replenishment funds from donor countries for 2016-2020. They have the ambitious target of reaching 300 million children with life saving vaccines over that five year period, cutting distribution time by half against previous targets. To ensure this goal is achieved, it was crucial that Canada, a longtime key supporter of the Vaccine Alliance\'s critical work, stepped up to the plate with a strong financial commitment.\r\nHOW DID GLOBAL CITIZENS RESPOND?\r\nGlobal Citizens set to work increasing the Canadian government’s awareness of the tremendous impact of funding vaccinations as part of an effective sustainable foreign aid strategy. Global Citizens in partnership with the ONE campaign made their voices heard through a global petition that generated over 46,000 signatures, calling for a strong commitment of CAN $500 million. Global Citizen also coordinated strong political advocacy in Canada, reaching out through the Global Citizen Festival and demonstrating to Canada that the world is committed to supporting Gavi’s ambition to reach 300 million children with life giving vaccines.\r\nWHAT’S THE IMPACT?\r\nAt the Francophone Summit on November 28, Canadian Prime Minister announced that Canada would be committing $500 million, the full amount called for by Global Citizens and Canadian NGOs, towards Gavi, the Vaccine Alliance. In the current economic climate, where many donor countries are cutting their aid budgets or finding commitments increasingly difficult to justify, this win is something for Canadian and all Global Citizens to celebrate. Especially since this donation was made ahead of the January 2015 replenishment conference, not only will this commitment make a significant contribution, it will also help build crucial momentum towards Gavi reaching its full funding goal. If Gavi is successful in reaching the total goal, the vaccines distributed will save between 5 and 6 million additional lives between 2016 and 2020. The Canadian donation will contribute to Gavi’s goal - our estimate is that Canada’s donation is set to affect the lives of nearly 17.5 million children by immunizing them.\r\nWHAT HAPPENS NEXT?\r\nAs the Vaccine Alliance prepares to convene donor countries in Berlin in January for the global replenishment conference, it is crucial that donor countries, including the United States, follow the examples set by countries like Canada and the UK\'s through their early strong financial commitments.Only then will Gavi  be successful in seeking to increase its reach, and make sure that no child lacks access to basic, life-saving immunizations.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421177545.jpg',	'512',	'228.69333333333',	'1421177545.jpg',	'1500',	'670',	'1421177545.jpg',	'1500',	'670',	'1421177545.jpg',	'1024',	'457.38666666667',	'1421177545.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCcqA',	'WHAT’S THE ISSUE\r\nGavi, the Vaccine Alliance is seeking replenishment funds from donor countries for 2016-2020. They have the ambitious target of reaching 300 million children with life saving vaccines over that five year period, cutting distribution time by half against previous targets. To ensure this goal is achieved, it was crucial that Canada, a longtime key supporter of the Vaccine Alliance\'s critical work, stepped up to the plate with a strong financial commitment.\r\nHOW DID GLOBAL CITIZENS RESPOND?\r\nGlobal Citizens set to work increasing the Canadian government’s awareness of the tremendous impact of funding vaccinations as part of an effective sustainable foreign aid strategy. Global Citizens in partnership with the ONE campaign made their voices heard through a global petition that generated over 46,000 signatures, calling for a strong commitment of CAN $500 million. Global Citizen also coordinated strong political advocacy in Canada, reaching out through the Global Citizen Festival and demonstrating to Canada that the world is committed to supporting Gavi’s ambition to reach 300 million children with life giving vaccines.\r\nWHAT’S THE IMPACT?\r\nAt the Francophone Summit on November 28, Canadian Prime Minister announced that Canada would be committing $500 million, the full amount called for by Global Citizens and Canadian NGOs, towards Gavi, the Vaccine Alliance. In the current economic climate, where many donor countries are cutting their aid budgets or finding commitments increasingly difficult to justify, this win is something for Canadian and all Global Citizens to celebrate. Especially since this donation was made ahead of the January 2015 replenishment conference, not only will this commitment make a significant contribution, it will also help build crucial momentum towards Gavi reaching its full funding goal. If Gavi is successful in reaching the total goal, the vaccines distributed will save between 5 and 6 million additional lives between 2016 and 2020. The Canadian donation will contribute to Gavi’s goal - our estimate is that Canada’s donation is set to affect the lives of nearly 17.5 million children by immunizing them.\r\nWHAT HAPPENS NEXT?\r\nAs the Vaccine Alliance prepares to convene donor countries in Berlin in January for the global replenishment conference, it is crucial that donor countries, including the United States, follow the examples set by countries like Canada and the UK\'s through their early strong financial commitments.Only then will Gavi  be successful in seeking to increase its reach, and make sure that no child lacks access to basic, life-saving immunizations.',	'0.41',	'0.62',	'1',	'0',	'0',	'd3baee045ca966372650b3919bbb22b5b0d2e31e'),
(2865,	497,	98,	'image',	'1421177734',	NULL,	'British Global Citizens Campaign to Protect Aid',	'THE COMMITMENT\r\nIn 1970 the U.N General Assembly set a bold target to eliminate extreme global poverty. They proposed that those countries who had richer, more developed economies should aim to contribute at least 0.7% of their gross national income on international aid and development.\r\nFast forward to 2014 and for the very first time in it’s history, the UK Government met the 0.7 target, making it the first ever G7 country to do so. UK aid is saving a life every two minutes and, since 2011, has provided 43.1 million people with access to clean water, better sanitation or improved hygiene conditions. This is only possible with the continued funding and commitment to development from the UK Government. Earlier in 2014, an MP named Michael Moore brought forward a bill in Parliament that would enshrine into law that the UK aid budget is maintained at its current level.\r\n36 organisations including Oxfam and Save the Children rallied together across 2014 to support this bill, forming the #turnupsavelives coalition, mobilising thousands of supporters from around the United Kingdom to support the final push to 0.7% a long running aim for our sector. Take a look at the coalition website here: http://www.turnupsavelives.org.uk/\r\nGLOBAL CITIZENS RESPOND\r\nGlobal citizens set to work on applying pressure on MPs to turn up to parliamentary readings and vote. Hundreds of emails were sent to MPs all across the UK from global citizens who wanted their MPs to #turnupsavelives. Social media campaigning also had an impact by applying pressure to a number of MPs who were unsure of turning up for both the second and third reading of the bill. Global citizens played a significant part of this campaign that included organisations such as Save the Children and One, and working together, ensured that this important bill was passed through the Commons.\r\nTHE IMPACT\r\nWe’re not quite there yet but 0.7% has been passed through the House of Commons which is a significant milestone in the journey to enshrining the UK aid budget in law. Once it has passed through the House of Lords, an annual guaranteed budget of 0.7% GNI will mean that international aid will no-longer be a political football kicked around from newspaper to newspaper and  party to party for criticism and cuts. Instead, it will mean that the UK Government can start focusing on the quality of our international aid over time rather than its quantify at any given moment. Stability in the budget will also enable better quality planning, which will further boost effectiveness and the efficiency of aid, potentially making our tax development pounds go further towards ending extreme poverty than ever before.\r\nWHAT HAPPENS NEXT?\r\nBecause 0.7% still needs to progress through the House of Lords, global citizens still need to continue making the case for this bill and the significant impact it can have if written into law. We will be contacting UK global citizens shortly on how we can keep the momentum up and make sure that the UK leads the way by putting this development commitment into law.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421177673.jpg',	'512',	'228.69333333333',	'1421177673.jpg',	'1500',	'670',	'1421177673.jpg',	'1500',	'670',	'1421177673.jpg',	'1024',	'457.38666666667',	'1421177673.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCpKq',	'THE COMMITMENT\r\nIn 1970 the U.N General Assembly set a bold target to eliminate extreme global poverty. They proposed that those countries who had richer, more developed economies should aim to contribute at least 0.7% of their gross national income on international aid and development.\r\nFast forward to 2014 and for the very first time in it’s history, the UK Government met the 0.7 target, making it the first ever G7 country to do so. UK aid is saving a life every two minutes and, since 2011, has provi