(2870,	499,	98,	'image',	'1421179046',	NULL,	'8 Reasons Why Nutritious Food Helps Break the Cycle of Extreme Poverty',	'1. When mothers have access to nutritious food, they are more likely to have healthy, well-nourished newborn babies. And that’s big, because...\r\n2. Nearly half (45%) of all deaths of young children can be avoided when they are well-nourished.\r\n3. Good nutrition can prevent stunting which occurs when children are unable to reach their optimal linear grown as a result of under and malnutrition. Sadly, stunting is a reality for approximately 165 million children under the age of 5, or 1 in 4, so addressing this issue is huge.\r\n4. Well-nourished kids will enjoy more physical activity, be more resistant to infection, and will see a decrease in morbidity and mortality.\r\n5. But the benefits of nutrition extend well beyond health. Children with access to nutritious food will reach their mental development potential and educational capacity. Simply put, they will attend school earlier, learn more, and postpone dropping out.\r\n6. Consequently, they will marry and have children later, and give birth to healthier babies.\r\n7. And as adults, they will see an increase in productivity, earn more in their jobs, and manage risk better.\r\n8. Now here’s the icing on the cake: with access to solid nutrition, low and middle-income countries stand to add up to 8% of potential economic growth.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421178909.jpg',	'512',	'228.69333333333',	'1421178909.jpg',	'1500',	'670',	'1421178909.jpg',	'1500',	'670',	'1421178909.jpg',	'1024',	'457.38666666667',	'1421178909.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBQjQ',	'1. When mothers have access to nutritious food, they are more likely to have healthy, well-nourished newborn babies. And that’s big, because...\r\n2. Nearly half (45%) of all deaths of young children can be avoided when they are well-nourished.\r\n3. Good nutrition can prevent stunting which occurs when children are unable to reach their optimal linear grown as a result of under and malnutrition. Sadly, stunting is a reality for approximately 165 million children under the age of 5, or 1 in 4, so addressing this issue is huge.\r\n4. Well-nourished kids will enjoy more physical activity, be more resistant to infection, and will see a decrease in morbidity and mortality.\r\n5. But the benefits of nutrition extend well beyond health. Children with access to nutritious food will reach their mental development potential and educational capacity. Simply put, they will attend school earlier, learn more, and postpone dropping out.\r\n6. Consequently, they will marry and have children later, and give birth to healthier babies.\r\n7. And as adults, they will see an increase in productivity, earn more in their jobs, and manage risk better.\r\n8. Now here’s the icing on the cake: with access to solid nutrition, low and middle-income countries stand to add up to 8% of potential economic growth.\r\n',	'0.54',	'0.37',	'1',	'0',	'0',	'38c4ce668969a07e6dc0e3becbdf6ff96b5254d2'),
(2871,	499,	98,	'image',	'1421179297',	NULL,	'Global Survey Says We\'re Eating Better, but Our Diet is Still Unsustainable ',	'More people are eating local and organic foods and plan to consume less meat and bottled water. However, most also believe they lack enough information and influence to become more environmentally sustainable consumers, a new National Geographic survey has found.\r\nThe latest Greendex survey by the National Geographic Society and the research consulting firm GlobeScan measured consumption habits and attitudes in 18 countries. Each was scored on the relative size of its environmental footprint. (Related: 8 Surprising, Depressing, and Hopeful Findings From Global Survey of Environmental Attitudes.)\r\nThis year\'s report, the fifth since 2008, focused on food. It found noticeable improvements in eating habits even as environmentally sustainable behavior when it came to housing, transportation, and consumer goods appeared stuck or had worsened.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421179211.jpg',	'512',	'228.69333333333',	'1421179211.jpg',	'1500',	'670',	'1421179211.jpg',	'1500',	'670',	'1421179211.jpg',	'1024',	'457.38666666667',	'1421179211.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBTfy',	'More people are eating local and organic foods and plan to consume less meat and bottled water. However, most also believe they lack enough information and influence to become more environmentally sustainable consumers, a new National Geographic survey has found.\r\nThe latest Greendex survey by the National Geographic Society and the research consulting firm GlobeScan measured consumption habits and attitudes in 18 countries. Each was scored on the relative size of its environmental footprint. (Related: 8 Surprising, Depressing, and Hopeful Findings From Global Survey of Environmental Attitudes.)\r\nThis year\'s report, the fifth since 2008, focused on food. It found noticeable improvements in eating habits even as environmentally sustainable behavior when it came to housing, transportation, and consumer goods appeared stuck or had worsened.',	'0.54',	'0.3',	'1',	'0',	'0',	'34d685de1a56d85036f4774a2b4ef396953a9a7d'),
(2872,	499,	98,	'image',	'1421179385',	NULL,	'Malnutrition Prompts United Nations to Create New Body',	'The hunger problem in the world isn’t just about people who don’t have enough to eat. There’s also a second category; people who do get to eat each day, but who don’t have access to a balanced diet that contains the nutrients needed to be healthy and productive. An example of this could be someone who has two meals of rice and a thin soup per day. They’re not necessarily hungry in the “empty stomach” sense of the word, but without vitamins, protein, and minerals, they’re going to lack the vigour to concentrate at school or work, and will be vulnerable to illnesses. It’s a recipe for getting stuck in poverty, and it can hold back entire communities and nations from achieving their potential.\r\n \r\nThat’s why addressing malnutrition is important in the fight to end extreme poverty, and the UN agrees. Reports have emerged in recent days that the UN is in the process of creating a new body, which might be named UN Nutrition. It is expected that the new organisation will be headed by UNICEF and the World Food Program.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'107.52',	'1421179339.jpg',	'512',	'215.04',	'1421179339.jpg',	'1500',	'630',	'1421179339.jpg',	'1500',	'630',	'1421179339.jpg',	'1024',	'430.08',	'1421179339.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBSZ4',	'The hunger problem in the world isn’t just about people who don’t have enough to eat. There’s also a second category; people who do get to eat each day, but who don’t have access to a balanced diet that contains the nutrients needed to be healthy and productive. An example of this could be someone who has two meals of rice and a thin soup per day. They’re not necessarily hungry in the “empty stomach” sense of the word, but without vitamins, protein, and minerals, they’re going to lack the vigour to concentrate at school or work, and will be vulnerable to illnesses. It’s a recipe for getting stuck in poverty, and it can hold back entire communities and nations from achieving their potential.\r\n \r\nThat’s why addressing malnutrition is important in the fight to end extreme poverty, and the UN agrees. Reports have emerged in recent days that the UN is in the process of creating a new body, which might be named UN Nutrition. It is expected that the new organisation will be headed by UNICEF and the World Food Program.',	'0.57',	'0.24',	'1',	'0',	'0',	'08bbf5559217eb9fdbe0d490c56b4f033e05f0f9'),
(2873,	500,	98,	'image',	'1421179487',	NULL,	'Spotlight on Malala: A Champion for Syrian Refugees',	'After becoming the youngest person to ever win the Nobel Peace Prize, all eyes are on Malala Yousafzai. At Global Citizen we couldn’t be more hyped up.\r\nLast week my co-worker Alex Vinci shared her favorite Malala moments, or as she put it, “15 times that Malala nailed it.” Well, sorry girl, but you forgot one. You just can’t talk about Malala’s accomplishments without mentioning her work in Syria.\r\nAfter surviving an assassination attempt from the Taliban, Malala has continued to use her voice to ensure all children have access to education. On July 13, 2013 (known as Malala Day) she told world leaders: \"One child, one teacher, one pen and one book can change the world. Education is the only solution.\"\r\nTo that end, in September 2013 Malala teamed up with UN Special Envoy Gordon Brown and NGO partner A World at School to work towards providing education for 300,000 Syrian refugees in Lebanon. Together, they called on the international community to contribute a total of $500 million over the span of 3 years in order to reach the goal.\r\nThen, in February 2014 Malala joined her father, Ziauddin, and a team from the Malala Fund (an organization that Malala oh so casually co-founded to empower girls around the world) to greet hundreds of Syrian refugees as they crossed the border into Jordan. She also visited the Zaatari refugee camp in an effort to raise funds for schools and teachers. There, she spoke to Renee Montagne from NPR about the desperate need for more schools and educational opportunities for children of Syrian refugees.\r\nDuring the interview she talked about how the camp, home to 50,000 children at the time, only had 3 schools.\r\nAsked how important education was for refugee children in comparison to more concrete things like food or shelter, Malala responded,\r\n“ A child learns every day in something new. But if he is living in an environment where he sees violence, where he sees bad people, it has a very bad influence on their child. But if he\'s in a different environment, in a healthy environment, in an environment where he can learn, he\'s going to school, he has teachers, he is learning how to work in groups and how to work in collaboration with each other, so then it has a good impact on the child\'s future.”\r\nAll children should have access to quality education, regardless of their gender, location, political status- you get the point. So does Malala. She’s using her voice to turn that idea into a reality. Won’t you join her? Stay active on Global Citizen to ensure all kids have access to education and the chance to lift themselves out of poverty.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421179427.jpg',	'512',	'228.69333333333',	'1421179427.jpg',	'1500',	'670',	'1421179427.jpg',	'1500',	'670',	'1421179427.jpg',	'1024',	'457.38666666667',	'1421179427.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfD7XW',	'After becoming the youngest person to ever win the Nobel Peace Prize, all eyes are on Malala Yousafzai. At Global Citizen we couldn’t be more hyped up.\r\nLast week my co-worker Alex Vinci shared her favorite Malala moments, or as she put it, “15 times that Malala nailed it.” Well, sorry girl, but you forgot one. You just can’t talk about Malala’s accomplishments without mentioning her work in Syria.\r\nAfter surviving an assassination attempt from the Taliban, Malala has continued to use her voice to ensure all children have access to education. On July 13, 2013 (known as Malala Day) she told world leaders: \"One child, one teacher, one pen and one book can change the world. Education is the only solution.\"\r\nTo that end, in September 2013 Malala teamed up with UN Special Envoy Gordon Brown and NGO partner A World at School to work towards providing education for 300,000 Syrian refugees in Lebanon. Together, they called on the international community to contribute a total of $500 million over the span of 3 years in order to reach the goal.\r\nThen, in February 2014 Malala joined her father, Ziauddin, and a team from the Malala Fund (an organization that Malala oh so casually co-founded to empower girls around the world) to greet hundreds of Syrian refugees as they crossed the border into Jordan. She also visited the Zaatari refugee camp in an effort to raise funds for schools and teachers. There, she spoke to Renee Montagne from NPR about the desperate need for more schools and educational opportunities for children of Syrian refugees.\r\nDuring the interview she talked about how the camp, home to 50,000 children at the time, only had 3 schools.\r\nAsked how important education was for refugee children in comparison to more concrete things like food or shelter, Malala responded,\r\n“ A child learns every day in something new. But if he is living in an environment where he sees violence, where he sees bad people, it has a very bad influence on their child. But if he\'s in a different environment, in a healthy environment, in an environment where he can learn, he\'s going to school, he has teachers, he is learning how to work in groups and how to work in collaboration with each other, so then it has a good impact on the child\'s future.”\r\nAll children should have access to quality education, regardless of their gender, location, political status- you get the point. So does Malala. She’s using her voice to turn that idea into a reality. Won’t you join her? Stay active on Global Citizen to ensure all kids have access to education and the chance to lift themselves out of poverty.',	'0.38',	'0.35',	'1',	'0',	'0',	'bca8eb13e14bc39fae4298ee32dcb3e5414543c4'),
(2874,	500,	98,	'image',	'1421179628',	NULL,	'Harry Potter Spin-Off, but 58 Million Kids Won\'t Get to Read It',	'Cancel your trick or treat plans. Forget your costumes. There’s something more important happening on Halloween: J.K. Rowling is publishing a new 1,700-word Harry Potter story!\r\nAlright, I wouldn’t cancel all of your plans because October 31st is too much fun for that, but definitely find some time to check out her newest narrative starring one the witches we love to hate, Dolores Umbridge.\r\nShe’ll be releasing the story on Pottomore.com, so if you haven’t set up an account, I’d get on that. (For the record, I was sorted into Gryffindor.)\r\nPottermore has over 1 million users and even if the story gets published beyond the site, it won’t be available to everyone. Harry Potter has sold over 450 million books, but not everyone has a chance to read them. Some children will never get the chance to experience the wizarding world because they haven’t been able to go to school to learn to read in the first place.\r\nI know, it’s shocking, I can’t imagine my what my childhood would’ve been like without the Harry Potter books.\r\nMy sister and I were so obsessed growing up that my Grandmother pre-ordered every book for us. And of course we each had to have our own copy because there’s no way we would’ve had the patience to wait for the other one to finish reading it first.\r\nAs soon as I got my hands on the book, I’d lock myself away in my room until I finished it...48 hours later. Okay, maybe I came out for dinner, but the point is that I spent a major part of my younger years growing up with Harry, Ron and Hermione. An announcement like this gets me so excited because it’s a chance for me to extend that childhood journey once more.\r\nThe fact that there are children around the world that don’t have access the wizarding world of Harry Potter, or access to books at all, is deeply upsetting.\r\nTake Malala for example. We’re not even sure if she ever had the chance to read all of them because she was only able to read 7 or 8 books before moving to England. But that’s the problem: books, school and education are not available to everyone in the world. There are so many girls like Malala that have been told they can’t receive an education. In fact, 58 million children around the world are not in school.\r\nAs if we needed another reason to fight for education rights around the world, I’d say Harry Potter is a pretty good one. Let’s not stop at getting children into school. Let’s give them a chance to read the books that can mold a childhood because they certainly did for me. Harry Potter might have charms and spells, but there’s a magic to reading that everyone should have the chance to experience.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421179552.jpg',	'512',	'228.69333333333',	'1421179552.jpg',	'1500',	'670',	'1421179552.jpg',	'1500',	'670',	'1421179552.jpg',	'1024',	'457.38666666667',	'1421179552.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBREs',	'Cancel your trick or treat plans. Forget your costumes. There’s something more important happening on Halloween: J.K. Rowling is publishing a new 1,700-word Harry Potter story!\r\nAlright, I wouldn’t cancel all of your plans because October 31st is too much fun for that, but definitely find some time to check out her newest narrative starring one the witches we love to hate, Dolores Umbridge.\r\nShe’ll be releasing the story on Pottomore.com, so if you haven’t set up an account, I’d get on that. (For the record, I was sorted into Gryffindor.)\r\nPottermore has over 1 million users and even if the story gets published beyond the site, it won’t be available to everyone. Harry Potter has sold over 450 million books, but not everyone has a chance to read them. Some children will never get the chance to experience the wizarding world because they haven’t been able to go to school to learn to read in the first place.\r\nI know, it’s sh