(2875,	500,	98,	'video',	'1421180283',	NULL,	'Why is GPE Important?',	'What is the Global Partnership for Education?\r\nThe Global Partnership for Education (GPE) is the only multilateral partnership devoted to getting all kids into school for a quality education. Thanks to their holistic approach schools in need gain the capacity to sustain themselves.\r\nHow does it work?\r\nDonor governments such the USA provide funds to the GPE which then gives grants to its 59 developing country partners to support their national education plans. This is a really effective way of providing aid to education, as it means all work is carried out according to an individual government’s priorities. A country can only receive funding if it has a national education plan that has been agreed with the GPE and if all partners in the country (like donor agencies, NGOs and teachers) agree to support the national plan to get children into school and learning.\r\nThe GPE also supports members to consider certain areas as priorities, such as ensuring that more girls access education, as well as children with disabilities when developing their plans.The GPE’s major focus areas are:\r\n1. Girls’ education,\r\n2. Children with disabilities,\r\n3. Education in conflict affected and fragile countries,\r\n 4. Supporting teachers to improve the quality of education.\r\nHow you can help\r\nIn June, the Global Partnership for Education (GPE) asked governments to commit $3.5 billion for its next round of funding from 2015-2018.\r\nIn a record breaking announcement, USAID Administrator Shah announced it will double its committment to GPE to $40 million this year, followed by an additional $50 million the following year with the help of Congress. \r\nAs Global Citizens, it\'s up to us to ensure that world leaders and business leaders do their part to increase access to education.',	'0',	'',	'',	'vastvideo14211798550.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'143.05882352941',	'1421180245.png',	'512',	'286.11764705882',	'1421180245.png',	'',	'',	'',	'',	'',	'',	'646',	'361',	'1421180245.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCMVc',	'What is the Global Partnership for Education?\r\nThe Global Partnership for Education (GPE) is the only multilateral partnership devoted to getting all kids into school for a quality education. Thanks to their holistic approach schools in need gain the capacity to sustain themselves.\r\nHow does it work?\r\nDonor governments such the USA provide funds to the GPE which then gives grants to its 59 developing country partners to support their national education plans. This is a really effective way of providing aid to education, as it means all work is carried out according to an individual government’s priorities. A country can only receive funding if it has a national education plan that has been agreed with the GPE and if all partners in the country (like donor agencies, NGOs and teachers) agree to support the national plan to get children into school and learning.\r\nThe GPE also supports members to consider certain areas as priorities, such as ensuring that more girls access education, as well as children with disabilities when developing their plans.The GPE’s major focus areas are:\r\n1. Girls’ education,\r\n2. Children with disabilities,\r\n3. Education in conflict affected and fragile countries,\r\n 4. Supporting teachers to improve the quality of education.\r\nHow you can help\r\nIn June, the Global Partnership for Education (GPE) asked governments to commit $3.5 billion for its next round of funding from 2015-2018.\r\nIn a record breaking announcement, USAID Administrator Shah announced it will double its committment to GPE to $40 million this year, followed by an additional $50 million the following year with the help of Congress. \r\nAs Global Citizens, it\'s up to us to ensure that world leaders and business leaders do their part to increase access to education.',	'0.6',	'0.48',	'1',	'0',	'0',	'8604e2eb4cc420a78186b4786e7e1a1f1fee18ed'),
(2876,	501,	98,	'video',	'1421182517',	NULL,	'Make Gender Equality A Global Priority ',	'Investing in girls and women is critical to achieving gender equality and ending poverty. Currently, they are being left behind. That’s why, so far,  Global Citizens took over 55,000 actions calling for girls and women to be at the heart of the post-2015 development agenda. \r\nToday, there are still 31 million girls who are denied an education, almost 300 000 girls and women who die from complications due to pregnancy or childbirth per year and 222 million women in developing countries who want to avoid pregnancy but lack access to family planning services, information, and contraception.\r\nWhen girls and women are educated and healthy, with access to sexual and reproductive health services including family planning, poverty will decline. We’re asking the UN Secretary-General and other key decision-makers and stakeholders to prioritize and streamline gender equality within all future development goals.  Specifically we are calling for the Secretary-General and key decision-makers to include in the new development agenda measures to:\r\n1. Keep girls in school and reduce dropout rates\r\n2. Ensure every girl and woman has access to a comprehensive package of sexual and reproductive health information, services and rights, including family planning\r\n3. Establish targets to track and achieve gender equality across all goals',	'0',	'',	'',	'vastvideo14211802911.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'171.94029850746',	'1421182438.png',	'512',	'343.88059701493',	'1421182438.png',	'',	'',	'',	'',	'',	'',	'536',	'360',	'1421182438.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCoGg',	'Investing in girls and women is critical to achieving gender equality and ending poverty. Currently, they are being left behind. That’s why, so far,  Global Citizens took over 55,000 actions calling for girls and women to be at the heart of the post-2015 development agenda. \r\nToday, there are still 31 million girls who are denied an education, almost 300 000 girls and women who die from complications due to pregnancy or childbirth per year and 222 million women in developing countries who want to avoid pregnancy but lack access to family planning services, information, and contraception.\r\nWhen girls and women are educated and healthy, with access to sexual and reproductive health services including family planning, poverty will decline. We’re asking the UN Secretary-General and other key decision-makers and stakeholders to prioritize and streamline gender equality within all future development goals.  Specifically we are calling for the Secretary-General and key decision-makers to include in the new development agenda measures to:\r\n1. Keep girls in school and reduce dropout rates\r\n2. Ensure every girl and woman has access to a comprehensive package of sexual and reproductive health information, services and rights, including family planning\r\n3. Establish targets to track and achieve gender equality across all goals',	'0.52',	'0.38',	'1',	'0',	'0',	'a7bab07c9cb33e757063062cd36db69bf3a3ddf9'),
(2877,	501,	98,	'image',	'1421182649',	NULL,	'\"Hi, My Name is Thea, I’m 12 and am Getting Married on Saturday\"',	'Yes, you read that correctly. 12 year old Thea will be Norway’s first child bride on Saturday 11 October, when she will walk down the aisle to her 37 year old husband to be. Thea has been blogging the entire experience which has naturally sparked national outcry, with hundreds calling child welfare and the police to stop the upcoming wedding.\r\nSo why is Thea doing this and how has this not been stopped?\r\nThea and her husband to be, are part of an elaborate stunt orchestrated by Plan Norway to engage the population to take immediate action on the UNs International Day of the Girl Child, highlighting the shocking fact that every year, 15 million girls are robbed of their childhood and married before their 18th birthday. The public can digitally attend the wedding and take action to stop it, through donating their social media voice for the day.\r\nThea’s marriage has quite rightly provoked outrage in Norway and much of Europe. But on 11 October, there will be 39,000 other girls being forced into a marriage across the world, who have no choice but to go through with it.\r\nThea has taken a powerful stand and we invite you to join our call to action to stop child marriage and ensure that all young people have the right to determine their own future.\r\nShowyourselfie is our visual petition to put young people in the picture and ensure that their rights and needs are seen and addressed by decision makers. By adding your selfie of support, you are standing with thousands of others across the world to say that NOW is the time to invest in young people.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'107.52',	'1421182551.jpg',	'512',	'215.04',	'1421182551.jpg',	'1500',	'630',	'1421182551.jpg',	'1500',	'630',	'1421182551.jpg',	'1024',	'430.08',	'1421182551.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfBRnY',	'Yes, you read that correctly. 12 year old Thea will be Norway’s first child bride on Saturday 11 October, when she will walk down the aisle to her 37 year old husband to be. Thea has been blogging the entire experience which has naturally sparked national outcry, with hundreds calling child welfare and the police to stop the upcoming wedding.\r\nSo why is Thea doing this and how has this not been stopped?\r\nThea and her husband to be, are part of an elaborate stunt orchestrated by Plan Norway to engage the population to take immediate action on the UNs International Day of the Girl Child, highlighting the shocking fact that every year, 15 million girls are robbed of their childhood and married before their 18th birthday. The public can digitally attend the wedding and take action to stop it, through donating their social media voice for the day.\r\nThea’s marriage has quite rightly provoked outrage in Norway and much of Europe. But on 11 October, there will be 39,000 other girls being forced into a marriage across the world, who have no choice but to go through with it.\r\nThea has taken a powerful stand and we invite you to join our call to action to stop child marriage and ensure that all young people have the right to determine their own future.\r\nShowyourselfie is our visual petition to put young people in the picture and ensure that their rights and needs are seen and addressed by decision makers. By adding your selfie of support, you are standing with thousands of others across the world to say that NOW is the time to invest in young people.',	'0.5',	'0.35',	'1',	'0',	'0',	'54cf4ecbb26fc9d8ff4df51141a4770c21728749'),
(2878,	501,	98,	'image',	'1421182881',	NULL,	'10 Ways We\'re Making Progress to End Violence Against Women and Girls',	'1.      Keeping girls in school\r\nEducation has been a top priority since 2000. Many governments have committed to increase the quality of education for girls, and have made efforts to keep girls in school longer. By increasing access to education we are keeping girls in school and away from violence, as well as empowering them to act as knowledgeable, educated adults who make informed decisions.\r\n2.                Outlawing child marriage\r\nWomen and girls under the age of 15 are getting married all around the world. This injustice is especially prominent in many African and Muslim communities. In an effort to end child marriage, many countries have created laws prohibiting the marriage of girls under the age of 15 -- with the majority of countries prohibiting the marriage of women and girls under the age of 18.\r\n3.                Ending female genital mutilation\r\nFemale genital mutilation (FGM) is a traditional cultural practice that takes place both voluntarily as well as by force. FGM can cause severe pain as well as health complications that put the lives of young women around the world at risk. FGM is now recognized as an unsafe custom and governments and NGOs are working to put an end to this practice.\r\n4.                Increasing access to shelters and services for victims of violence\r\nWomen’s services have been on the rise globally over the last decade. Women who have been abused and subjected to violence can now find a safe haven at local shelters and service providers. These victims are given access to safe shelter and food, and are provided with victim services such as counseling and legal aid.\r\n5.                Criminalizing violence and rape\r\nThough laws against rape have been in place for many years in most countries, recent legislative action in many nations has reinforced the value of these laws and created new criminalization standards. Today, assault and rape are taken very seriously in the courts of most countries. In many nations women are now protected against intimate partner violence, including marital rape, and victims are being increasingly protected from prosecution in instances of self defense.\r\n6.                Ending open defecation\r\nOpen defecation is an especially relevant issue for women and girls when it comes to violence. Open defecation puts women and girls at a greater risk for sexual violence. They risk shame, harassment, even rape, because they have nowhere safe to use a toilet.\r\nEnding open defecation also helps maintain sanitation during menstrual cycles. Young women without access to proper sanitation are often forced to leave school during their menstrual cycles, causing them to miss many weeks of schooling each year, consequently impeding their education. With recent efforts to increase sanitation and end open defecation, girls can now stay safe and in school during their menstrual cycles, and receive a better education.\r\n7.                Empowering women\r\nAdvocates and NGOs around the world are empowering women every day. They are sharing women’s stories and helping them to pick themselves up out of persecution. Strong women like Malala Yousafzai are using their voices to teach people around the world about the persecution they have endured. In doing so, they are encouraging people and governments to put an end to violence against women and girls.\r\n8.                Closing the gender gap in the workplace\r\nThroughout history women have often had less important roles in the workplace and been paid significantly lower salaries than men. Though there is still a pay gap between men and women today, women’s roles in the workplace have become more prominent. In many countries today, women can do all of the same things as men -- they can have professions such as lawyers, doctors, and politicians. They are increasingly represented in government and they are becoming powerful decision makers. When women contribute to their societies, they become empowered and less vulnerable to acts of violence.    \r\n9.                Addressing gender-based violence in conflict zones\r\nViolence against women has often been used as a tactic by oppressors in cases of war and conflict. Terrorist groups like ISIS and Boko Haram have married off, raped and kidnapped women and girls in an effort to gain power over target countries and governments. These war tactics have been condemned by governments around the world and are now included as punishable war crimes by the ICC.\r\n10.             Integrating men and boys in the fight for gender equality\r\nIn the past, the fight for gender equality has often been a women’s battle. Female advocates and feminists took the leading role in fighting for equality and the end of gender-based violence. However, men and boys are being called upon and have taken a much more active role today. Most recently, the HeForShe campaign, popularized by Emma Watson, has emphasized the importance of male advocates in the fight for gender equality.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421182711.jpg',	'512',	'228.69333333333',	'1421182711.jpg',	'1500',	'670',	'1421182711.jpg',	'1500',	'670',	'1421182711.jpg',	'1024',	'457.38666666667',	'1421182711.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCAp0',	'1.      Keeping girls in school\r\nEducation has been a top priority since 2000. Many governments have committed to increase the quality of education for girls, and have made efforts to keep girls in school longer. By increasing access to education we are keeping girls in school and away from violence, as well as empowering them to act as knowledgeable, educated adults who make informed decisions.\r\n2.                Outlawing child marriage\r\nWomen and girls under the age of 15 are getting married all around the world. This injustice is especially prom