ht for gender equality\r\nIn the past, the fight for gender equality has often been a women’s battle. Female advocates and feminists took the leading role in fighting for equality and the end of gender-based violence. However, men and boys are being called upon and have taken a much more active role today. Most recently, the HeForShe campaign, popularized by Emma Watson, has emphasized the importance of male advocates in the fight for gender equality.',	'0.57',	'0.46',	'1',	'0',	'0',	'e7dec55ab16bee1d04ea7c92ad098172896e7bb1'),
(2879,	502,	98,	'image',	'1421183113',	NULL,	'World Leaders Meet to (Maybe?) Save the World',	'Since the industrial revolution, today’s developed countries have produced crazy amounts of greenhouse gases and heat-trapping emissions. Consequently, these same countries have become wealthy, but at the expense of the environment.\r\nNow, developing  countries that have contributed relatively little to global emissions over the past 2 centuries, are being disproportionately affected by climate change. As a result, their economies have suffered as communities struggle to recover from natural disasters and droughts.\r\nNow let’s get to it:\r\n1. Rules\r\nDeveloped countries want rules to be focused on slashing or reducing emissions. Additionally, the US and EU are pushing for a review process  to analyze and compare targets before Paris.\r\nCountries like China, who have not yet been required to take climate action, are opposed to this process.  And, many developing countries like China, prefer to think of reductions as soft targets, rather than hard agreements.\r\nTranslation: one side wants rules the other wants “guidelines.”\r\nWhy the contention:\r\nIt’s easy for developed countries to demand reduced emissions now that they have reaped the benefits of industrialization. Developing nations, on the other hand, feel it’s only fair they have the same opportunity to develop their economies.\r\n2. Money\r\nIn 2009, wealthy countries agreed to commit $100 billion annually by 2020 to help developing countries limit emissions and combat effects of climate change. So far, the financing hasn’t come close to that level and poorer countries are eager to collect.\r\nAdditionally, poorer countries want to get their hands on the anti-pollution technologies that wealthier countries have developed. Wealthy countries , however, aren’t interested in handing these over for free.\r\nWhy the contention:\r\nDeveloping countries argue that if they are expected to limit their emissions because of a problem created by the developed world, it’s only fair that they be compensated.\r\nBut, there is some disagreement as to which countries are considered developing and which aren’t. China, for instance, likes to call itself among the least developed, but some wealthy nations consider China developed due to its economy being the 2nd (or first if you believe recent assessment) largest in the world, and the national government having large financial reserves.\r\n3. Commitment Period\r\nIn order for this global framework to be as effective as possible, countries need to agree on a commitment period . Only then can countries be held accountable and targets  easily compared. The Paris agreement is set to take place in 2020, but not everyone can  agree on the length of the the commitment period.\r\nWhile the US favors a 5-year commitment period, the EU and China prefer a 10-year period. Brazil, on the other hand, is mixing it up with a hybrid: under its proposal, countries would set hard 5-year targets and set “indicative” 10-year targets.\r\nWhy the contention:\r\nWhen countries allocate foreign aid for various organizations and institutions (think Global Partnership for Education, Gavi, the Vaccine Alliance, and WHO,) you’ll notice that they often make pledges for different lengths of time.\r\nSimilarly, with the Paris agreement, setting a commitment period is difficult because each country must consider its budget, governing system, and other factors. For this reason, agreeing on one period will be extremely difficult.\r\nFurther, critics of China’s 10 year plan, say the longer commitment period allows them to delay starting efforts to curb emissions. Critics of the US’s shorter commitment period, say it only creates another big showdown over the climate in just five years.\r\n4. Blame\r\nIn the 1997 Kyoto emissions treaty, only developed countries were required to meet their targets, while doing so was voluntary for developing countries.\r\nFor the Paris agreement, this distinction will no longer exist, and both developing and developed countries will be required to meet their targets. Developing countries aren’t so happy about this.\r\nWhy the contention:\r\nAs you might expect, developing countries like China prefer to keep this distinction so they can continue to grow their economies without environmental limitations. But, as previously mentioned, some developed countries argue that countries like China should not be considered “developing” and should play by the same rules as their global peers the US, the EU, etc.\r\n\"It\'s disappointing that countries can\'t rise above these petty differences, but it\'s not surprising,\" says Jake Schmidt of the Natural Resources Defense Council,  from Lima. \"Everything always comes down to the wire. [Cabinet-level] ministers have the chance to rise above this when they arrive this week because this is their chance to create their legacy on climate change.\"\r\nYou said it, Jake. I’ll be crossing my fingers that world leaders are able to rise to the occasion. And, until Paris, let’s be sure we let our leaders know they have our full support in making strong commitments to reduce emissions in the coming years.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'114.34666666667',	'1421182983.jpg',	'512',	'228.69333333333',	'1421182983.jpg',	'1500',	'670',	'1421182983.jpg',	'1500',	'670',	'1421182983.jpg',	'1024',	'457.38666666667',	'1421182983.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfD6mQ',	'Since the industrial revolution, today’s developed countries have produced crazy amounts of greenhouse gases and heat-trapping emissions. Consequently, these same countries have become wealthy, but at the expense of the environment.\r\nNow, developing  countries that have contributed relatively little to global emissions over the past 2 centuries, are being disproportionately affected by climate change. As a result, their economies have suffered as communities struggle to recover from natural disasters and droughts.\r\nNow let’s get to it:\r\n1. Rules\r\nDeveloped countries want rules to be focused on slashing or reducing emissions. Additionally, the US and EU are pushing for a review process  to analyze and compare targets before Paris.\r\nCountries like China, who have not yet been required to take climate action, are opposed to this process.  And, many developing countries like China, prefer to think of reductions as soft targets, rather than hard agreements.\r\nTranslation: one side wants rules the other wants “guidelines.”\r\nWhy the contention:\r\nIt’s easy for developed countries to demand reduced emissions now that they have reaped the benefits of industrialization. Developing nations, on the other hand, feel it’s only fair they have the same opportunity to develop their economies.\r\n2. Money\r\nIn 2009, wealthy countries agreed to commit $100 billion annually by 2020 to help developing countries limit emissions and combat effects of climate change. So far, the financing hasn’t come close to that level and poorer countries are eager to collect.\r\nAdditionally, poorer countries want to get their hands on the anti-pollution technologies that wealthier countries have developed. Wealthy countries , however, aren’t interested in handing these over for free.\r\nWhy the contention:\r\nDeveloping countries argue that if they are expected to limit their emissions because of a problem created by the developed world, it’s only fair that they be compensated.\r\nBut, there is some disagreement as to which countries are considered developing and which aren’t. China, for instance, likes to call itself among the least developed, but some wealthy nations consider China developed due to its economy being the 2nd (or first if you believe recent assessment) largest in the world, and the national government having large financial reserves.\r\n3. Commitment Period\r\nIn order for this global framework to be as effective as possible, countries need to agree on a commitment period . Only then can countries be held accountable and targets  easily compared. The Paris agreement is set to take place in 2020, but not everyone can  agree on the length of the the commitment period.\r\nWhile the US favors a 5-year commitment period, the EU and China prefer a 10-year period. Brazil, on the other hand, is mixing it up with a hybrid: under its proposal, countries would set hard 5-year targets and set “indicative” 10-year targets.\r\nWhy the contention:\r\nWhen countries allocate foreign aid for various organizations and institutions (think Global Partnership for Education, Gavi, the Vaccine Alliance, and WHO,) you’ll notice that they often make pledges for different lengths of time.\r\nSimilarly, with the Paris agreement, setting a commitment period is difficult because each country must consider its budget, governing system, and other factors. For this reason, agreeing on one period will be extremely difficult.\r\nFurther, critics of China’s 10 year plan, say the longer commitment period allows them to delay starting efforts to curb emissions. Critics of the US’s shorter commitment period, say it only creates another big showdown over the climate in just five years.\r\n4. Blame\r\nIn the 1997 Kyoto emissions treaty, only developed countries were required to meet their targets, while doing so was voluntary for developing countries.\r\nFor the Paris agreement, this distinction will no longer exist, and both developing and developed countries will be required to meet their targets. Developing countries aren’t so happy about this.\r\nWhy the contention:\r\nAs you might expect, developing countries like China prefer to keep this distinction so they can continue to grow their economies without environmental limitations. But, as previously mentioned, some developed countries argue that countries like China should not be considered “developing” and should play by the same rules as their global peers the US, the EU, etc.\r\n\"It\'s disappointing that countries can\'t rise above these petty differences, but it\'s not surprising,\" says Jake Schmidt of the Natural Resources Defense Council,  from Lima. \"Everything always comes down to the wire. [Cabinet-level] ministers have the chance to rise above this when they arrive this week because this is their chance to create their legacy on climate change.\"\r\nYou said it, Jake. I’ll be crossing my fingers that world leaders are able to rise to the occasion. And, until Paris, let’s be sure we let our leaders know they have our full support in making strong commitments to reduce emissions in the coming years.',	'0.33',	'0.45',	'1',	'0',	'0',	'61752efc0a81eac006a82c5c570713ebff4dfdd7'),
(2880,	502,	98,	'image',	'1421183210',	NULL,	'What is Climate Change Really About?',	'By 2040, the world is projected to be 2 degrees warmer than it is today.\r\nThat may seem like a tiny change but in reality it will have a huge impact.\r\nLet me be clear however. Stopping climate change isn’t an environmental issue. It’s not about the polar bears, it’s not about the glaciers, and it’s not even about saving the Earth.\r\nIt’s about justice for the world’s poor. Let me tell you why:\r\nAccording to the United Nations Development Program, developing countries will suffer 99% of the casualties attributable to climate change.\r\nThis is in spite of the fact that the 50 least developed nations have had a tiny, 1% impact on greenhouse gas emissions.[1]\r\nMore heat waves, crop failures, natural disasters, droughts and famines will be hard for the developed world, but it will be a catastrophe for those living with very little.\r\nThe 1.2 billion people living in extreme poverty will be more dramatically affected by a changing climate primarily because of poor infrastructure: both in terms of the way they grow crops and in the way their countries cope with extreme weather.\r\nThe crisis has the potential to undo all the progress we\'ve made toward making poverty a thing of the past.\r\nBut it isn’t inevitable. There’s still a lot we can do to both prevent the worst consequences of climate change.\r\nIn the long run species may disappear, sea levels may rise and rainforests may wither, but over the course of hundreds of years, the planet will recover.\r\nWhat we will never get back is our chance to live in a world without extre',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'107.69066666667',	'1421183152.jpg',	'512',	'215.38133333333',	'1421183152.jpg',	'1500',	'631',	'1421183152.jpg',	'1500',	'631',	'1421183152.jpg',	'1024',	'430.76266666667',	'1421183152.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCL3A',	'By 2040, the world is projected to be 2 degrees warmer than it is today.\r\nThat may seem like a tiny change but in reality it will have a huge impact.\r\nLet me be clear however. Stopping climate change isn’t an environmental issue. It’s not about the polar bears, it’s not about the glaciers, and it’s not even about saving the Earth.\r\nIt’s about justice for the world’s poor. Let me tell you why:\r\nAccording to the United Nations Development Program, developing countries will suffer 99% of the casualties attributable to climate change.\r\nThis is in spite of the fact that the 50 least developed nations have had a tiny, 1% impact on greenhouse gas emissions.[1]\r\nMore heat waves, crop failures, natural disasters, droughts and famines will be hard for the developed world, but it will be a catastrophe for those living with very little.\r\nThe 1.2 billion people living in extreme poverty will be more dramatically affected by a changing climate primarily because of poor infrastructure: both in terms of the way they grow crops and in the way their countries cope with extreme weather.\r\nThe crisis has the potential to undo all the progress we\'ve made toward making poverty a thing of the past.\r\nBut it isn’t inevitable. There’s still a lot we can do to both prevent the worst consequences of climate change.\r\nIn the long run species may disappear, sea levels may rise and rainforests may wither, but over the course of hundreds of years, the planet will recover.\r\nWhat we will never get back is our chance to live in a world without extre',	'0.66',	'0.32',	'1',	'0',	'0',	'da74e7f3397717db0aa4867e19ccc647ce1fd870'),
(2881,	502,	98,	'video',	'1421183773',	NULL,	'Introduction to the Importance of Environmental Sustainability',	'Climate change is the most urgent issue affecting the whole planet right now. It has been described as the defining human development issue of our generation.\r\nClimate change-related hazards are ongoing and increasing. They pose a serious threat to the achievement of the MDGs as they have the potential to reverse years of development gains. Tackling the climate is a need for justice: developing countries have 98% of the seriously affected and 99% of all deaths from weather-related disasters, along with over 90% of the total economic losses, while the 50 Least Developed Countries contribute less than 1% of global carbon emissions.\r\nClimate change and global poverty must be combated simultaneously. 75% of the world’s poor live in rural areas and largely depend on natural resources for their livelihoods and income. They suffer the most from natural disasters due to poor infrastructure and systems that are not equipped to deal with the drastic impact of major catastrophes such as the 2004 tsunami or Haiti earthquake.\r\nProjected impacts from climate change include the following:\r\nDecline in agricultural productivity: The areas suitable for agriculture, the length of growing seasons and the yield potential of food staples are all projected to decline. Some African countries could see agricultural yields decrease by 50% by 2050 and crop net revenues could fall by as much as 90% by 2100.\r\nIncreased water stress: Changing climate patterns will have important implications for water availability in Africa. By 2020, an additional 75-250 million people in Africa are projected to be exposed to increased water stress due to climate change.\r\nRising sea levels: Across the globe, sea levels could rise rapidly with accelerated ice sheet disintegration. In Africa, highly productive ecosystems, which form the basis for important economic activities such as tourism and fisheries, are located in coastal zones. In total, 70 million people and 30% of the Africa\'s coastal infrastructure could face the risk of coastal flooding by 2080 because of rising sea levels.\r\nRisks to human health: Climate change will affect human health through variables such as changes in temperature, exposure to natural disasters, access to food and air quality. Previously malaria-free highland areas in Ethiopia, Kenya, Rwanda and Burundi could experience modest incursions of malaria by the 2050s, with conditions for transmission becoming highly suitable by the 2080s. In total, an additional 260-320 million people worldwide could be living in malaria-infested areas by 2080.\r\nThreats to ecosystems and biodiversity: Changes induced by climate change are likely to result in species range shifts and changes in tree productivity, adding further stress to forest ecosystems. Studies predict that 25-40% of mammal species such as zebra could become endangered or extinct by 2080.\r\nGlobal efforts are key to ensure environmental sustainability. Industrialized countries are historically responsible for the bulk of green house gas emissions. However, meaningful reductions in emissions today can only be achieved through an approach that includes emerging markets. In addition, developing regions like sub-Saharan Africa, must be enabled to embark on a low carbon growth path as they continue to grow their economic base and energy supply and demand. Industrialized countries have an obligation to support Africa and other regions in this endeavor. Moreover, it is in their interest to do so as climate change impacts will be felt throughout the world. Developing and emerging countries have signaled they would agree to a global climate deal if they are supported. In addition, there are untapped opportunities for partnering with sub-Saharan Africa to stem further declines.  Africa\'s vast rainforests and natural resources could be invested in through re-forestation and agro-forestry programs to provide sustainable livelihoods and carbon storage/sequestration.',	'0',	'',	'',	'vastvideo14211834654.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'143.07769423559',	'1421183681.png',	'512',	'286.15538847118',	'1421183681.png',	'',	'',	'',	'',	'',	'',	'798',	'446',	'1421183681.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YfCcXx',	'Climate change is the most urgent issue affecting the whole planet right now. It has been described as the defining human development issue of our generation.\r\nClimate change-related hazards are ongoing and increasing. They pose a serious threat to the achievement of the MDGs as they have the potential to reverse years of development gains. Tackling the climate is a need for justice: developing countries have 98% of the seriously affected and 99% of all deaths from weather-related disasters, along with over 90% of the total economic losses, while the 50 Least Developed Countries contribute less than 1% of global carbon emissions.\r\nClimate change and global poverty must be combated simultaneously. 75% of the world’s poor live in rural areas and largely depend on natural resources for their livelihoods and income. They suffer the most from natural disasters due to poor infrastructure and systems that are not equipped to deal with the drastic impact of major catastrophes such as the 2004 tsunami or Haiti earthquake.\r\nProjected impacts from climate change include the following:\r\nDecline in agricultural productivity: The areas suitable for agriculture, the length of growing seasons and the yield potential of food staples are all projected to decline. Some African countries could see agricultural yields decrease by 50% by 2050 and crop net revenues could fall by as much as 90% by 2100.\r\nIncreased water stress: Changing climate patterns will have important implications for water availability in Africa. By 2020, an additional 75-250 million people in Africa are projected to be exposed to increased water stress due to climate change.\r\nRising sea levels: Across the globe, sea levels could rise rapidly with accelerated ice sheet disintegration. In Africa, highly productive ecosystems, which form the basis for important economic activities such as tourism and fisheries, are located in coastal zones. In total, 70 million people and 30% of the Africa\'s coastal infrastructure could face the risk of coastal flooding by 2080 because of rising sea levels.\r\nRisks to human health: Climate change will affect human health through variables such as changes in temperature, exposure to natural disasters, access to food and air quality. Previously malaria-free highland areas in Ethiopia, Kenya, Rwanda and Burundi could experience modest incursions of malaria by the 2050s, with conditions for transmission becoming highly suitable by the 2080s. In total, an additional 260-320 million people worldwide could be living in malaria-infested areas by 2080.\r\nThreats to ecosystems and biodiversity: Changes induced by climate change are likely to result in species range shifts and changes in tree productivity, adding further stress to forest ecosystems. Studies predict that 25-40% of mammal species such as zebra could become endangered or extinct by 2080.\r\nGlobal efforts are key to ensure environmental sustainability. Industrialized countries are historically responsible for the bulk of green house gas emissions. However, meaningful reductions in emissions today can only be achieved through an approach that includes emerging markets. In addition, developing regions like sub-Saharan Africa, must be enabled to embark on a low carbon growth path as they continue to grow their economic base and energy supply and demand. Industrialized countries have an obligation to support Africa and other regions in this endeavor. Moreover, it is in their interest to do so as climate change impacts will be felt throughout the world. Developing and emerging countries have signaled they would agree to a global climate deal if they are supported. In addition, there are untapped opportunities for partnering with sub-Saharan Africa to stem further declines.  Africa\'s vast rainforests and natural resources could be invested in through re-forestation and agro-forestry programs to provide sustainable livelihoods and carbon storage/sequestration.',	'0.52',	'0.62',	'1',	'0',	'0',	'd1e1256536f723ed53b4bcbf775e00862de74c55'),
(2882,	503,	97,	'image',	'1421185974',	NULL,	'Power the World ',	'Solar lights in Haiti \r\nOf the 34 million people living in the Western Hemisphere who have no access to electricity, almost 8 million are located in Haiti. Power the World aims to reduce this number by getting solar powered lights into the hands of Haitian families.\r\nSomething as simple as a solar powered light can open up opportunities for families in Haiti. Without electricity, children have to study by candlelight or kerosene lanterns at night and face the risk of fires and illness from smoke and soot inhalation.  Parents are unable to run business after dark.  Powered by the sun and safe for families and the environment, solar lights provide the light for education and productive livelihoods.\r\nBy working with local entrepreneurs to kickstart clean energy enterprises, Music for Relief is opening up access to electricity, enhancing livelihoods, and ensuring that the service and delivery mechanisms for these lights are sustainable.Your $10 donation equals one solar light.Music for Relief and EarthSpark International’s Enèji Pwòp (Haitian Creole for “clean energy”) have joined forces to provide clean energy options for Haitian individuals and their families.So far, Power the World has been able to provide solar lights to 1,500 families in Haiti.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'141.01333333333',	'1421185925.jpg',	'512',	'282.02666666667',	'1421185925.jpg',	'1200',	'661',	'1421185925.jpg',	'1200',	'661',	'1421185925.jpg',	'1024',	'564.05333333333',	'1421185925.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22Tlmy9',	'Solar lights in Haiti \r\nOf the 34 million people living in the Western Hemisphere who have no access to electricity, almost 8 million are located in Haiti. Power the World aims to reduce this number by getting solar powered lights into the hands of Haitian families.\r\nSomething as simple as a solar powered light can open up opportunities for families in Haiti. Without electricity, children have to study by candlelight or kerosene lanterns at night and face the risk of fires and illness from smoke and soot inhalation.  Parents are unable to run business after dark.  Powered by the sun and safe for families and the environment, solar lights provide the light for education and productive livelihoods.\r\nBy working with local entrepreneurs to kickstart clean energy enterprises, Music for Relief is opening up access to electricity, enhancing livelihoods, and ensuring that the service and delivery mechanisms for these lights are sustainable.Your $10 donation equals one solar light.Music for Relief and EarthSpark International’s Enèji Pwòp (Haitian Creole for “clean energy”) have joined forces to provide clean energy options for Haitian individuals and their families.So far, Power the World has been able to provide solar lights to 1,500 families in Haiti.',	'0.44',	'0.42',	'1',	'0',	'0',	'9f3a1cbe7b5eada1ef754dd2df6dd90168884a88'),
(2883,	503,	97,	'image',	'1421186055',	NULL,	'Power the World',	'Solar Suitcases in Uganda\r\nIn Africa, pregnancy and childbirth complications result in hundreds of maternal deaths every day, including within the country of Uganda. Ugandan clinics often don’t have reliable electricity for lighting and medical equipment.\r\nPower the World aims to help change this fact and reduce maternal mortality rates by providing solar light and power for hospitals and health clinics via the WE CARE solar suitcase.\r\nPower the World and WE CARE Solar have partnered to provide the We Care Solar Suitcase®, an innovative solar energy system designed to fit in a carry-on size suitcase for easy transport and installation. The Solar Suitcase provides healthcare professionals a renewable power source to operate medical lighting, cell phones, and small medical devices.\r\nThis extremely efficient solar energy kit enables medical staff to help women deliver their babies safely at night. Currently, there is a 1-in-35 risk of a woman dying as a result of pregnancy complications in Uganda. With the Solar Suitcase, health providers can see at night for routine deliveries and surgical procedures, and can promptly diagnose and treat birth complications.\r\nClick below to donate to Power the World in support of a WE CARE Solar Suitcase for Uganda. Each suitcase costs $1500. Power the World has funded 68 suitcases so far. Your donation will help women, their babies and entire communities live safer and healthier lives.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'141.01333333333',	'1421186016.jpg',	'512',	'282.02666666667',	'1421186016.jpg',	'1200',	'661',	'1421186016.jpg',	'1200',	'661',	'1421186016.jpg',	'1024',	'564.05333333333',	'1421186016.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TlnCf',	'Solar Suitcases in Uganda\r\nIn Africa, pregnancy and childbirth complications result in hundreds of maternal deaths every day, including within the country of Uganda. Ugandan clinics often don’t have reliable electricity for lighting and medical equipment.\r\nPower the World aims to help change this fact and reduce maternal mortality rates by providing solar light and power for hospitals and health clinics via the WE CARE solar suitcase.\r\nPower the World and WE CARE Solar have partnered to provide the We Care Solar Suitcase®, an innovative solar energy system designed to fit in a carry-on size suitcase for easy transport and installation. The Solar Suitcase provides healthcare professionals a renewable power source to operate medical lighting, cell phones, and small medical devices.\r\nThis extremely efficient solar energy kit enables medical staff to help women deliver their babies safely at night. Currently, there is a 1-in-35 risk of a woman dying as a result of pregnancy complications in Uganda. With the Solar Suitcase, health providers can see at night for routine deliveries and surgical procedures, and can promptly diagnose and treat birth complications.\r\nClick below to donate to Power the World in support of a WE CARE Solar Suitcase for Uganda. Each suitcase costs $1500. Power the World has funded 68 suitcases so far. Your donation will help women, their babies and entire communities live safer and healthier lives.',	'0.33',	'0.22',	'1',	'0',	'0',	'68e8013ea39060336577eea7abca02a3bf84ad9f'),
(2884,	503,	97,	'image',	'1421186200',	NULL,	'Ebola Prevention',	'Since May 2014, West Africa is experiencing one of the largest Ebola outbreaks in history. The Ebola virus is highly contagious and can easily spread through human-to-human contact. As of October 22nd, 9,000 cases have been reported in the region including over 4,000 deaths (WHO, 2014). If gone unchecked, these rates are expected to increase.\r\n\r\nIn response to this crisis, Music for Relief is partnering with International Medical Corps to immediately raise funds for personal protective gear, which will enable health care workers to effectively treat more patients and help stop the spread of Ebola.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'99.381535038932',	'1421186179.png',	'512',	'198.76307007786',	'1421186179.png',	'899',	'349',	'1421186179.png',	'899',	'349',	'1421186179.png',	'899',	'349',	'1421186179.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TlpKo',	'Since May 2014, West Africa is experiencing one of the largest Ebola outbreaks in history. The Ebola virus is highly contagious and can easily spread through human-to-human contact. As of October 22nd, 9,000 cases have been reported in the region including over 4,000 deaths (WHO, 2014). If gone unchecked, these rates are expected to increase.\r\n\r\nIn response to this crisis, Music for Relief is partnering with International Medical Corps to immediately raise funds for personal protective gear, which will enable health care workers to effectively treat more patients and help stop the spread of Ebola.',	'0.4',	'0.77',	'1',	'0',	'0',	'18aa1c6b05a353aa948d26a10aad76c31c9e9387'),
