(2890,	505,	97,	'image',	'1421186783',	NULL,	'Watch Concert for the Philippines on AXS TV Feb 15th',	'“With your generous support, Concert for the Philippines and our online Auction raised over $500,000.00 for survivors of Typhoon Haiyan”. Thank you. The funds will help International Medical Corps to assist the 15 million people who have been impacted by the storm, which caused massive destruction. If you happened to miss Concert for the Philippines, tune in on February 15th at 8PM EST / 5PM PST on AXS TV. To find your AXS channel click here: AXS TV\r\n\r\nConcert for the Philippines included performances from Linkin Park, The Offspring, Bad Religion, as well as special guests Ann and Nancy Wilson from Heart, The Filharmonic. Travis Barker and Mike Einziger. Supporters of Music For Relief were asked to either raise or donate a minimum of $250 to attend this intimate concert that was held at Club Nokia in Los Angeles.\r\n\r\nMusic For Relief also collaborated with Alice In Chains & Friends Fantasy Football 2013 to raise funds through an online auction. The auction had rare and collectible items that included original oil paintings by Alice in Chains vocalist/guitarist, Jerry Cantrell, a custom Les Paul guitar signed by Billy Joe Armstrong of Green Day, and a trip for two to New York City to attend the fall Porsche Design Runway Show with Linkin Park’s Chester Bennington.\r\n\r\nWe are so grateful for your support of families impacted by Typhoon Haiyan',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'143.89894736842',	'1421186720.jpg',	'512',	'287.79789473684',	'1421186720.jpg',	'950',	'534',	'1421186720.jpg',	'950',	'534',	'1421186720.jpg',	'950',	'534',	'1421186720.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TlH47',	'“With your generous support, Concert for the Philippines and our online Auction raised over $500,000.00 for survivors of Typhoon Haiyan”. Thank you. The funds will help International Medical Corps to assist the 15 million people who have been impacted by the storm, which caused massive destruction. If you happened to miss Concert for the Philippines, tune in on February 15th at 8PM EST / 5PM PST on AXS TV. To find your AXS channel click here: AXS TV\r\n\r\nConcert for the Philippines included performances from Linkin Park, The Offspring, Bad Religion, as well as special guests Ann and Nancy Wilson from Heart, The Filharmonic. Travis Barker and Mike Einziger. Supporters of Music For Relief were asked to either raise or donate a minimum of $250 to attend this intimate concert that was held at Club Nokia in Los Angeles.\r\n\r\nMusic For Relief also collaborated with Alice In Chains & Friends Fantasy Football 2013 to raise funds through an online auction. The auction had rare and collectible items that included original oil paintings by Alice in Chains vocalist/guitarist, Jerry Cantrell, a custom Les Paul guitar signed by Billy Joe Armstrong of Green Day, and a trip for two to New York City to attend the fall Porsche Design Runway Show with Linkin Park’s Chester Bennington.\r\n\r\nWe are so grateful for your support of families impacted by Typhoon Haiyan',	'0.35',	'0.2',	'1',	'0',	'0',	'3b24fe82862eefb6dd2f58ba228ebe9f41306ef0'),
