(2893,	506,	97,	'image',	'1421187818',	NULL,	'Thank you for Volunteering with MFR and Treepeople',	'Thank you to everyone that came to the volunteer activity with Music for Relief and TreePeople on October 11, 2014 at Stetson Ranch Park. Together we cared for 63 trees! 10 lucky people won tickets to see Linkin Park on October 24, 2014 at the Wiltern in Los Angeles, CA and everyone left with amazing prizes.\r\n',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'169.57264957265',	'1421187771.jpg',	'512',	'339.1452991453',	'1421187771.jpg',	'1170',	'775',	'1421187771.jpg',	'1170',	'775',	'1421187771.jpg',	'1024',	'678.2905982906',	'1421187771.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TkVnz',	'Thank you to everyone that came to the volunteer activity with Music for Relief and TreePeople on October 11, 2014 at Stetson Ranch Park. Together we cared for 63 trees! 10 lucky people won tickets to see Linkin Park on October 24, 2014 at the Wiltern in Los Angeles, CA and everyone left with amazing prizes.\r\n',	'0.45',	'0.45',	'1',	'0',	'0',	'bcaff9aceab8f7c082a89a34564f69b1d644dd3d'),
(2894,	506,	97,	'image',	'1421187918',	NULL,	'Bonnaroo Volunteer Service Day',	'Bonnaroo proved to be more than just a music event last Wednesday as festival volunteers spent their morning hours at New Union Elementary School in Manchester, TN.  With the support of Hands On Nashville and Bonnaroo Works Fund, volunteers were able to complete painting, building and landscaping projects for the pre-kindergarten-fifth grade school. Music for Relief supplied the school with a cafeteria update, picnic tables, landscaping for an outdoor classroom, and a walkway to the gazebo.\r\n\r\n“New Union is an older building nestled between two newer schools, and the work and support provided by this group of volunteers gave us the facelift we needed”, said Principal Michelle Hummel. “We are so grateful for this partnership and look forward to many more opportunities to team up.”',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'192.35229357798',	'1421187877.jpg',	'512',	'384.70458715596',	'1421187877.jpg',	'1090',	'819',	'1421187877.jpg',	'1090',	'819',	'1421187877.jpg',	'1024',	'769.40917431193',	'1421187877.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/22TlopN',	'Bonnaroo proved to be more than just a music event last Wednesday as festival volunteers spent their morning hours at New Union Elementary School in Manchester, TN.  With the support of Hands On Nashville and Bonnaroo Works Fund, volunteers were able to complete painting, building and landscaping projects for the pre-kindergarten-fifth grade school. Music for Relief supplied the school with a cafeteria update, picnic tables, landscaping for an outdoor classroom, and a walkway to the gazebo.\r\n\r\n“New Union is an older building nestled between two newer schools, and the work and support provided by this group of volunteers gave us the facelift we needed”, said Principal Michelle Hummel. “We are so grateful for this partnership and look forward to many more opportunities to team up.”',	'0.53',	'0.41',	'1',	'0',	'0',	'ffc99ac964cc28ffe4d453e3091793fa1f93e850'),
