(3096,	550,	104,	'image',	'1422739310',	NULL,	'Russell Wilson Passing Academy',	'The Russell Wilson Passing Academy (RWPA) is a football camp for all positions. The purpose of this camp is to help children ages 8-17 develop the fundamental skills of being a great football player through instruction, but our objective is much greater. The RWPA exists to promote the mental and physical development of youth, with the goal of encouraging kids to develop high character and moral standards, a sense of competitiveness and fair play, a respect for authority, service to others, and a love of God, family, and country. In that spirit, the RWPA welcomes inner-city and underprivileged youth to the camp through sponsorships, giving them a much-needed and valuable opportunity to learn the game of football and compete.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'263.54791154791',	'1422739293.png',	'407',	'419',	'1422739293.png',	'407',	'419',	'1422739293.png',	'407',	'419',	'1422739293.png',	'407',	'419',	'1422739293.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Ybb1gc',	'The Russell Wilson Passing Academy (RWPA) is a football camp for all positions. The purpose of this camp is to help children ages 8-17 develop the fundamental skills of being a great football player through instruction, but our objective is much greater. The RWPA exists to promote the mental and physical development of youth, with the goal of encouraging kids to develop high character and moral standards, a sense of competitiveness and fair play, a respect for authority, service to others, and a love of God, family, and country. In that spirit, the RWPA welcomes inner-city and underprivileged youth to the camp through sponsorships, giving them a much-needed and valuable opportunity to learn the game of football and compete.',	'0.51',	'0.43',	'1',	'0',	'0',	'efeb71ff6780e4125418170ad8d7945c2536a2f5'),
