(3116,	554,	104,	'video',	'1422905202',	NULL,	'United Way',	'United Way is committed to advancing the common good. Through the work and support of the nearly 1,200 local United Ways across the country, United Way is creating opportunities for a better life for everyone. United Way doesn’t just donate or make quick fixes; they work with local communities to figure out what a place needs and helps to create real change.\r\n\r\nThis campaign seeks to motivate and inspire people to get engaged and partner with United Way in their efforts to address education, income, and health challenges in local communities to create real, lasting change. The PSAs encourage viewers to go to UnitedWay.org to find out how they can help make a difference in their own community and learn about the impact United Way has had on communities across the country. Additional PSAs developed in conjunction with the NFL extend the campaign to promote youth health and wellness by encouraging kids to be active at least 60 minutes a day.',	'0',	'',	'',	'vastvideo14229050631.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'219.18954248366',	'1422905156.png',	'459',	'393',	'1422905156.png',	'',	'',	'',	'',	'',	'',	'459',	'393',	'1422905156.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Yb9OWo',	'United Way is committed to advancing the common good. Through the work and support of the nearly 1,200 local United Ways across the country, United Way is creating opportunities for a better life for everyone. United Way doesn’t just donate or make quick fixes; they work with local communities to figure out what a place needs and helps to create real change.\r\n\r\nThis campaign seeks to motivate and inspire people to get engaged and partner with United Way in their efforts to address education, income, and health challenges in local communities to create real, lasting change. The PSAs encourage viewers to go to UnitedWay.org to find out how they can help make a difference in their own community and learn about the impact United Way has had on communities across the country. Additional PSAs developed in conjunction with the NFL extend the campaign to promote youth health and wellness by encouraging kids to be active at least 60 minutes a day.',	'0.52',	'0.32',	'1',	'0',	'0',	'5a8202823591c12067c3b4fecb219047d9c81a94'),
(3118,	554,	104,	'image',	'1422905352',	NULL,	'Alaska Airlines ',	'Alaska Airlines are ready to cheer our Chief Football Officer, Russell Wilson, all the way to a win—again.\r\n\r\nChampions never rest and that level of commitment is something Russell proves every day, both on and off the field. It’s why we are so happy to have him on our team at Alaska; we share his values, drive, and commitment to success. Recently we also have teamed up with Russell to support Strong Against Cancer, a local initiative that is ending childhood cancer. ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'151.21243523316',	'1422905251.png',	'512',	'302.42487046632',	'1422905251.png',	'772',	'456',	'1422905251.png',	'772',	'456',	'1422905251.png',	'772',	'456',	'1422905251.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbaAT9',	'Alaska Airlines are ready to cheer our Chief Football Officer, Russell Wilson, all the way to a win—again.\r\n\r\nChampions never rest and that level of commitment is something Russell proves every day, both on and off the field. It’s why we are so happy to have him on our team at Alaska; we share his values, drive, and commitment to success. Recently we also have teamed up with Russell to support Strong Against Cancer, a local initiative that is ending childhood cancer. ',	'0.64',	'0.39',	'1',	'0',	'0',	'22561cdeeaa5b7353cf0a44654d11d5e096c73b6'),
