(3122,	556,	104,	'video',	'1422909120',	NULL,	'NC State',	'Wilson led the 2010 Wolfpack to a 9–4 season that included a 23–7 win over West Virginia in the 2010 Champs Sports Bowl. He led the ACC in passing yards per game (274.1) and total offensive yards per game (307.5). Wilson graduated from NC State in three years in May 2010 with a BA in communication, and took graduate-level business courses in the fall semester during the 2010 football season.',	'0',	'',	'',	'vastvideo14229089139.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'172.4277673546',	'1422909086.png',	'512',	'344.85553470919',	'1422909086.png',	'',	'',	'',	'',	'',	'',	'533',	'359',	'1422909086.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbaCdF',	'Wilson led the 2010 Wolfpack to a 9–4 season that included a 23–7 win over West Virginia in the 2010 Champs Sports Bowl. He led the ACC in passing yards per game (274.1) and total offensive yards per game (307.5). Wilson graduated from NC State in three years in May 2010 with a BA in communication, and took graduate-level business courses in the fall semester during the 2010 football season.',	'0.5',	'0.48',	'1',	'0',	'0',	'9d9c42be746cee4da9c723e4e986e0be2b57b1d3'),
(3123,	556,	104,	'video',	'1422910994',	NULL,	'Wisconsin',	'On June 27, 2011, Wisconsin head coach Bret Bielema announced that Wilson had committed to Wisconsin for the 2011 season. In the season opener against UNLV, Wilson passed for 255 yards and 2 touchdowns in a 51–17 victory. He also rushed for 62 yards, including a 46-yard touchdown run. At the end of the regular season, Wilson was named first team All-Big Ten by both the coaches and media. Wilson also won the Griese-Brees Big Ten Quarterback of the Year award. In December 2011, Wilson was named a third team All-American by Yahoo Sports, and he finished ninth in the voting for the Heisman Trophy with 52 points.',	'0',	'',	'',	'vastvideo14229091242.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'146.7254509018',	'1422910965.png',	'499',	'286',	'1422910965.png',	'',	'',	'',	'',	'',	'',	'499',	'286',	'1422910965.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbaD1k',	'On June 27, 2011, Wisconsin head coach Bret Bielema announced that Wilson had committed to Wisconsin for the 2011 season. In the season opener against UNLV, Wilson passed for 255 yards and 2 touchdowns in a 51–17 victory. He also rushed for 62 yards, including a 46-yard touchdown run. At the end of the regular season, Wilson was named first team All-Big Ten by both the coaches and media. Wilson also won the Griese-Brees Big Ten Quarterback of the Year award. In December 2011, Wilson was named a third team All-American by Yahoo Sports, and he finished ninth in the voting for the Heisman Trophy with 52 points.',	'0.5',	'0.42',	'1',	'0',	'0',	'a143732c2edf4a0d81a9d5a26a81ec729d46db90'),
