(3127,	557,	104,	'image',	'1422911623',	NULL,	'The Big Leagues',	'On June 8, 2010, Russell was drafted by the Colorado Rockies in the fourth round (140th pick overall) of the 2010 MLB Draft. That summer he played 32 games as a second baseman for the Tri-City Dust Devils, the Class A Short Season affiliate of the Rockies in the Northwest League. In the summer of 2011, Wilson played 61 games with the Asheville Tourists, the Class A affiliate of the Colorado Rockies in the South Atlantic League. On December 12, 2013, Russell was acquired from the Rockies by the Texas Rangers in the Triple-A phase of the Rule 5 draft. On March 3, 2014, Wilson attended Rangers spring training in Surprise, Arizona where he spoke to the team and participated in infield drills.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'122.04343329886',	'1422911586.png',	'512',	'244.08686659772',	'1422911586.png',	'967',	'461',	'1422911586.png',	'967',	'461',	'1422911586.png',	'967',	'461',	'1422911586.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbaqLI',	'On June 8, 2010, Russell was drafted by the Colorado Rockies in the fourth round (140th pick overall) of the 2010 MLB Draft. That summer he played 32 games as a second baseman for the Tri-City Dust Devils, the Class A Short Season affiliate of the Rockies in the Northwest League. In the summer of 2011, Wilson played 61 games with the Asheville Tourists, the Class A affiliate of the Colorado Rockies in the South Atlantic League. On December 12, 2013, Russell was acquired from the Rockies by the Texas Rangers in the Triple-A phase of the Rule 5 draft. On March 3, 2014, Wilson attended Rangers spring training in Surprise, Arizona where he spoke to the team and participated in infield drills.',	'0.48',	'0.25',	'1',	'0',	'0',	'8f61852cd87712036bd97a580dcbdcd0f886c91a'),
