(3180,	565,	106,	'image',	'1423098868',	NULL,	'Victory ',	'Facing a very solid Suns squad that had already defeated them earlier in the season, the Warriors responded to their two-straight losses with one of their most dominant, and I’d argue important, victories of the year to date. Not only did they earn a division win over a possible first round playoff opponent, they did so by getting back to the identity they’ve developed as a team that uses its dominant defense to catalyze its dominant offense. After allowing at least 110 points in four of their previous five games, the Warriors held the league’s second-highest scoring offense to season-lows in total points (87) and field goal percentage (36.3%), while forcing 22 turnovers. The victory halted the Warriors losing “streak” at a whopping two games, an instance that’s been matched only two other times this season. Speaking of which, the other two times they lost two in a row, they followed with 16- and eight-game win streaks. To compare, last year’s NBA Champion Spurs (62-20) lost consecutive games only twice throughout the entire season, with their longest losing streak equaling three games.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'148.99470899471',	'1423098790.jpg',	'512',	'297.98941798942',	'1423098790.jpg',	'756',	'440',	'1423098790.jpg',	'756',	'440',	'1423098790.jpg',	'756',	'440',	'1423098790.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/219GvCF',	'Facing a very solid Suns squad that had already defeated them earlier in the season, the Warriors responded to their two-straight losses with one of their most dominant, and I’d argue important, victories of the year to date. Not only did they earn a division win over a possible first round playoff opponent, they did so by getting back to the identity they’ve developed as a team that uses its dominant defense to catalyze its dominant offense. After allowing at least 110 points in four of their previous five games, the Warriors held the league’s second-highest scoring offense to season-lows in total points (87) and field goal percentage (36.3%), while forcing 22 turnovers. The victory halted the Warriors losing “streak” at a whopping two games, an instance that’s been matched only two other times this season. Speaking of which, the other two times they lost two in a row, they followed with 16- and eight-game win streaks. To compare, last year’s NBA Champion Spurs (62-20) lost consecutive games only twice throughout the entire season, with their longest losing streak equaling three games.',	'0.51',	'0.08',	'1',	'0',	'0',	'c5c17e5b9fa1f6bec8b49e027af08fe778d49ba7'),
