(3189,	567,	107,	'image',	'1423159936',	NULL,	'#MLK Day',	'“In 1968, Martin had dinner in my house with my family. This was 28 days before he was assassinated. He said to me, ‘Don, I don\'t know what I would\'ve done without you guys setting up the minds of people for change. You, Jackie, and Roy will never know how easy you made it for me to do my job.’ Can you imagine that? How easy we made it for Martin Luther King!”\r\n\r\n–Don Newcombe via TIME Magazine ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'200.26666666667',	'1423159916.jpg',	'512',	'400.53333333333',	'1423159916.jpg',	'960',	'751',	'1423159916.jpg',	'960',	'751',	'1423159916.jpg',	'960',	'751',	'1423159916.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbcPpF',	'“In 1968, Martin had dinner in my house with my family. This was 28 days before he was assassinated. He said to me, ‘Don, I don\'t know what I would\'ve done without you guys setting up the minds of people for change. You, Jackie, and Roy will never know how easy you made it for me to do my job.’ Can you imagine that? How easy we made it for Martin Luther King!”\r\n\r\n–Don Newcombe via TIME Magazine ',	'0.5',	'0.23',	'1',	'0',	'0',	'a89586f00ef00aec8864efda3f672cb97d1cfbd3'),
