(3489,	618,	111,	'image',	'1426830840',	NULL,	'Meet Chappie',	'Set in the near future, crime is patrolled by a harsh mechanized police force. But when a police droid named Chappie is taken and re-programmed, he begins to think and feel for the first time in his existence. Now seen as a threat, our robotic hero must now choose where it will stand as the oppressed population begins to stand up for themselves.\r\n\r\nShot in Johnannesburg, South Africa, Chappie stars Dev Patel (Slumdog Millionaire), Academy Award nominees Hugh Jackman and Sigourney Weaver, and Sharlto Copley (The A-Team) as the voice of the titular character.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'381.65137614679',	'1427306012.png',	'512',	'763.30275229358',	'1427306012.png',	'872',	'1300',	'1427306012.png',	'872',	'1300',	'1427306012.png',	'872',	'1300',	'1427306012.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbfPlQ',	'Set in the near future, crime is patrolled by a harsh mechanized police force. But when a police droid named Chappie is taken and re-programmed, he begins to think and feel for the first time in his existence. Now seen as a threat, our robotic hero must now choose where it will stand as the oppressed population begins to stand up for themselves.\r\n\r\nShot in Johnannesburg, South Africa, Chappie stars Dev Patel (Slumdog Millionaire), Academy Award nominees Hugh Jackman and Sigourney Weaver, and Sharlto Copley (The A-Team) as the voice of the titular character.',	'0.47',	'0.28',	'1',	'0',	'1',	'cd5cec8f4b6b2db98fcdfa9367c7596a85606ace'),
(3490,	617,	111,	'image',	'1426744500',	NULL,	'ECHOSMITH NEW SINGLE – BRIGHT',	'Just this week, Echosmith has premiered their video for  “Bright,” their new single already making waves on the airwaves. The alt-pop band is young – all siblings, all between the ages of 15 and 21 – and they have that fresh new feel that comes with so much early talent. Their previous single, “Cool Kids,” was a breakout hit, going platinum, and “Bright” promises the same light-hearted but earnest look at the world. Lead singer Sydney Sierota said the song is “just about love.” The video is beautiful and romantic, matching lyrics about the stars and planets with a storyline of a group of friends gathering for a meteor shower. It’s a good song for Valentine’s day; sweet.',	'0',	'',	'1427306102.mp3',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'167.01858736059',	'1427306079.png',	'512',	'334.03717472119',	'1427306079.png',	'1076',	'702',	'1427306079.png',	'1076',	'702',	'1427306079.png',	'1024',	'668.07434944238',	'1427306079.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbfM9I',	'Just this week, Echosmith has premiered their video for  “Bright,” their new single already making waves on the airwaves. The alt-pop band is young – all siblings, all between the ages of 15 and 21 – and they have that fresh new feel that comes with so much early talent. Their previous single, “Cool Kids,” was a breakout hit, going platinum, and “Bright” promises the same light-hearted but earnest look at the world. Lead singer Sydney Sierota said the song is “just about love.” The video is beautiful and romantic, matching lyrics about the stars and planets with a storyline of a group of friends gathering for a meteor shower. It’s a good song for Valentine’s day; sweet.',	'0.45',	'0.41',	'1',	'0',	'1',	'0b99e24b0658160ef86adaad5a55cfb572fdda4b'),
(3491,	619,	111,	'image',	'1421305080',	NULL,	'BECAUSE A GETAWAY IS ALWAYS THE BEST OPTION',	'Sometimes life can feel like a little too much to deal with. You can’t handle your noisy neighbors, the not-even-a-single-bit-friendly boss stresses you out 24/7, your family doesn’t give you a break… Man or woman, young or old, at some point we all catch ourselves thinking about having a break from routine. When this happens, take it as life calling you up to remind you of how much more of the world there is outside of the daily grind.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'189.14285714286',	'1427306297.png',	'512',	'378.28571428571',	'1427306297.png',	'896',	'662',	'1427306297.png',	'896',	'662',	'1427306297.png',	'896',	'662',	'1427306297.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Ybf0cQ',	'Sometimes life can feel like a little too much to deal with. You can’t handle your noisy neighbors, the not-even-a-single-bit-friendly boss stresses you out 24/7, your family doesn’t give you a break… Man or woman, young or old, at some point we all catch ourselves thinking about having a break from routine. When this happens, take it as life calling you up to remind you of how much more of the world there is outside of the daily grind.',	'0.56',	'0.61',	'1',	'0',	'1',	'14269a4376fa1177c9352763dbbd0b47ab27531a'),
(3492,	619,	111,	'image',	'1423119600',	NULL,	'PATRICIA VELASQUEZ’ MEMOIR – “STRAIGHT WALK”',	'Venezuelan supermodel, actress, businesswoman and philanthropist Patricia Velasquez recently celebrated the release of her memoir, Straight Walk: A Supermodel’s Journey to Finding Her Truth (via Post Hill Press) about her remarkable coming out story and career on the catwalk. Her poignant account of working to lift her family out of poverty carries an empowering message of compassion and acceptance that encourages others to realize their own potential. As Velasquez stated, “After all of the hard work and energy that went into writing this book, it’s so nice to be able to celebrate the release…. I’m so grateful that I was able to have the chance to talk about my life and continue to hope it inspires others to walk their truth.”',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'364.22764227642',	'1427306376.png',	'512',	'728.45528455285',	'1427306376.png',	'738',	'1050',	'1427306376.png',	'738',	'1050',	'1427306376.png',	'738',	'1050',	'1427306376.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1YbfEai',	'Venezuelan supermodel, actress, businesswoman and philanthropist Patricia Velasquez recently celebrated the release of her memoir, Straight Walk: A Supermodel’s Journey to Finding Her Truth (via Post Hill Press) about her remarkable coming out story and career on the catwalk. Her poignant account of working to lift her family out of poverty carries an empowering message of compassion and acceptance that encourages others to realize their own potential. As Velasquez stated, “After all of the hard work and energy that went into writing this book, it’s so nice to be able to celebrate the release…. I’m so grateful that I was able to have the chance to talk about my life and continue to hope it inspires others to walk their truth.”',	'0.66',	'0.37',	'1',	'0',	'1',	'16d82a40de473d467b064456e769e5b4a9e69cdd'),
