(3496,	618,	111,	'image',	'1422256260',	NULL,	'\"THE EXPERIMENTER\" PREMIERES AT SUNDANCE',	'Michael Almereyda’s seventh film at Sundance, Experimenter, is a film that asks more questions than answers them. As Almereyda (2001’s Hamlet, Trance) stated before the film began, Stanley Milgram, the film’s biopic subject, was “better at asking questions than answering them.” The film does exactly the same by asking questions, but on the surface. In the vein of films you may have seen before, like, most recently, The Imitation Game, Experimenter seems to give us the factual standpoints: i.e.- the things we can easily just learn by picking up textbook or reading up on Wikipedia.\r\n\r\nClick the video to hear star Peter Skarsgard talk about the film.',	'0',	'',	'',	'',	'',	'',	'',	'vastsecvideo14273067541.mp4',	NULL,	NULL,	'256',	'143.14503816794',	'1427307000.png',	'512',	'286.29007633588',	'1427307000.png',	'1048',	'586',	'1427307000.png',	'1048',	'586',	'1427307000.png',	'1024',	'572.58015267176',	'1427307000.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/1Ybf1gF',	'Michael Almereyda’s seventh film at Sundance, Experimenter, is a film that asks more questions than answers them. As Almereyda (2001’s Hamlet, Trance) stated before the film began, Stanley Milgram, the film’s biopic subject, was “better at asking questions than answering them.” The film does exactly the same by asking questions, but on the surface. In the vein of films you may have seen before, like, most recently, The Imitation Game, Experimenter seems to give us the factual standpoints: i.e.- the things we can easily just learn by picking up textbook or reading up on Wikipedia.\r\n\r\nClick the video to hear star Peter Skarsgard talk about the film.',	'0.22',	'0.14',	'1',	'0',	'1',	'fdc1d06328a64e47abd1d099e9bdeb63d2e05ab0'),
