(3525,	631,	120,	'video',	'1428290170',	NULL,	'Fall-Winter 15/16 Ready-to-Wear Show',	'The Fall-Winter 2015/16 Ready-to-Wear collection was unveiled within a bistro environment designed by Karl Lagerfeld which he named the \"Brasserie Gabrielle\". This larger-than-life \"brasserie,\" an institution that has long embodied the Parisian lifestyle, was constructed inside the Grand Palais and perfectly conveyed the spirit of the collection.\r\n\r\nUsing vocabulary that its creator deemed \"very French,\" this \"French Collection\" reinterprets the wardrobe of a modern \"bourgeoise,\" a woman who exudes Parisian chic and cosmopolitan culture, who could grace the streets of any major city around the world.',	'0',	'',	'',	'vastvideo14282894651.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.79346210996',	'1428289792.jpg',	'512',	'341.58692421991',	'1428289792.jpg',	'',	'',	'',	'',	'',	'',	'673',	'449',	'1428289792.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/219II13',	'The Fall-Winter 2015/16 Ready-to-Wear collection was unveiled within a bistro environment designed by Karl Lagerfeld which he named the \"Brasserie Gabrielle\". This larger-than-life \"brasserie,\" an institution that has long embodied the Parisian lifestyle, was constructed inside the Grand Palais and perfectly conveyed the spirit of the collection.\r\n\r\nUsing vocabulary that its creator deemed \"very French,\" this \"French Collection\" reinterprets the wardrobe of a modern \"bourgeoise,\" a woman who exudes Parisian chic and cosmopolitan culture, who could grace the streets of any major city around the world.',	'0.69',	'0.49',	'1',	'0',	'0',	'8d71b6b15153291108d5ace8a2858748f45b15b3'),
