(4012,	810,	165,	'video',	'1446567153',	NULL,	'The Pack',	'',	'0',	'',	'',	'vastvideo14465666084.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'vastvideo14465666084-thumbnail-00004.jpg',	'512',	'288',	'vastvideo14465666084-thumbnail-00004.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'576',	'vastvideo14465666084-thumbnail-00004.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25OczPK',	'The ones with the guts to stand apart join a league all of their own. With legendary power, performance and dependability, we’re determined to work hard and boldly forge ahead to get the job done. ',	'0.5',	'0.5',	'1',	'0',	'0',	'cd08bb65be6f40693abef9820278b3106d8d43d3'),
(4014,	810,	165,	'video',	'1446568210',	NULL,	'More Than a Job',	'',	'0',	'',	'',	'vastvideo14465671620.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'144',	'vastvideo14465671620-thumbnail-00004.jpg',	'512',	'288',	'vastvideo14465671620-thumbnail-00004.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'576',	'vastvideo14465671620-thumbnail-00004.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25ObCqG',	'Dennis Schutz is a lifelong hunter, a hunting guide, and a steward of the land. He helps hunters experience the thrill of standing just a few feet away from the powerful, intelligent creatures they’re after.',	'0.5',	'0.5',	'1',	'0',	'0',	'860d81dcc4c5d0f6ee3177024b936a6cb61c45f0'),
(4015,	810,	165,	'video',	'1446568800',	NULL,	'“Sorry, Mom”',	'',	'0',	'',	'',	'vastvideo14465683207.mp4',	'',	'',	'',	'',	NULL,	NULL,	'256',	'160.08533333333',	'1446569426.jpg',	'512',	'320.17066666667',	'1446569426.jpg',	'',	'',	'',	'',	'',	'',	'1024',	'640.34133333333',	'1446569426.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/25OcpYI',	'There’s always been one person, a voice of authority, who out of concern and worry has never championed these adrenaline-fueled rushes: Mom. This one’s for her. ',	'0.5',	'0.5',	'1',	'0',	'1',	'76d612e55553328649474e67736ca260087b7067'),
