(4510,	110,	24,	'image',	'1409117160',	NULL,	'#willpower album cover.',	'here is the final album cover for will.i.am\'s solo project #willpower. i absolutely love what they did to the photograph i shot by adding the orange background. the package \"popped\" in stores and the orange unified the campaign everywhere else.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'256',	'vast_mig_1474456374.jpg',	'512',	'512',	'vast_mig_1474456374.jpg',	'3500',	'3500',	'vast_mig_1474456374.jpg',	'2048',	'2048',	'vast_mig_1474456374.jpg',	'1024',	'1024',	'vast_mig_1474456374.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/2kYwkGF',	'Here is the final album cover for will.i.am\'s solo project #willpower. I absolutely love what they did to the photograph by adding the orange background – it made the package \"pop\" at retail and unified the artwork everywhere else.',	'0.5',	'0.53',	'1',	'0',	'1',	'dae15bb530d7b4ef8827caf11ed19d5f854619d4'),
(4511,	110,	24,	'image',	'1409136840',	NULL,	'Proposed #willpower cover.',	'this was the original shot submitted to will.i.am for the cover of his album #willpower. i love this shot and the fact that the \"step\" in his fade became his logo for this project.this was my first \"official\" shoot as a photographer and what will and his designer pasha ended up doing with this series for the final packaging actually blew my mind. they took it to the next level and made everything i shot stand out in the crowd – on the shelf, on the streets of london and new york city, and in the sold out arenas. #design rules ',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'170.25',	'thebridgeco1481671407.png',	'512',	'340.5',	'thebridgeco1481671407.png',	'1024',	'681',	'thebridgeco1481671407.png',	'1024',	'681',	'thebridgeco1481671407.png',	'1024',	'681',	'thebridgeco1481671407.png',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/2kYw3DC',	'This was the original shot that I submitted to will.i.am for the cover of #willpower. He and his designer Pascha ended up doing something better with another one of my shots. See it at the end of this chapter.',	'0.5',	' 0.5',	'1',	'0',	'1',	'd833a707f42d83dcc3f11229b5355e341432b12a'),
(4512,	110,	24,	'image',	'1409730540',	NULL,	'IAMAUTO2.',	'this is the original style of the second car that will.i.am designed for IAMAUTO. the jeans were special to me as it reconnected will to the Brand that introduced us in 2001 Levi Strauss & Co. the 501 jeans he is wearing were made from 8 recycled coca-cola bottles in addition to the world\'s best denim.',	'0',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	'256',	'255.36159600998',	'vast_mig_1474456299.jpg',	'512',	'510.72319201995',	'vast_mig_1474456299.jpg',	'2005',	'2000',	'vast_mig_1474456299.jpg',	'2005',	'2000',	'vast_mig_1474456299.jpg',	'1024',	'1021.4463840399',	'vast_mig_1474456299.jpg',	'',	'',	'',	NULL,	NULL,	'',	'',	'http://j.mp/2kYkxYD',	'This is the second car that will.i.am designed for IAMAUTO. The Levi\'s jeans that will is wearing in this shot were special to me as it reconnected will to the Brand that introduced us in 2001.',	'0.51',	'0.24',	'1',	'0',	'1',	'5f6849aa7d1ce2512e3fad912f5896a6d4fa64c3'),
