  `post_status` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `featured_post` enum('0','1') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `post_edit` enum('0','1') CHARACTER SET utf8 NOT NULL DEFAULT '0' COMMENT '0 - new post, 1 - edit post',
  `post_hash` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`post_id`),
  KEY `chapter_id` (`chapter_id`),
  KEY `channel_id` (`channel_id`),
  KEY `subscription_id` (`subscription_id`),
  CONSTRAINT `tbl_posts_ibfk_1` FOREIGN KEY (`chapter_id`) REFERENCES `tbl_chapters` (`chapter_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_posts_ibfk_2` FOREIGN KEY (`channel_id`) REFERENCES `tbl_channels` (`channel_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


